INSERT INTO `question` VALUES (1770998897104138242,'在项目中如何利用 Redis 实现分布式 Session？Redis 的主要优势是什么？','','[\'后端\', \'Redis\', \'编程导航\']','Redis 是一个开源的、基于内存的 K/V 存储中间件。由于基于内存，其读写性能非常高，很适用于缓存。此外，Redis 支持多种数据结构、各类编程语言的客户端、支持持久数据，其生态也非常广泛。\n\n本项目中，我使用 Redis 分布式 Session 来代替 Tomcat 本地的 Session 存储，能够在分布式多机场景下保证获取登录用户信息的一致性。用 Redis 实现分布式 Session 的优点是非常简单方便，只需要引入 Redis 和 spring-session-data-redis 依赖，然后在配置文件中指定 Redis 的地址和 session 的 store-type 为 redis，即可自动生效，不用自己额外编码。',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:53:49',0),(1770999671527845889,'在 Redis 中，使用 Hash 代替 String 存储用户信息的好处是什么？Hash 与 String 存储方式有何区别？','','[\'后端\', \'Redis\', \'编程导航\']','Redis 的 Hash 结构采用 key / value 键值对的形式存储数据，使用 Redis 的 Hash 来存储用户信息后，能够很方便地对用户每个属性进行独立的更新和查询操作，而不是更新和返回整个 JSON 字符串，性能会更高。\n\n举个例子，你想要获取用户的昵称（就 4 个字符串），但是用户的简介有 100 KB 的大小。如果用 Hash 结构，可以只获取昵称，网络传输的内容大小就很小；而如果用 String 结构整体存储，网络传输数据时会把所有的用户信息都返回出来，增加传输开销。\n\n此外，相比于直接在 Spring Boot 中使用 String 类型存储用户信息，使用 Hash 结构不用额外存储序列化对象信息，可以一定程度上节省内存。',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:54:28',0),(1771000775024062465,'请解释一下 Java 8 Stream API 和 Lambda 表达式的作用，以及在项目中如何应用它们来简化集合处理？','','[\'后端\', \'Java特性\', \'编程导航\']','Stream API 和 Lambda 表达式是 Java 8 提供的语法糖，它们的作用是使集合处理更加简洁、易读和高效。\nLambda 表达式是一种匿名函数，允许你以更紧凑的方式传递代码块，简化代码的编写，比如：\n```\n// 使用 Lambda 表达式过滤以 \"A\" 开头的名字\nList<String> filteredNames = names.stream()\n    .filter(name -> name.startsWith(\"A\"))\n    .collect(Collectors.toList());\n```\n\nStream API 是一种流式操作集合的方法，提供了丰富的集合处理操作，比如过滤、映射、排序等，还支持延迟加载和并行处理，简化代码、并提高编码效率。\n\n上述代码示例同样也是 Stream API 的应用。\n\n在本项目中，匹配相似用户时，将存储用户和匹配度的 List 转化为 Stream 流，用 sorted 方法进行编辑距离由小到大排序，用 limit 方法取流的前 N 项，用 collect 终结操作将处理好的流转化为集合 List。还有使用 Stream API 的 map 方法对用户列表中的每个用户信息进行脱敏、使用ParallelStream 实现并发流等。',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:55:08',0),(1771001149567021057,'你提到使用 Easy Excel 进行批量导入数据库，能否介绍一下 Easy Excel 的使用方法和优势？','','[\'后端\', \'Easy Excel\', \'编程导航\']','项目中，我使用 Easy Excel 从 Excel 表格中批量导入用户信息到 MySQL，之所以选择 Easy Excel，不仅是因为它简单易用、并且性能优越，更多的是它能够节约内存、解决大文件内存溢出问题。比如一个 3M 的 excel 用 POI sax 解析依然需要 100M 左右内存，改用 easyexcel 可以降低到几 M，并且再大的 excel 也不会出现内存溢出。\n\n在项目中，对于数据量小的文件，我采用同步模式一次性获取所有表格数据并存储到 List 中；对于数据量大的文件，我采用自定义 Listener 的方式异步逐行读取 Excel 并分批插入到数据库中。',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:55:48',0),(1771004113190924290,'你是如何自定义线程池的？如何合理设置线程池的参数？\n','','[\'后端\', \'并发编程\', \'编程导航\']','项目中，我使用 ThreadPoolExecutor 实现灵活的自定义线程池，并通过 ArrayBlockingQueue 存放任务。针对每类不同的业务，我分别定义不同的线程池，让它们互不影响。\n\n示例代码：\n\n```java\nExecutorService executorService = new ThreadPoolExecutor(40, 1000, 10000, TimeUnit.MINUTES, new ArrayBlockingQueue<>(10000));\n```\n\n自定义线程池参数如下：\n1. 核心线程数（corePoolSize）：线程池中一直保持活动的线程数。可以使用corePoolSize方法来设置。一般情况下，可以根据系统的资源情况和任务的特性来设置合适的值。\n2. 最大线程数（maximumPoolSize）：线程池中允许存在的最大线程数。可以使用maximumPoolSize方法来设置。如果所有线程都处于活动状态，而此时又有新的任务提交，线程池会创建新的线程，直到达到最大线程数。\n3. 空闲线程存活时间（keepAliveTime）：当线程池中的线程数量超过核心线程数时，如果这些线程在一定时间内没有执行任务，则这些线程会被销毁。可以使用keepAliveTime和TimeUnit方法来设置。\n4. 阻塞队列（workQueue）：用于存放等待执行的任务的阻塞队列。可以根据任务的特性选择不同类型的队列，如LinkedBlockingQueue、ArrayBlockingQueue等。默认情况下，使用无界阻塞队列，即LinkedBlockingQueue，但也可以根据需要设置有界队列。\n5. 线程工厂（threadFactory）：用于创建线程的工厂。可以通过实现ThreadFactory接口自定义线程的创建逻辑。\n6. 拒绝策略（rejectedExecutionHandler）：当线程池无法接受新的任务时，会根据设置的拒绝策略进行处理。常见的拒绝策略有AbortPolicy、DiscardPolicy、DiscardOldestPolicy和CallerRunsPolicy。\n\n我是根据任务的类型以及消耗资源的情况来调整线程池的参数。比如针对更消耗 CPU 资源的计算密集型任务，我会将核心线程数设置为和 CPU 核心数相同，充分利用系统资源；针对更消耗网络等 IO 的 IO 密集型任务，我会将核心线程数设置得更大，比如 CPU 核心数的 2 - 4 倍，能够增加并发度、并且提高 CPU 的利用率。\n\n有一个经验值公式，其中 N 为 CPU 核心数：CPU 密集型任务，核心线程数设置为 N（或 N + 1）；IO 密集型任务，核心线程数设置为 2N。',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:56:29',0),(1771005166586179585,'你是如何测试批量导入数据库的性能的？用了哪些工具或方法？','','[\'后端\', \'Spring\', \'编程导航\']','首先我编写了一个单元测试类，使得测试代码不影响主业务代码。然后通过 Spring 的 StopWatch 实现批量导入数据库的耗时统计。\n\n在测试过程中，我不断地调整数据批量插入的组数、每组数据量、以及并发线程数，尝试找到一个性能最佳的配置。\n\n注意，这里不是对接口的压力测试，没有必要使用 JMeter 压测工具。',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:57:09',0),(1771005674554142721,'为什么在 Redis 中需要自定义序列化器？如何实现自定义序列化器？','','[\'后端\', \'Redis\', \'编程导航\']','由于 Spring Boot Data Redis 默认使用 JDK 序列化器，会将存储到 Redis 的键值对转化为字节数组，不利于在 Redis 可视化工具中阅读、并且不利于跨语言兼容，所以需要指定序列化器。\n\n所以我通过新建 RedisTemplateConfig 配置类来创建自定义的 RedisTemplate Bean，并且通过 redisTemplate.setKeySerializer(RedisSerializer.string()) 指定了 Redis Key 的序列化方式。\n\n示例代码如下：\n\n\n```java\n@Configuration\npublic class RedisTemplateConfig {\n    @Bean\n    public RedisTemplate<String, Object> redisTemplate(RedisConnectionFactory connectionFactory) {\n        RedisTemplate<String, Object> redisTemplate = new RedisTemplate<>();\n        redisTemplate.setConnectionFactory(connectionFactory);\n        redisTemplate.setKeySerializer(RedisSerializer.string());\n        return redisTemplate;\n    }\n}\n```\n\n',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:57:48',0),(1771006256132141057,'在项目中如何实现 Redis 缓存？你选择了哪种 Redis 数据结构？','','[\'后端\', \'Redis\', \'编程导航\']','我的项目中，使用 Redis 缓存实现了登录用户信息的存储、主页推荐用户列表的存储。\n\n具体的实现方式：\n- 对于登录用户信息的存储，直接使用 spring-session-data-redis 依赖开启对 Redis 分布式 Session 的支持。\n- 对于主页用户推荐列表的存储，我使用 Spring Data Redis 整合 Redis，并通过 RedisTemplate 来操作 Redis，根据业务类型设计了缓存 key 的规则，选用 string 数据结构来存储推荐用户列表。',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:58:26',0),(1771007349121626113,'使用 Redis 缓存时可能出现的常见问题有哪些？你是如何解决这些问题的？','','[\'后端\', \'Redis\', \'编程导航\']','建议先列举使用缓存可能出现的常见问题，然后再挑其中一点举例。\n使用 Redis 缓存可能的常见问题：\n\n1）缓存击穿： 缓存击穿指的是某个热门的缓存键在过期后，同时有大量并发请求到达，导致所有请求都穿透缓存直接访问数据库，造成数据库压力激增。解决方法包括： \n- 使用互斥锁来保护缓存访问，只允许一个线程重新生成缓存。\n- 针对缓存失效时的并发请求使用分布式锁，确保只有一个线程重新生成缓存。\n\n2）缓存雪崩： 缓存雪崩指的是大量缓存键在相同时间失效，导致大量请求落到数据库上，造成数据库压力激增。解决方法包括： \n- 为缓存键设置不同的失效时间，使失效时间分散。\n- 使用热点数据预热，提前加载热门数据到缓存。\n\n3）缓存过期问题： 缓存中的数据过期后可能会导致数据不一致或数据不可用。解决方法包括： \n- 设置合理的缓存失效时间，避免缓存数据长时间不更新。\n- 使用缓存的时候检查数据是否过期，如果过期则重新生成缓存。\n\n4）缓存内存问题： 如果缓存数据量很大，可能会导致内存占用过多。解决方法包括： \n- 设置合理的内存限制，避免缓存数据过多。\n- 使用LRU（Least Recently Used）策略或淘汰算法来淘汰不常用的缓存数据。\n\n5）缓存数据一致性问题： 缓存数据和数据库数据不一致。解决方法包括： \n- 使用缓存更新策略，当数据库数据发生变化时，及时更新缓存。\n- 使用双写策略，即同时更新数据库和缓存，确保数据一致性。\n\n6）缓存安全问题： 某些敏感数据可能不应该被缓存，如果被缓存可能引发安全问题。解决方法包括： \n- 避免缓存敏感数据。\n- 使用加密或其他安全措施来保护缓存数据。\n\n7）缓存监控和调优问题： 缓存需要监控和调优，以确保性能和稳定性。解决方法包括： \n- 使用监控工具来监测缓存的命中率、内存占用等性能指标。\n- 定期调整缓存配置，优化性能。\n\n在本项目中，我通过给不同的缓存设置不同的随机过期时间（N + n）来解决缓存雪崩问题。',1,'2024-09-04 02:18:09','2024-09-04 02:18:09','2024-09-04 04:59:05',0),(1771008054117019649,'在解决首页加载过慢的问题中，你使用了 Spring Scheduler 定时任务和分布式锁，请解释一下定时任务的执行原理和此处分布式锁的作用。','','[\'后端\', \'定时任务\', \'分布式锁\', \'编程导航\']','项目使用 Spring Scheduler 实现定时任务，我将每个任务定义为独立的 Job 类，并且给实际需要定时执行的方法增加 @Scheduled 注解来开启定时任务。\n\n在 @Scheduled 注解中，我使用 crontab 表达式来定义执行定时任务的时间周期，Spring Scheduler 会根据这些定义，在时机到达时开启独立的线程来执行任务。\n\n在分布式场景下，可能有多个服务器实例同时执行同一个定时任务，导致并发问题或重复执行，所以用分布式锁来保证定时任务执行的唯一性。当定时任务要执行时，先去抢锁，只有抢到锁的服务器实例才会执行定时任务。\n',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 04:59:45',0),(1771008942432858113,'Redisson 分布式锁在 Redis 中如何解决接口幂等性？其使用场景和实现原理是什么？','','[\'后端\', \'Redisson\', \'编程导航\']','Redisson 是一个基于 Redis 的数据网格，它提供了开箱即用的分布式锁功能，用于解决分布式环境下的并发控制问题。\n比如在项目中，使用 Redisson 分布式锁保证接口幂等性，防止多个用户同时操作或重复提交带来的数据不一致。\n\nRedisson 分布式锁的实现是基于 Redis 的 SETNX 命令和 Lua 脚本，具体的实现原理如下：\n\n1. 获取锁：当客户端请求获取锁时，Redisson 会向 Redis 发送一个 SETNX 命令，尝试将一个特定的键（锁的标识）设置为一个特定的值（客户端标识），并设置锁的超时时间。 \n2. 争用锁：如果多个客户端同时尝试获取同一个锁，只有一个客户端能够成功设置键的值，其他客户端的 SETNX 命令将失败，它们会继续尝试获取锁。 \n3. 锁超时：为了防止某个客户端获取锁后发生异常导致锁永远不会被释放，Redisson 设置了锁的超时时间。当锁的超时时间到达后，Redisson 会自动释放锁，允许其他客户端获取锁。 \n4. 释放锁：当客户端执行完锁保护的操作后，可以主动释放锁，这将删除锁的标识键，或者锁的自动超时也会导致锁的释放。 \n5. 锁的可重入性：Redisson 支持可重入锁，允许同一客户端多次获取同一个锁，然后多次释放锁。只有所有获取锁的次数都释放后，锁才会被完全释放。 \n6. 锁的续期：如果一个客户端在持有锁时，锁的超时时间即将到期，Redisson会自动为锁续期，防止锁在操作过程中被自动释放。 ',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 05:00:25',0),(1771009385057759234,'编辑距离算法是什么，它在你实现的用户匹配功能中起到了什么作用？请解释一下编辑距离算法的实现原理。','','[\'后端\', \'编辑距离算法\', \'编程导航\']','编辑距离算法是一种用于度量两个字符串之间的相似度或差异性的算法，常用于字符串相似度比较、拼写检查等场景。\n\n在用户匹配功能中，我使用编辑距离算法来计算用户输入的搜索关键词与已有用户信息的匹配程度，并按照相似度进行排序，从而实现最相似用户的推荐。\n\n编辑距离算法的实现原理：[https://blog.csdn.net/DBC_121/article/details/104198838](https://blog.csdn.net/DBC_121/article/details/104198838)',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 05:01:05',0),(1771010095426056193,'你提到使用优先队列来减少 TOP N 运算过程中的内存占用，能否解释一下优先队列的特点和在项目中的具体应用？','','[\'后端\', \'优先队列\', \'编程导航\']','优先队列中的元素按照优先级顺序进行排列，一般优先级越高的元素越早出队。优先队列的插入和删除操作非常高效，并且能够快速访问到优先级最高 / 低的元素，很适用于查找 Top N 元素、任务调度等场景。\n\n在项目中，使用优先队列来存储从数据库中查询出来的 TopN 最相似用户。把相似度作为优先级，淘汰相似度小于当前队列 TopN 的用户，存入相似度大于当前队列 TopN 的用户，将队列的元素个数始终维持在 N 个，从而减少了内存占用。',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 05:01:44',0),(1771010371960713217,'在项目中，你自主编写了 Dockerfile 来实现自动化镜像构建及容器部署，请介绍一下用 Docker 的优势？\n','','[\'后端\', \'部署\', \'编程导航\']','可以把 Docker 镜像想象成应用的安装包，我通过编写 Dockerfile 制作了项目的安装包，开发者可以使用该 Docker 镜像一键快速启动项目，无需手动安装 Java 等依赖项、并且手动输入启动 jar 包的命令，便于分发应用程序、并且提高应用部署效率。\n\n此外，通过给 Docker 镜像打 tag，可以控制应用程序的版本，便于项目的持续发布和回滚。\n',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 05:02:25',0),(1771010824664526849,'你在项目中使用 Knife4j 和 Swagger 自动生成后端接口文档，请解释一下 Swagger 的作用，以及在项目中使用 Swagger 的好处。','','[\'后端\', \'接口文档\', \'编程导航\']','使用 Swagger 接口文档生成工具后，我不需要在开发完项目后手动编写一套接口文档，而是直接交由系统自动根据 Controller 接口层的代码自动生成文档，大幅节省时间。\n\n使用 Swagger 生成的接口文档不仅能够分组查看请求参数和响应，还支持灵活的在线调试，可以直接通过界面发送请求来测试接口，提高开发调试效率。\n\n此外，引入 Swagger 后，可以得到基于 OpenAPI 规范的接口定义 JSON，可以配合第三方工具来根据 JSON 自动生成前端请求代码、自动生成客户端调用 SDK 等。',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 05:03:04',0),(1771011376886591490,'项目前端使用了 Vant UI 组件库，请列举几个你用到的 Vant UI 组件并介绍它们的用途？','','[\'前端\', \'Vant UI\', \'编程导航\']','我参照官方文档使用 Vant UI 组件库，项目中用到了：\n- Toast 轻提示组件：用于给用户的操作反馈，比如弹出操作成功、失败的提示\n- Cell 单元格组件：逐行展示用户的个人信息\n- List 列表组件：展示多条用户信息卡片\n- Tag 标签组件：美化展示用户的标签信息',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 05:03:43',0),(1771012054782586882,'如何基于 Vue Router 实现动态切换导航栏标题？请详细描述一下实现的过程。','','[\'前端\', \'Vue\', \'编程导航\']','首先在 route.ts 路由配置文件中，给每个路由增加标题属性。\n\n然后在项目全局通用布局组件（BasicLayout）中使用路由守卫 beforeEach 函数来监听页面路由的变化。当页面路由改变时，会从已定义的路由配置列表中根据路由地址找到对应的路由标题，并更改导航栏的 state 切换标题。',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 05:04:22',0),(1771012709932871681,'什么是前端异步编程？请介绍一下 Promise、async/await 在 JavaScript 中的作用及用法。','','[\'前端\', \'异步编程\', \'编程导航\']','前端异步编程是一种编程模式，用于处理那些可能会花费较长时间来执行的操作，如网络请求、文件读写、定时任务等。在异步编程中，代码不会阻塞（即不会等待操作完成），而是通过回调、Promise、async/await 等机制来处理异步操作的结果。\n\nPromise 是一种用于处理异步操作的对象，它可以表示一个操作的最终完成（或失败），并提供了一种更可控的方式来处理异步操作。\n\n创建Promise：使用new Promise()构造函数创建一个Promise对象，它接受一个执行函数，该函数包含异步操作的代码，并具有resolve和reject两个参数，分别表示操作成功和失败时的处理。\n\n\n```js\nconst myPromise = new Promise((resolve, reject) => {\n  // 异步操作\n  if (/* 操作成功 */) {\n    resolve(result); // 成功时调用resolve\n  } else {\n    reject(error); // 失败时调用reject\n  }\n});\n```\n处理Promise：使用.then()方法来注册处理成功和失败情况的回调函数。\n\n```js\nmyPromise\n  .then(result => {\n    // 处理成功\n  })\n  .catch(error => {\n    // 处理失败\n  });\n```\nasync/await 是一种语法糖，用于更直观地处理 Promise 的异步操作。\n\n使用async关键字定义一个函数，这个函数会返回一个 Promise：\n\n\n```js\nasync function fetchData() {\n  // 异步操作\n  return result; // 返回结果会被包装成Promise\n}\n```\n在 async 函数内部，可以使用await关键字等待一个 Promise 完成，并获取其结果。\n\n```js\nasync function fetchData() {\n  const result = await somePromise; // 等待Promise完成并获取结果\n  // 继续执行后续操作\n}\n```\n\nasync/await 的好处在于它可以让异步代码看起来更像同步代码，使代码可读性更强，并且可以更容易地处理异步操作中的错误。\n\n\n',1,'2024-09-04 02:18:10','2024-09-04 02:18:10','2024-09-04 05:05:01',0),(1771013725784911874,'请介绍一下 Vue 3 的新特性和与 Vue 2 相比有哪些变化？','','[\'前端\', \'Vue\', \'编程导航\']','详细参考官方文档：\n[Vue 3 迁移指南 | Vue 3 迁移指南](https://v3-migration.vuejs.org/zh/#%E5%80%BC%E5%BE%97%E6%B3%A8%E6%84%8F%E7%9A%84%E6%96%B0%E7%89%B9%E6%80%A7)\n\n1）更快的渲染性能：Vue 3 引入了新的响应式系统（Proxy-based），相比Vue 2的Object.defineProperty，提供了更高效的数据监听和更新机制，从而提高了渲染性能。\n\n2）Composition API：Composition API 是 Vue 3的核心特性之一，它允许开发者更灵活地组织和重用组件逻辑。它将组件的逻辑拆分为可复用的函数式组合，并提供了setup()函数来配置组件。\n\n3）Teleport：Vue 3引入了Teleport组件，可以轻松将内容渲染到DOM中的不同位置，这在处理模态框、对话框等场景时非常有用。\n\n4）Fragments：Vue 3支持Fragments，允许组件返回多个根节点，而无需包裹额外的HTML元素。\n需要注意的是，虽然 Vue 3 引入了许多新特性，但它仍然保持了 Vue 2 的核心理念和语法，因此 Vue 2 的开发者可以相对容易地迁移到 Vue 3，并逐步采用新的特性和优化。',1,'2024-09-04 02:18:11','2024-09-04 02:18:11','2024-09-04 05:05:42',0),(1771014079343767553,'移动端网站和响应式网站有什么区别？你在项目中是如何处理移动端适配的？','','[\'前端\', \'移动端适配\', \'编程导航\']','两者最主要的区别是在于设计目标和目标用户的不同。\n\n移动端网站是专门为移动设备（如智能手机和平板电脑）设计和优化的网站。它的设计目标是提供在小屏幕上良好的用\n户体验，通常包括更简化的布局和功能，以适应移动设备的特点。\n\n响应式网站是一种网站设计方法，旨在使网站能够在不同大小和类型的设备上自动适应，包括桌面电脑、平板电脑和移动设备。响应式网站的设计目标是提供一致的用户体验，无论用户使用哪种设备访问网站。\n\n本项目属于移动端网站，暂时不考虑 PC 端用户，所以直接使用 Vant UI 移动端组件库实现，该组件库提供了非常好的移动端适配和交互体验。\n',1,'2024-09-04 02:18:11','2024-09-04 02:18:11','2024-09-04 05:06:22',0),(1771014650394062849,'Vue.js 中的组件通信方式有哪些？\n','','[\'前端\', \'Vue\', \'编程导航\']','组件通信的目的是为了在不同组件之间共享数据、触发事件、交互调用，主要是以下几种常用的方式：\n\n1. Props（父传子）：通过`props`属性，父组件可以向子组件传递数据。子组件通过`props`接收父组件传递的数据。 \n2. 自定义事件（子传父）：子组件可以通过`$emit`方法触发自定义事件，然后父组件通过在子组件上使用`@`或`v-on`指令监听这些事件，以接收子组件的消息。 \n3. 事件总线（兄弟组件）：通过创建一个事件总线实例，不同组件可以通过事件总线来进行通信。这是一种适用于兄弟组件之间的通信方式。 \n4. Vuex（状态管理）：Vuex是Vue.js的官方状态管理库，用于管理全局状态。不同组件可以通过Vuex来共享和管理应用程序的状态。 \n5. $refs（父子组件）：父组件可以通过`ref`属性引用子组件，并直接访问子组件的属性和方法。这种方式主要用于父组件控制子组件的行为。 \n6. 插槽（分发内容）：插槽允许父组件将内容分发到子组件的特定位置，以实现更灵活的组件复用和布局控制。 ',1,'2024-09-04 02:18:15','2024-09-04 02:18:15','2024-09-04 05:07:02',0),(1771015059128987650,'在你的项目中，为什么选择了全局通用的 Layout 组件而不是局部组件？','','[\'前端\', \'Layout\', \'编程导航\']','因为对于我的项目来说，几乎所有页面都具有顶部导航栏、底部 Tab 栏等公共组件，所以我选择使用全局通用的 Layout 组件来统一页面的结构和风格，便于维护并且减少重复代码。\n',1,'2024-09-04 02:18:15','2024-09-04 02:18:15','2024-09-04 05:07:40',0),(1771015498541051906,'你是如何初始化项目的？是否有使用脚手架？','','[\'前端\', \'vite\', \'编程导航\']','这个项目使用了 Vite 作为打包工具，并且使用 Vite 官方提供的脚手架来生成初始化项目，非常方便。',1,'2024-09-04 02:18:15','2024-09-04 02:18:15','2024-09-04 05:08:19',0),(1771016363767246849,'你在前端项目中有做过性能优化吗？请分享一些常见的性能优化措施和实践经验。\n','','[\'前端 \', \'性能优化\', \'编程导航\']','优化网页的加载性能和渲染性能是前端开发中的关键任务之一，它可以提高用户体验并降低网站的跳出率。以下是一些常见的优化策略和技巧：\n\n1）优化图片：\n- 使用适当的图片格式：选择合适的图片格式（如WebP、JPEG、PNG）以减小文件大小。\n- 压缩图片：使用压缩工具或在线服务来减小图片文件的大小。\n- 使用响应式图片：为不同屏幕大小提供不同尺寸的图片，以避免加载过大的图片。\n\n2）使用CDN（内容分发网络）：\n- 将静态资源（如CSS、JavaScript、图片等）托管到CDN上，加速资源的加载。\n- CDN可以将内容缓存到全球各地的服务器上，减少距离造成的延迟。\n\n3）懒加载和预加载：\n- 使用懒加载技术延迟加载图片和其他资源，只有当用户滚动到可见区域时才加载。\n- 使用`<link rel=\"preload\">`标签预加载关键资源，以提前下载可能需要的资源。\n\n4）压缩和合并文件：\n- 压缩JavaScript和CSS文件，减小文件大小。\n- 合并多个CSS或JavaScript文件为一个，减少HTTP请求次数。\n\n本项目使用 Vite 打包工具，会自动对代码文件进行打包合并。\n\n5）使用浏览器缓存：\n- 使用 HTTP缓存头（如Cache-Control和ETag）来允许浏览器缓存资源。\n- 使用 Service Worker 来创建离线应用程序，使用户在离线状态下也能访问网站。\n\n6）减少重排和重绘：\n- 避免频繁修改DOM，可以使用文档片段（DocumentFragment）进行批量操作。\n- 使用CSS动画而不是JavaScript来实现动画效果，以减少重排和重绘。\n\n7）代码分割（Code Splitting）：\n- 将应用程序拆分为多个模块或块，按需加载模块，减小初始加载时间。\n- 使用工具如 Webpack 的`import()`语法来实现代码分割。\n\n8）使用异步加载：\n- 将非关键的JavaScript代码标记为异步加载，以防止它们阻塞页面加载。\n- 使用`<script async>`标签来异步加载脚本。\n\n9）前端框架和库的优化：使用轻量级的前端框架或库，以减少不必要的代码。\n本项目没有使用大而全的第三方框架，而是使用 Vite 脚手架 + Vant UI 组件库，支持按需加载组件，还是比较轻量的。\n\n10）监控和性能分析：\n- 使用工具如 Google PageSpeed Insights、Lighthouse 等来检查和分析性能问题。\n- 使用性能监控工具来实时追踪网站的性能指标，以便及时优化。\n\n注意，性能优化是一个持续的过程，需要不断地监测、测试和调整，以确保网站保持高性能。',1,'2024-09-04 02:18:15','2024-09-04 02:18:15','2024-09-04 05:08:59',0),(1771016767720665089,'你在项目中使用了 Vue Router 全局路由守卫，请解释一下路由守卫的概念和用法，并介绍一下它在你项目中的实际应用场景？','','[\'前端\', \'Vue Router\', \'编程导航\']','建议参考官方文档：https://router.vuejs.org/zh/guide/advanced/navigation-guards.html\n\n路由守卫是 Vue Router 提供的一种机制，用于在导航过程中对路由进行拦截和控制，以执行一些特定的操作或验证逻辑。路由守卫允许开发者在路由切换前、切换后或在路由被确认（导航完成）时执行自定义代码，从而实现一些常见的任务，如身份验证、权限控制、页面切换动画等。\n\n在项目中，我通过 router.beforeEach 定义全局前置守卫，根据当前 url 地址和路由的配置动态改变全局导航栏的标题。',1,'2024-09-04 02:18:15','2024-09-04 02:18:15','2024-09-04 05:09:37',0),(1771017164547960833,'请介绍一下本项目的完整业务流程？','','[\'通用\', \'编程导航\']','首先用户需要登录注册，然后更新个人信息。\n\n接下来系统主页会自动推荐相似用户，用户也可以根据标签自由搜索用户。\n\n用户还可以自主创建房间发起组队，或者加入（退出）其他队伍，从而找到志同道合的伙伴共同完成目标。\n',1,'2024-09-04 02:18:15','2024-09-04 02:18:15','2024-09-04 05:10:16',0),(1771017301949165570,'在开发过程中，你遇到过比较复杂的技术问题或挑战吗？如果有，请谈谈你是如何解决这些问题的？','','[\'通用\', \'编程导航\']','可以从以上任意一道主观的面试题出发去讲，比如你在线上多机部署项目时发现定时任务重复执行，然后通过 Redisson 分布式锁解决。',1,'2024-09-04 02:18:16','2024-09-04 02:18:16','2024-09-04 05:10:55',0),(1772192173106704386,'你的项目中使用了哪些技术栈？请分别介绍一下 Spring Boot、Redis、RabbitMQ 在项目中的作用。','','[\'后端\', \'编程导航\']','项目技术栈：SSM + Spring Boot、Redis、RabbitMQ、MySQL、MyBatis-Plus、Hutool 工具库。\n\nSpring Boot：用于快速构建基础的后端项目，只需要修改配置文件，就能轻松整合 SSM、MySQL、Redis、RabbitMQ 等依赖。\n\nRedis：基于内存的高性能键值对存储，在项目中负责分布式 Session 存储、限流功能的实现。\n\nRabbitMQ：时效性极高的消息队列，在项目中用于将 AIGC 生成图表这一耗时任务进行异步化和解耦。',1,'2024-09-04 02:18:20','2024-09-04 02:18:20','2024-09-04 09:25:23',0),(1772192894959005698,'你是如何使用 AIGC 来生成指定格式的 json 的？请简述整个过程。','','[\'后端\', \'AIGC\', \'编程导航\']','我使用了第三方 AI 助手平台（本质上和 OpenAI GPT 一样的），首先创建了一个智能 BI 助手，并且编写了一段系统预设 prompt，全局指定助手的职责、输入内容和回复格式。\n\n在这个过程中，我不断地更改 prompt 并调试输出效果，最终得到了生成内容比较稳定的 Prompt。可以根据我上传的分析目标和原始数据自动生成 Apache ECharts 可视化库接受的图表配置 JSON。\n\n创建好助手后，我通过 AI 助手平台官方的 SDK 调用该助手完成内容的生成。\n\n值得一提的是，AI 生成内容是一个比较耗时的操作，为了提高用户的体验，我使用消息队列将生成过程从同步改造为异步。',1,'2024-09-04 02:18:20','2024-09-04 02:18:20','2024-09-04 09:26:51',0),(1772193545315201026,'你给 AI 预设的 Prompt 结构是什么样的？如何优化 Prompt？','','[\'后端\', \'AIGC\', \'编程导航\']','示例 Prompt 如下，其中我使用分割符来隔断内容，便于后端程序的处理：\n\n\n```js\n你是一个数据分析师和前端开发专家，接下来我会按照以下固定格式给你提供内容：\n分析需求：\n{数据分析的需求或者目标}\n原始数据：\n{csv格式的原始数据，用,作为分隔符}\n请根据这两部分内容，按照以下指定格式生成内容（此外不要输出任何多余的开头、结尾、注释）\n【【【【【\n{前端 Echarts V5 的 option 配置对象的json代码，合理地将数据进行可视化，不要生成任何多余的内容，比如注释}\n【【【【【\n{明确的数据分析结论、越详细越好，不要生成多余的注释}\n```\n几个优化 Prompt 的小技巧：\n1. 使用系统预设全局改变 AI 助手的行为，并且给 AI 一个角色的定义（比如 “你是一个数据分析师和前端开发专家”）\n2. 控制输入格式，便于 AI 精确地理解我们的需求（比如 “接下来我会按照以下固定格式给你提供内容”）\n3. 控制输出格式，便于处理 AI 返回的内容（比如 “此外不要输出任何多余的开头、结尾、注释”）\n4. 给 AI 指定一组示例问答（few-shot）\n',1,'2024-09-04 02:18:20','2024-09-04 02:18:20','2024-09-04 09:27:30',0),(1772194491134947330,'你是如何保证用户上传的数据文件的安全性的？','','[\'后端\', \'系统优化\', \'编程导航\']','只要涉及到用户自主上传文件的操作，就一定要进行校验！\n\n我在项目中主要采用以下几种方式校验文件：\n1. 文件类型验证：通过检查文件的扩展名或 MIME 类型实现，比如后缀名必须为 xlsx。\n2. 文件大小限制：从 MultipartFile 对象中获取文件大小信息，限制不能超过 1 - 10 MB。\n\n此外，还有一些更严格的校验方式，比如：\n1. 文件格式校验：防止用户改文件后缀名上传非法格式的文件，可以通过匹配特定格式文件的开头或结尾来校验内容\n2. 文件内容安全：防止用户上传一些敏感违规内容，可以使用腾讯云数据万象等第三方内容安全服务自动检测',1,'2024-09-04 02:18:20','2024-09-04 02:18:20','2024-09-04 09:28:09',0),(1772195170155016194,'什么是限流？有哪些常见的限流算法？','','[\'后端\', \'限流\', \'编程导航\']','限流是一种用于控制请求或事件流量的策略，防止系统在短时间内接收过多的请求或事件，从而导致系统过载或崩溃，从而确保系统的稳定性和可用性。\n在本项目中，由于 AIGC 是一个消耗资源和成本的重操作，所以我使用 Redisson 提供的 RateLimiter 实现了对单用户使用 AI 生成图表功能的限流，从而保护系统。\n\n我了解的限流算法：\n1. 固定窗口计数限流算法：最简单的限流算法之一，它将请求或事件的到达速率限制在固定的窗口内。例如，每秒最多允许处理 10 个请求。这个算法的问题在于它无法平滑处理请求，因为在窗口边界可能会出现瞬间的高负载。 \n2. 滑动窗口计数限流算法：这种算法改进了固定窗口算法，使用滑动窗口来平滑处理请求。窗口内的请求计数按照时间的流逝而衰减，从而减少了窗口边界的尖峰负载。 \n3. 令牌桶算法：令牌桶算法使用令牌桶来控制请求速率。令牌以固定的速率被添加到令牌桶中，每个请求需要从令牌桶中获取一个令牌才能被处理。如果令牌桶中没有足够的令牌，请求将被延迟或拒绝。这种算法平滑控制了请求速率，并且可以处理突发请求。 \n4. 漏桶算法：漏桶算法以恒定的速率漏水，当请求到达时，会尝试向漏桶中添加请求，如果漏桶已满，则请求被拒绝。漏桶算法可以平滑请求，但不能处理突发请求。 \n\n我在项目中使用的 Redisson 的 RateLimiter 底层是基于令牌桶算法实现的。\n\n> 建议在面试鸭系统设计题库查看限流实现题目，有更详细的限流答案讲解',1,'2024-09-04 02:18:20','2024-09-04 02:18:20','2024-09-04 09:28:49',0),(1772195625778065409,'Redis 中的 Redisson 是什么？','','[\'后端\', \'Redisson\', \'编程导航\']','参考官方文档：https://github.com/redisson/redisson\n\nRedisson 是一个开源的 Java Redis 客户端，也是一个分布式数据网格，提供了基于 Redis 的各种分布式数据结构和便捷的操作接口，比如分布式集合、分布式锁、分布式队列等，让开发者能够更轻松地使用 Redis 进行数据存储和中间件处理。\n\n在本项目中，我使用 Redisson 自带的 RateLimiter 实现了针对单个用户生成图表操作的限流。\n',1,'2024-09-04 02:18:20','2024-09-04 02:18:20','2024-09-04 09:29:27',0),(1772196516732121090,'Redisson 的 RateLimiter 是什么？如何在项目中实现分布式限流？你的限流策略是什么？','','[\'后端\', \'Redisson\', \'编程导航\']','RateLimiter 是 Redisson 基于 Redis 实现的分布式限流组件，底层使用令牌桶算法，能够控制某个操作或服务在一定时间内的请求频率，保护系统不被过多的请求压垮。\n\n在项目中，考虑到 AI 生成图表是一个耗时且耗费资源的操作，我决定给 AI 生成图表接口增加限流，具体的策略是：单个用户每秒内最多执行 2 次生成图表操作。\n\n具体的实现方式如下：\n\n1）集中管理限流器：创建一个 RedisLimiterManager 类，集中管理整个项目中所有的限流器，并提供创建限流器的接口。\n\n2）创建限流器：通过向 redissonClient 传入指定的 key 来创建限流器，每个用户对应的 key 不同，对应的限流器也不同，从而实现不同用户的独立限流\n\n3）设置限流规则：通过 rateLimiter 的 trySetRate 方法制定限流规则，每秒内最多获取 2 个令牌\n\n4）请求令牌：当用户要执行操作时，会执行对应 rateLimiter 的 tryAcquire 方法尝试获取令牌，如果能够获取到，可以执行后续操作，否则抛出 TOO_MANY_REQUEST 异常。',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:30:08',0),(1772197068429897729,'什么是分库分表？为什么你选择对每份原始数据进行分表存储？有什么优缺点？','','[\'后端\', \'分库分表\', \'编程导航\']','分库分表是一种数据库架构设计方法，通过将单一的数据库划分为多个子数据库（分库）和多个表（分表），将数据进行分散存储，从而提高查询性能、扩展性和负载均衡，解决大规模数据存储和查询的性能问题。\n\n项目中，我对每份用户上传的原始表格数据进行分表存储，不仅能够防止单表数据量过大对整个 Chart 表的查询性能造成影响；还能够支持用户更灵活地管理自己上传的数据，比如根据某个字段对表格内的数据进行过滤查询等，通过分表也能大幅提高每份数据的查询检索性能。\n\n分库分表的缺点是会增加项目和架构的复杂性，如果业务涉及关联查询、跨分表查询，查询逻辑会变得更加复杂。所以还是要根据自己的实际业务场景和数据特点来决定是否选用分库分表。\n',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:30:48',0),(1772198469126107137,'什么是同步和异步？什么是阻塞和非阻塞？','','[\'后端\', \'背诵\', \'编程导航\']','同步和异步：关注消息的通知机制。\n\n同步是指完成一个任务并得到返回结果后，才能进行下一个任务；异步是指下一个任务不需要等待上一个任务的完成和返回结果，等任务完成后通过回调机制通知调用者。\n\n用打电话来举例：\n\n- 同步：当你拨打电话并等待对方回应时，你必须一直等待对方说完并回答你的问题，然后才能继续进行下一步操作，比如提出下一个问题。这就是同步操作，你的行动是与对方的回应直接相关的，一次只能处理一个问题。 \n\n- 异步：你可以拨打电话并留下问题，然后立即挂断电话。此时，你可以继续进行其他活动，而不必等待对方的回应。对方在有回应时会发短信通知你，等你有空了再查看短信。这样，你的行动与对方的回应是分离的，你可以并行处理多个问题。 \n\n阻塞和非阻塞：关注线程等待消息通知时的状态。\n\n阻塞是指当前执行的任务结果返回之前，该线程会一直等待返回结果，不能执行其他任务；非阻塞是指当前任务执行的结果返回之前，线程不用等待返回结果，可以执行其他任务。\n\n用打电话来举例：\n- 阻塞：当你拨打电话向对方求助问题时，无论对方是立刻回复你、还是稍后给你回电，你在这期间都要一直等待，不能做其他的事情。\n- 非阻塞：当你拨打电话向对方求助问题后，你不需要一直等着别人的回复，可以去做其他的事情，定期来查看手机上有无回复即可。',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:31:26',0),(1772199356980572161,'什么是线程池？使用它有哪些好处？','','[\'后端\', \'并发编程\', \'编程导航\']','线程池是一种用于管理和复用线程的机制，它允许在应用程序中创建一组可用线程，并在需要执行任务时将任务分配给这些线程。\n\n线程池的主要目的是优化线程的创建、销毁和管理，以提高多线程应用程序的性能和效率。\n> 可以把线程池理解为公司（或者管理机制），线程理解为员工，任务理解为公司的工作\n\n具体的好处如下：\n1. 降低线程创建和销毁的开销：线程的创建和销毁是开销较大的操作，线程池可以重复利用线程，减少这些开销。（理解为公司不会每个任务都去招新人、用完再开除）\n2. 控制并发度：通过配置线程池的大小，可以限制并发执行的任务数量，防止系统过载。 \n3. 统一管理和监控：线程池提供了统一的管理和监控接口，方便对线程的状态和执行情况进行监控和调整。 \n4. 避免资源竞争：在多线程环境中执行任务，可能会导致资源竞争和线程冲突，线程池可以帮助避免这些问题。 \n\n',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:32:06',0),(1772200143550984194,'线程池有哪些核心参数？为什么在本项目中选择 IO 密集型线程池？\n','','[\'后端\', \'线程池参数\', \'编程导航\']','项目中，我使用 ThreadPoolExecutor 实现灵活的自定义线程池，并通过 ArrayBlockingQueue 存放任务。针对每类不同的业务，我分别定义不同的线程池，让它们互不影响。\n\n示例代码：\n\n```java\nExecutorService executorService = new ThreadPoolExecutor(40, 1000, 10000, TimeUnit.MINUTES, new ArrayBlockingQueue<>(10000));\n```\n\n\n其中，自定义线程池的核心参数如下：\n1. 核心线程数（corePoolSize）：线程池中一直保持活动的线程数。可以使用corePoolSize方法来设置。一般情况下，可以根据系统的资源情况和任务的特性来设置合适的值。\n2. 最大线程数（maximumPoolSize）：线程池中允许存在的最大线程数。可以使用maximumPoolSize方法来设置。如果所有线程都处于活动状态，而此时又有新的任务提交，线程池会创建新的线程，直到达到最大线程数。\n3. 空闲线程存活时间（keepAliveTime）：当线程池中的线程数量超过核心线程数时，如果这些线程在一定时间内没有执行任务，则这些线程会被销毁。可以使用keepAliveTime和TimeUnit方法来设置。\n4. 阻塞队列（workQueue）：用于存放等待执行的任务的阻塞队列。可以根据任务的特性选择不同类型的队列，如LinkedBlockingQueue、ArrayBlockingQueue等。默认情况下，使用无界阻塞队列，即LinkedBlockingQueue，但也可以根据需要设置有界队列。\n5. 线程工厂（threadFactory）：用于创建线程的工厂。可以通过实现ThreadFactory接口自定义线程的创建逻辑。\n6. 拒绝策略（rejectedExecutionHandler）：当线程池无法接受新的任务时，会根据设置的拒绝策略进行处理。常见的拒绝策略有 AbortPolicy、DiscardPolicy、DiscardOldestPolicy 和 CallerRunsPolicy。\n\n我是根据任务的类型以及消耗资源的情况来调整线程池的参数。比如本项目中，需要线程池执行的任务为 “AI 生成内容”，该任务需要等待第三方 AI 接口的返回，需要消耗较长的时间，在这期间不需要高强度的 CPU 计算。所以我选择 IO 密集型线程池，将核心线程数设置得更大，比如 CPU 核心数的 2 - 4 倍，能够提高系统的并发性能。',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:32:44',0),(1772201089530114049,'分布式消息队列有哪些应用场景？','','[\'后端\', \'消息队列\', \'编程导航\']','分布式消息队列的作用是将消息从一个发送者传递给一个或多个接收者，从而实现解耦、异步、可靠的系统通信。\n\n常见的应用场景有：\n\n1）应用解耦：解耦系统内的不同模块，使它们能够独立开发、部署和扩展。一个模块可以将消息发送到队列，而其他模块则可以异步地接收并处理这些消息，而不需要直接调用模块的 API。 \n\n2）异步处理：可以将耗时的任务作为消息放入消息队列中，然后由单个或多个工作线程来处理，从而提高系统性能和响应速度。 \n\n3）流量削峰：当系统面临突发的高峰流量时，分布式消息队列可以通过请求排队的方式实现流量的平滑处理，防止系统过载。 \n\n4）日志和监控：分布式消息队列可以高效地收集和传输日志数据、监控数据和指标数据，这是 Kafka 的一个典型应用场景。\n\n5）跨语言和跨平台通信：分布式消息队列通常提供多语言和多平台的客户端，因此可以用于不同编程语言和操作系统之间的通信，本质上也是应用解耦。\n\n6）分布式事务：有些分布式消息队列支持分布式事务，可以用于确保消息的可靠传递和处理，同时保持一致性。 \n\n在本项目中，使用 RabbitMQ 消息队列来对耗时的 AI 生成任务进行异步化处理，同时可以解耦创建任务和执行任务模块，在系统负载增大时，可以开启多个任务执行服务，用轮训的方式消费消息、并发处理任务。',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:33:24',0),(1772201836887977985,'你在项目中为什么使用分布式消息队列来存储任务消息？\n','','[\'后端\', \'消息队列\', \'编程导航\']','这题和上一题有一些类似，更侧重于考察分布式消息队列的优点。\n\n相比于通过本地内存开启队列来存储任务消息，使用分布式消息队列有如下好处：\n1. 分布式存储：消息存储在分布式的消息队列中而不是本地，有利于分布式系统的扩展。\n2. 提高系统可靠性：分布式消息队列通常会保证消息的可靠传递，确保消息不会丢失，未即时处理的任务可以在消费者准备好时再次处理。 \n3. 高可扩展性：使用分布式消息队列，可以轻松地添加多个任务消费者，提高系统的并发处理能力。\n4. 任务重试：分布式消息队列通常支持消息的重试机制。如果某个任务由于某种原因未能成功处理，消息队列可以重新将其推送给消费者，直到成功为止。\n\n在本项目中，使用了 RabbitMQ 的消息确认机制，只有接受消息并处理成功的情况下，才会确认消息；否则拒绝消息并通过死信队列进行降级处理（比如修改任务状态为失败）。通过这种机制，可以确保每一个任务都被系统处理，不会出现丢失。',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:34:02',0),(1772203052556660737,'为什么使用 RabbitMQ 这个消息队列？它相比于其他的消息队列有哪些优点和缺点？','','[\'后端\', \'消息队列\', \'编程导航\']','在选用 RabbitMQ 消息队列前，我做过充分的技术选型和调研。发现 RabbitMQ 不仅简单易用（通过阅读官方文档就能上手开发），而且其时效性极低（延迟最低，微秒级）。此外，RabbitMQ 支持消息确认机制、延迟队列、死信队列等特性，能够满足业务对于消息可靠性的需求，这是我选择它的原因。\n\n具体的优点和缺点请见消息队列技术对比表格：\n\n> 时效性（Latency）指的是**从发出请求到收到响应所经历的时间间隔**。在消息队列中，时效性表示从消息被发送到消息被接收和处理的时间。较低的时效性意味着消息能够更快地被传输、接收和处理。\n\n|消息队列|吞吐量（QPS）|时效性|可用性|可靠性|优势|缺点|应用场景|\n|-|-|-|-|-|-|-|-|\n|ActiveMQ|中等：万级|高|高|中等|成熟的JMS支持、简单易学|性能相对较低|中小型企业应用，可靠的消息传递和事务|\n|RabbitMQ|中等：万级|**极高（微秒单位）**|高|高|灵活的路由策略、生态好、时效性高、易学|对大吞吐量的支持相对较弱|复杂的消息路由和灵活的消息处理、适用于大部分的分布式系统|\n|Kafka|**高：十万级**|高（毫秒以内）|**极高**|**极高**|高吞吐量和低延迟、可靠性、强大的数据流处理能力|复杂性较高，初学者上手难度大|大数据流处理，日志收集，实时数据流传输、事件流收集传输等|\n|RocketMQ|高：十万级|高（毫秒）|极高|极高|可靠性、可用性、吞吐量大、分布式事务支持|对复杂性的支持相对不足|大规模的分布式应用，高可用性和事务一致性要求 适用于**金融**、电商等对可靠性要求较高的场景，适合**大规模**的消息处理|\n|ZeroMQ|中等：万级|高|高|低|简单的消息传递机制|缺乏对复杂消息路由的支持|轻量级异步通信，构建快速分布式系统|\n|Pulsar|高：十万级|高（毫秒）|极高|极高|可靠性、可用性很高、基于发布订阅模型、新兴技术结构、云原生架构支持|部署和运维相对复杂|适用**大规模**数据处理，实时分析，高并发的分布式系统。适合实时分析、事件流处理、IoT数据处理等。\n\n绝大多数的面试官其实心里都清楚，你为啥做项目的时候用某个技术，肯定要么就是看了网上的教程、要么就是你只学过这个技术。虽说如此，如果你直白地回答：“因为我学的就是 RabbitMQ！” 那就寄了。\n\n这其实是一个开放性问题，面试官主要想考察的是你的知识广度、以及技术选型的能力，因为像我们在实际开发中，一定都是基于业务需要才使用某个技术，而不能太死板地为了用技术而用技术、学过什么就只用什么。\n\n应该怎么回答呢？我的建议是：\n\n1）先说一下自己了解过的所有的主流消息队列，比如 Kafka、RocketMQ 等\n\n2）分别说明每个消息队列的核心优缺点以及主流应用场景，比如 Kafka 吞吐量极高，适用于大规模处理数据、构建日志收集系统等\n\n3）结合实际应用场景，说明自己的选择。RabbitMQ 的优势是易学易用、并且有着极高的时效性，我们的 OJ / 智能 BI 项目系统用户量并不多，使用它完全能够满足需求。而且它的生态好，支持多语言的客户端、支持分布式，也有利于我后续的学习以及项目扩展。\n\n然后面试官可能就会根据你的回答，继续问你一些消息队列的问题啦，做好准备即可。\n\n',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:34:40',0),(1772203449530757122,'RabbitMQ 有哪几种交换机？你在项目中选择了哪个交换机？','','[\'后端\', \'消息队列\', \'编程导航\']','RabbitMQ 主要有 4 种交换机：\n\n1. Direct Exchange（直连交换机）：根据消息的路由键（Routing Key）将消息发送到与之完全匹配的队列上。通常用于点对点通信。\n2. Fanout Exchange（广播交换机）：将收到的消息发送到所有与之绑定的队列上，忽略路由键。通常用于广播消息给多个消费者。\n3. Topic Exchange（主题交换机）：根据消息的路由键和绑定队列的通配符模式来进行匹配，将消息发送到符合匹配规则的队列上。通常用于支持灵活的消息路由、相对复杂的业务场景。\n4. Headers Exchange（头交换机）：根据消息的头部信息来进行匹配，将消息发送到符合匹配规则的队列上。这种方式用的不多，适用于基于消息头部信息进行路由、相对复杂的业务场景。\n\n我在项目中使用了 Direct 类型的交换机，因为项目只有 1 种生产者、1 组消费者、1 种消息类型，选用 Direct 交换机的点对点通信已经能够满足需求，且便于理解。\n',1,'2024-09-04 02:18:21','2024-09-04 02:18:21','2024-09-04 09:35:19',0),(1772203961407811585,'你在 Spring Boot 项目中是如何使用 RabbitMQ 的？请简述消息发送和处理流程。','','[\'后端\', \'编程导航\']','1）引入 spring-boot-starter-amqp 依赖，并且在 application.yml 中编写 rabbitmq 连接配置\n\n2）编写初始化队列类，创建 Direct 交换机、队列，以及交换机和队列的绑定\n\n3）创建生产者类：通过 Spring Boot 整合的 RabbitTemplate 类来操作 MQ，比如调用其 convertAndSend 方法，向指定的交换机发送指定路由键的消息，比如发送 AI 生成任务的 id。\n\n4）创建消费者类：通过 @RabbitListener 注解标识处理消息的方法，并在方法内编写对应的业务逻辑（比如获取 AI 生成任务的 id、消息确认等）',1,'2024-09-04 02:18:22','2024-09-04 02:18:22','2024-09-04 09:35:58',0),(1772205355179225089,'这个项目的性能是否有遇到瓶颈？如何优化项目？','','[\'后端\', \'性能优化\', \'编程导航\']','1）由于 OpenAI 的 API QPS 有限，项目实际运行时出现了调用超限的报错，所以我们需要通过限流、或者增加负载均衡（轮询调用多个 OpenAI 账号）的方式来保证系统的稳定性。\n\n2）由于 OpenAI 单次能处理的数据量有限，所以我们需要通过数据格式压缩，来让系统同时处理更多行列的数据。如果发现压缩效果差，可以优化算法；如果发现压缩效率低，可以用文件分片 + 并发压缩。\n\n3）由于 AI 响应时间较长，用户要等待很久，我们需要将同步等待优化为异步执行，能立刻给用户提交成功的提示，从而在提高用户体验的同时，支持更多用户使用系统\n\n4）随着用户图表数的增多，可能前端查询速度会越来越慢，这时就需要通过缓存来优化查询性能。\n当然，上面几点都是围绕性能优化，其实项目的优化远不止性能，还有可用性、稳定性、可观测性等等，之前都分享过，可以阅读《如何增加项目亮点？》这篇文章：https://bcdh.yuque.com/staff-wpxfif/resource/tstv23fyzh0lnq5o （密码在星球第二个置顶帖）\n\n举个例子，比如成本的优化。随着用户图表数据量的增大，可能后端的存储成本越来越高，这时就需要通过数据压缩、转储冷备、数据清理等机制来降低成本。',1,'2024-09-04 02:18:22','2024-09-04 02:18:22','2024-09-04 09:36:39',0),(1772205918189039617,'请介绍你在项目中使用的 React 框架的优势和适用场景？','','[\'前端\', \'React\', \'编程导航\']','React 是主流的前端开发框架。\n\n优势：\n1. 组件化开发： React 的核心概念是组件化开发，将UI拆分为独立的可重用组件，使代码更易于理解、维护和测试。\n2. 虚拟 DOM： React引入了虚拟DOM的概念，通过在内存中维护虚拟DOM树，最小化了实际DOM操作，提高了性能和响应速度。\n3. 单向数据流： React采用了单向数据流模型，使数据流动可控，易于跟踪和调试。\n4. 生态系统：React拥有丰富的生态系统，包括大量的第三方库和组件，可以加速开发并提供各种解决方案。\n5. 跨平台支持： React可以用于构建Web应用、移动应用（React Native）、桌面应用（Electron）等，使得开发团队可以在不同平台上共享代码和技能。\n6. 社区支持： React拥有庞大的开发者社区和活跃的维护团队，可以获得大量的教程、文档和支持。\n\n简单来说，就是用的人多、性能很好、生态成熟。\n\n适用场景：\n1. 单页面应用（SPA）： React非常适合构建单页面应用，其中所有交互都在同一个页面中完成，无需每次加载新页面。\n2. 大规模应用： React 的性能和可维护性使其成为开发大规模应用的理想选择，特别是需要多人协作的项目。\n3. 跨平台开发： 如果需要同时支持Web、iOS和Android，可以使用React和React Native来共享代码和技能。\n4. 服务端渲染（SSR）： React可以用于服务器端渲染，提高应用的性能和搜索引擎优化（SEO）。\n\n简单来说，适合开发企业级、高性能应用。',1,'2024-09-04 02:18:22','2024-09-04 02:18:22','2024-09-04 09:37:20',0),(1772206302894796802,'项目中为什么选择了 Ant Design Pro 脚手架？可以谈谈你对 Ant Design Pro 的使用体会和优缺点','','[\'前端\', \'Ant Design Pro\', \'编程导航\']','**为了提高开发效率。**\n\nAnt Design Pro 是一个开箱即用的企业级前端应用开发脚手架，基于 React 和 Ant Design 构建，能够通过命令行选项的方式，快速创建一个包含示例页面、全局通用布局、权限管理、路由管理、国际化、前端工程化的默认项目。我只需要在此基础上编写和业务相关的页面即可，大幅节省时间。\n\nAnt Design Pro 虽然功能强大且方便，但是对新手不够友好，一方面是项目功能太多，理解项目中的代码文件、系统阅读官方文档都要花费不少时间；另一方面是框架封装的代码较多，如果现有的功能不满足要求，自己定制开发新能力的成本较大。而且 Ant Design Pro 框架更新迭代太快，阅读文档和安装依赖时一定要选择指定的版本，否则可能就会出现依赖冲突、代码不兼容的情况。',1,'2024-09-04 02:18:22','2024-09-04 02:18:22','2024-09-04 09:37:59',0),(1772206645779148801,'你是如何保证项目编码规范的？用到了哪些技术？每个技术分别有什么作用？','','[\'前端\', \'编码规范\', \'编程导航\']','我通过一系列的工具和技术保证项目编码规范，包括 TypeScript、ESLint、Prettier 和 Husky。\n各技术的作用如下：\n- TypeScript：支持静态类型检查功能，用于增强代码的类型安全性，减少类型相关的错误。\n- ESLint：代码检查工具，用于检测 JavaScript 的代码质量、风格等问题，强制开发者遵守编码规范。\n- Prettier：代码格式化工具，能够根据配置自动格式化代码，确保代码的可读性和一致性。\n- Husky：用于管理 Git 钩子的工具，在 Git 提交操作前自动运行代码检查脚本，确保提交的代码质量和规范。\n\n如果是团队协作开发的项目，还可以使用代码审查机制，让其他人帮忙审查代码，减少潜在的 Bug 和编码不规范问题。\n',1,'2024-09-04 02:18:22','2024-09-04 02:18:22','2024-09-04 09:38:40',0),(1772206883709431809,'什么是 Husky？它有什么作用？','','[\'前端\', \'Husky\', \'编程导航\']','Husky 是一个用于管理 Git 钩子的工具。Git 钩子是一些在特定 Git 操作（如提交、推送、合并等）发生时自动触发的脚本或命令。Husky 的主要作用是帮助开发团队在代码提交前执行预定义的自定义脚本，以确保代码的一致性、质量和安全性。\n\nHusky 通常与其他工具（如 lint-staged + ESLint + Prettier、commitlint 等）一起使用。开发者需要在项目中配置钩子脚本，然后在执行 Git 操作时，这些脚本将自动运行，执行代码检查和验证流程。\n\n举个例子，如果项目使用 ESLint 进行代码风格检查，可以通过 Husky 在提交代码前运行 ESLint 检查，如果代码不符合规范，将阻止提交操作。这有助于维护代码库的一致性，确保团队成员都遵循代码规范。',1,'2024-09-04 02:18:27','2024-09-04 02:18:27','2024-09-04 09:39:19',0),(1772207211024527361,'什么是 Umi OpenAPI 插件？它有什么作用？你是如何使用它来生成代码的，请介绍整个流程。','','[\'前端\', \'Umi\', \'编程导航\']','Umi OpenAPI 插件是一个用于 UmiJS（一个基于 React 的前端开发框架）的插件，它的主要作用是根据 OpenAPI 规范生成前端代码，包括 API 请求函数和数据模型定义。\n\n使用这个插件，可以大大简化前端和后端 API 集成的过程，提高开发效率。\n\n项目中，我使用的 Ant Design Pro 框架默认整合了 Umi OpenAPI 插件，无需手动引入依赖。\n\n只需要在 config 配置文件中指定后端 Swagger 接口文档的地址、以及生成的规则（比如使用 request 库），示例代码如下：\n\n```js\nopenAPI: [\n  {\n    requestLibPath: \"import { request } from \'@umijs/max\'\",\n    // 指定接口文档地址\n    schemaPath: \"http://localhost:8080/api/v2/api-docs\",\n    projectName: \'yubi\',\n    mock: false,\n  }\n],\n```\n然后执行 package.json 中定义的 openapi 命令，即可自动生成请求代码。',1,'2024-09-04 02:18:27','2024-09-04 02:18:27','2024-09-04 09:39:59',0),(1772207826454753281,'你在项目中使用了 ECharts 可视化库来实现接口调用的分析图表，请解释一下 ECharts 的主要功能？为什么说它的兼容性较好？','','[\'前端\', \'Echarts\', \'编程导航\']','ECharts 是一个开源的数据可视化库，开发者只需要传入图表配置和数据，就能得到精美的交互式数据可视化图表。\n选用 ECharts 主要是因为它的生态广、兼容性强、图表丰富，并且官网还提供了 Playground 页面来调试图表的样式。\n\n在项目中，我使用 ECharts 展示 AIGC 生成的图表。\nECharts 的兼容性好主要体现在以下几个方面：\n\n1. 版本更新稳定：2020 年 12 月 ECharts 发布了 v5 版本，且至今 v5 仍是主流版本号。\n2. 跨平台：ECharts 可以在各种主流 Web浏览器中运行，包括 Chrome、Firefox、Safari、Edge 等。\n3. 响应式设计：ECharts 的图表可以适应不同屏幕尺寸和设备类型，从桌面到移动端都能够正常显示。\n4. 开源社区支持：ECharts 拥有庞大的开源社区支持，持续维护和更新，大多数的 Bug 都能得到解决和修复。',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:40:39',0),(1772208292639059970,'你是如何使用 ECharts 接受后端的动态 JSON 自动渲染可视化图表的？请简述整个流程。','','[\'前端\', \'Echarts\', \'编程导航\']','首先我通过阅读 ECharts 官方文档和 Playground 调试明确了后端要返回的 JSON 数据格式，包括图表名称、横纵坐标、数据内容等。\n\n在接收到后端返回的 JSON 后，我会先进行返回值校验，然后使用 JSON.parse 将 JSON 字符串转化为 JS 对象，最后将该 JS 对象作为 options 参数传递给 ECharts 组件，组件会自动渲染可视化图表。\n',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:41:19',0),(1772208970740576258,'请解释什么是 React 组件的生命周期，以及生命周期函数的执行顺序是怎样的？\n','','[\'前端\', \'React\', \'编程导航\']','React 组件的生命周期指的是组件在不同阶段（或生命周期阶段）内执行的一系列特定函数。这些生命周期函数允许你在组件的不同生命周期阶段执行特定的操作，例如初始化组件、处理数据、更新UI等。在 React 16.3 版本之后，生命周期函数分为三类：\n\n1）挂载阶段（Mounting）：这是组件被创建并插入到DOM中的阶段。在挂载阶段，有三个生命周期函数： \n\n- constructor(): 构造函数，用于初始化组件的状态和绑定事件处理程序。在组件生命周期中只会被调用一次。 \n- render(): 渲染函数，用于生成虚拟DOM。它在组件挂载之前和每次更新时都会被调用。 \n- componentDidMount(): 组件挂载后立即调用。通常用于执行DOM操作、网络请求、订阅事件等初始化操作。\n \n2）更新阶段（Updating）：这是组件重新渲染并更新到DOM中的阶段。在更新阶段，有两个生命周期函数： \n\n- shouldComponentUpdate(nextProps, nextState): 用于决定组件是否应该更新。默认情况下，它返回true，但你可以根据新的props和state与当前的props和state进行比较，来决定是否需要更新组件。 \n- componentDidUpdate(prevProps, prevState): 组件更新后调用，通常用于执行与DOM相关的操作、网络请求、订阅事件等。 \n\n3）卸载阶段（Unmounting）：这是组件从DOM中移除的阶段。在卸载阶段，只有一个生命周期函数： \n\n- componentWillUnmount(): 组件即将被卸载时调用。通常用于清理工作，如取消订阅、清除定时器等。\n\n此外，React 16.3 版本后引入了一些新的生命周期函数，例如getDerivedStateFromProps和getSnapshotBeforeUpdate，用于更好地管理组件的状态和副作用。\n\n生命周期函数的执行顺序如下：\n1）挂载阶段： \n\n- constructor()\n- render()\n- componentDidMount()\n\n2）更新阶段： \n\n- shouldComponentUpdate(nextProps, nextState)\n- render()\n- componentDidUpdate(prevProps, prevState)\n\n3）卸载阶段： \n\n- componentWillUnmount()\n\n需要注意的是，React 17 及以后的版本中，部分生命周期函数被标记为不推荐使用，并有可能在未来的版本中被移除。因此，在新项目中建议使用更现代的生命周期方法，如componentDidCatch、getDerivedStateFromProps等，以更好地处理组件的状态和副作用。',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:41:57',0),(1772209331631075329,'在 React 中，什么是 Virtual DOM？它的作用是什么？与真实 DOM 相比，Virtual DOM 有什么优势？','','[\'前端\', \'React\', \'编程导航\']','Virtual DOM（虚拟 DOM）是React中的一个关键概念，它是一个轻量级的内存中表示真实 DOM 树的数据结构，其作用是优化页面渲染性能和提高开发效率。\n\nVirtual DOM 的作用和优势如下：\n\n1）性能优化：\n\n- 快速更新： 当组件的状态发生变化时，React首先创建一个虚拟DOM树，然后将新旧虚拟DOM树进行比较（称为协调或调和），找出需要更新的部分，并将这些更新一次性批量操作到真实DOM中，而不是每次都直接操作真实DOM。这样可以减少真实DOM操作的次数，提高性能。 \n\n- 批处理更新： React会将多个状态更新合并为一个更新，以减少重排（reflow）和重绘（repaint）的开销，从而提高渲染效率。 \n\n\n2）跨平台支持：Virtual DOM的设计使得React不仅可以用于Web开发，还可以用于构建移动应用（React Native）和桌面应用（Electron），因为虚拟DOM树与平台无关。\n\n3）提高开发效率：使用虚拟DOM可以使开发人员更容易管理和维护UI组件，因为它将UI的状态和视图分离，并提供了声明式的UI编程模型，使得UI的开发更直观和可预测。\n\n4）减少直接DOM操作：直接操作真实DOM通常会导致性能问题，而Virtual DOM可以帮助开发人员避免直接DOM操作，从而提高代码的可维护性。\n\n5）跨浏览器兼容性：虚拟DOM使得React可以处理不同浏览器之间的差异，开发人员无需担心不同浏览器的兼容性问题。',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:42:36',0),(1772209516365000705,'在前端开发中，如何处理跨域请求？请描述常见的跨域解决方案以及它们的优缺点。','','[\'前端\', \'跨域\', \'编程导航\']','可以使用 JSONP 或者配置代理服务器来实现。比如在 Ant Design Pro 框架中，提供了一个 proxy 配置，可以直接开启对后端服务器的代理，从而解决跨域。\n\nJSONP 的优点是简单易用，缺点是仅支持 GET 请求，且容易受到跨站脚本攻击。真实业务场景中，更推荐在服务端解决跨域，前端本地开发时通过代理绕过跨域即可。',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:43:16',0),(1772210034734837761,'请解释一下 React Hooks，并举例说明如何使用 useState 和 useEffect 这两个常用的 Hooks。','','[\'前端\', \'React\', \'编程导航\']','React Hooks 是 React 16.8 版本引入的一项功能，它们允许函数组件（无状态组件）使用状态管理和其他 React 特性，以前这些功能只能在类组件中使用。React Hooks 的目标是使组件的状态逻辑更容易复用、理解和测试。两个最常用的 React Hooks 是 useState 和 useEffect。\n\n1）useState Hook：\nuseState Hook 用于在函数组件中添加状态管理。它返回一个状态变量和一个更新该变量的函数，可以用来在函数组件中管理和更新状态。\n示例：\n\n```js\nimport React, { useState } from \'react\';\n\nfunction Counter() {\n  // 使用useState来声明一个状态变量count，初始值为0\n  const [count, setCount] = useState(0);\n\n  return (\n    <div>\n      <p>Count: {count}</p>\n      <button onClick={() => setCount(count + 1)}>Increment</button>\n      <button onClick={() => setCount(count - 1)}>Decrement</button>\n    </div>\n  );\n}\n```\n\n\n在上面的示例中，useState Hook 用于创建一个名为 count 的状态变量和一个名为 setCount 的函数。通过 setCount 函数，我们可以更新 count 的值。每次点击按钮时，count 的值会更新，并重新渲染组件。\n\n2）useEffect Hook：\nuseEffect Hook 用于在函数组件中执行副作用操作，例如数据获取、订阅事件、手动管理 DOM 等。它接受两个参数，第一个参数是一个函数，用于执行副作用操作，第二个参数是一个数组，用于指定依赖项。\n示例：\n\n```js\nimport React, { useState, useEffect } from \'react\';\n\nfunction DataFetching() {\n  const [data, setData] = useState([]);\n\n  useEffect(() => {\n    // 在组件挂载后，使用fetch API获取数据\n    fetch(\'https://jsonplaceholder.typicode.com/posts\')\n      .then((response) => response.json())\n      .then((data) => setData(data))\n      .catch((error) => console.error(\'Error:\', error));\n  }, []); // 空数组表示只在组件挂载后执行一次\n\n  return (\n    <div>\n      <h2>Posts</h2>\n      <ul>\n        {data.map((post) => (\n          <li key={post.id}>{post.title}</li>\n        ))}\n      </ul>\n    </div>\n  );\n}\n\n```\n\n\n在上面的示例中，useEffect Hook 用于在组件挂载后执行数据获取操作。我们指定了一个空数组作为第二个参数，这表示副作用操作只在组件挂载后执行一次。如果指定了依赖项数组，useEffect 将在依赖项发生变化时重新执行。',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:43:56',0),(1772210714291777537,'在前端开发中，如何优化网页的加载性能和渲染性能？请提供一些常见的优化策略和技巧？','','[\'前端\', \'编程导航\', \'前端性能优化\']','优化网页的加载性能和渲染性能是前端开发中的关键任务之一，它可以提高用户体验并降低网站的跳出率。以下是一些常见的优化策略和技巧：\n\n1）优化图片：\n- 使用适当的图片格式：选择合适的图片格式（如WebP、JPEG、PNG）以减小文件大小。\n\n- 压缩图片：使用压缩工具或在线服务来减小图片文件的大小。\n\n- 使用响应式图片：为不同屏幕大小提供不同尺寸的图片，以避免加载过大的图片。\n\n2）使用CDN（内容分发网络）：\n\n\n- 将静态资源（如CSS、JavaScript、图片等）托管到CDN上，加速资源的加载。\n- CDN可以将内容缓存到全球各地的服务器上，减少距离造成的延迟。\n\n3）懒加载和预加载：\n\n- 使用懒加载技术延迟加载图片和其他资源，只有当用户滚动到可见区域时才加载。\n- 使用`<link rel=\"preload\">`标签预加载关键资源，以提前下载可能需要的资源。\n\n4）压缩和合并文件：\n\n- 压缩JavaScript和CSS文件，减小文件大小。\n- 合并多个CSS或JavaScript文件为一个，减少HTTP请求次数。\n- Ant Design Pro 使用 Webpack 打包工具，会自动对代码文件进行打包合并。\n\n5）使用浏览器缓存：\n\n- 使用 HTTP缓存头（如Cache-Control和ETag）来允许浏览器缓存资源。\n- 使用 Service Worker 来创建离线应用程序，使用户在离线状态下也能访问网站。\n\n6）减少重排和重绘：\n\n- 避免频繁修改DOM，可以使用文档片段（DocumentFragment）进行批量操作。\n- 使用CSS动画而不是JavaScript来实现动画效果，以减少重排和重绘。\n\n7）代码分割（Code Splitting）：\n\n- 将应用程序拆分为多个模块或块，按需加载模块，减小初始加载时间。\n- 使用工具如 Webpack 的import()语法来实现代码分割。\n- Ant Design Pro 支持在项目的全局配置文件中配置按需加载。\n\n8）使用异步加载：\n\n- 将非关键的JavaScript代码标记为异步加载，以防止它们阻塞页面加载。\n- 使用`<script async>`标签来异步加载脚本。\n\n9）前端框架和库的优化：使用轻量级的前端框架或库，以减少不必要的代码。\nAnt Design Pro 其实是一个比较重的开发框架，更适合中后台管理系统。\n\n10）监控和性能分析：\n- 使用工具如 Google PageSpeed Insights、Lighthouse 等来检查和分析性能问题。\n- 使用性能监控工具来实时追踪网站的性能指标，以便及时优化。\n\n注意，性能优化是一个持续的过程，需要不断地监测、测试和调整，以确保网站保持高性能。',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:44:34',0),(1772210907946987521,'什么是 AIGC？','','[\'通用\', \'编程导航\']','AIGC（Artificial Intelligence Generated Content）生成式人工智能，是一种新型的技术，是指利用人工智能自动生成内容，比如文章、音频、视频等，大幅提高内容生产的效率。\n\nChatGPT 就是 AIGC 的一种应用，我也已经将其运用到自己的生活和工作中，比如用 ChatGPT 帮我解决 Bug、回答一些问题。',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:45:14',0),(1772211150658777090,'请介绍一下本项目的完整业务流程？','','[\'通用\', \'编程导航\']','区别于传统的 BI 可视化系统，在本项目中，用户只需要导入 Excel 原始数据集、并输入自己的分析诉求，就能利用 AI 自动生成可视化图表和分析结论，实现数据分析的降本增效。\n\n此外，用户还可以在 “我的图表” 页面内查看已有的图表，集中管理。',1,'2024-09-04 02:18:28','2024-09-04 02:18:28','2024-09-04 09:45:54',0),(1772211240530128897,'在开发过程中，你遇到过比较复杂的技术问题或挑战吗？如果有，请谈谈你是如何解决这些问题的？','','[\'通用\', \'编程导航\']','可以从以上任意一道主观的面试题出发去讲，比如你在使用 AI 生成文章时，发现这个操作需要消耗很长的时间，用户一直在前端等待体验不是很好，所以使用消息队列将生成操作异步化。',1,'2024-09-04 02:18:29','2024-09-04 02:18:29','2024-09-04 09:46:35',0),(1772446962335981570,'你的项目中使用了哪些技术栈？请分别介绍一下 Spring Boot、Dubbo、Gateway 在项目中的作用。','','[\'后端\', \'编程导航\']','项目技术栈：SSM + Spring Boot、Spring Cloud Gateway、Dubbo、Nacos、MySQL、Redis、MyBatis-Plus、Hutool 工具库。\n\nSpring Boot：用于快速构建基础的后端项目，只需要修改配置文件，就能轻松整合 SSM、MySQL、Redis 等依赖。\n\nDubbo：分布式 RPC 框架，实现项目中不同模块的高性能相互调用，比如网关服务集中统计接口调用次数时通过 Dubbo 调用接口服务完成次数扣减。\n\nGateway：作为 API 网关，集中接受客户端的请求，并执行统一的安全认证、请求转发、流量控制、请求日志、公共业务等操作。',1,'2024-09-04 02:18:33','2024-09-04 02:18:33','2024-09-04 09:47:15',0),(1772447321540370434,'你将后端项目划分为了多个子项目，请分别介绍这几个子项目的作用、以及它们之间是如何协作和交互的？','','[\'后端\', \'编程导航\']','API 开放平台分为 5 个子项目（核心模块），分别为：\n\n- api-backend：核心业务后端，负责用户和接口管理等核心业务功能\n- api-gateway：API 网关服务，负责集中的路由转发、统一鉴权、统一业务处理、访问控制等\n- api-common：公共模块，包括各其他模块中需要复用的方法、工具类、实体类、全局异常等\n- api-client-sdk：客户端 SDK，封装了对各 API 接口的调用方法，降低开发者的使用成本。\n- api-interface：提供模拟 API 接口\n\n交互流程：首先管理员创建接口后通过核心业务后端（api-backend）保存到数据库中。用户调用某个接口时，在自己的项目中引入客户端 SDK（api-client-sdk）并通过一行代码发起调用，请求会首先发送到 API 网关（api-gateway）进行用户的鉴权和接口调用统计，然后将请求转发到实际的 API 接口（api-interface）。\n',1,'2024-09-04 02:18:33','2024-09-04 02:18:33','2024-09-04 09:47:54',0),(1772448054343999489,'请简要介绍 Maven 的基本概念、作用以及如何使用 Maven 进行多模块依赖管理和打包？','','[\'后端\', \'编程导航\']','Maven 是一个开源的构建工具，用于管理 Java 项目的构建、依赖管理和项目生命周期。\n\n本项目的所有依赖都是由 Maven 进行管理的，每个子项目都有自己的 pom.xml 进行管理。首先使用 mvn install 命令将 common 公共模块在本地打包，然后在其他子项目的 pom.xml 中引入该模块即可复用代码。每个子项目可以独立通过 mvn package 命令进行打包和部署。\n\nMaven 还支持子父依赖多模块管理，通过 modules 配置给父项目指定子模块，从而实现统一的公共依赖和依赖版本定义。',1,'2024-09-04 02:18:33','2024-09-04 02:18:33','2024-09-04 09:48:33',0),(1772448496935346178,'请介绍一下你是如何使用 MyBatis Plus 框架的 QueryWrapper 实现了对 MySQL 的灵活查询？','','[\'后端\', \'Mybatis-plus\', \'编程导航\']','MyBatis-Plus 是 MyBatis 的增强版框架，允许用户通过编程的方式构建复杂的查询条件，无需编写繁琐的 SQL 语句。\n\n在本项目中，使用 MyBatis-Plus 的 QueryWrapper 查询条件构造器，通过链式调用的方式，灵活构造接口信息表的查询条件，比如使用 like 方法指定根据描述模糊查询、比如 orderBy 指定查询排序规则等，示例代码如下：\n\n\n```java\nQueryWrapper<InterfaceInfo> qw = new QueryWrapper<>();\nqw.like(StringUtils.isNotBlank(description), \"description\", description);\nqw.orderBy(StringUtils.isNotBlank(sortField),\n        sortOrder.equals(CommonConstant.SORT_ORDER_ASC),\n        sortField);\n```\n除了 QueryWrapper 外，MyBatis-Plus 还提供了 LambdaQueryWrapper，支持使用 Lambda 表达式来定义查询条件，更灵活。',1,'2024-09-04 02:17:23','2024-09-04 02:17:23','2024-09-04 09:49:11',0),(1772519661640982530,'什么是 MyBatis-Plus？它有什么作用？它和 MyBatis 有哪些区别？\n','','[\'后端\', \'Mybatis-plus\', \'编程导航\']','MyBatis 是一个半 ORM（对象关系映射）框架，它内部封装了 JDBC，使用它后，开发者只需要关注 SQL 语句本身，不需要花费精力去处理加载驱动、创建连接、创建 statement 等繁杂的过程，提高开发效率。\n\nMyBatis-Plus 是 MyBatis 的增强版框架（就像魂斗罗兄弟一样），它对 MyBatis 进行了 二次封装 ，只做增强不做改变。通过提供一系列的 API 方法和代码生成器，使重复的 CRUD（创建、读取、更新、删除）操作更加简单，无需手动编写 SQL 语句，从而 大幅提高开发效率 。\n\n此外，还有一些其他优点。比如：\n1. 提供了条件构造器，可以通过编程方式构建复杂的查询条件，无需编写繁琐的 SQL 语句\n2. 提供了分页查询支持，无需手动编写分页逻辑\n3. 提供了一个代码生成器工具，可以根据数据库表自动生成 Java 实体类、Mapper 接口和 XML 映射文件，减少了手工编写的工作量。\n\n使用 MyBatis Plus 前，需要自己编写 SQL Mapper 映射文件和语句：\n\n```xml\n<!-- userMapper.xml -->\n<mapper namespace=\"com.demo.dao.UserMapper\">\n  <select id=\"getUserById\" parameterType=\"java.lang.Integer\" resultType=\"com.demo.entity.User\">\n    select * from t_user where id=#{id}\n  </select>\n</mapper>\n```\n使用 MyBatis Plus 后，定义接口继承 BaseMapper 接口并调用其中提供的现成方法即可：\n\n```java\npublic interface UserMapper extends BaseMapper<User> {\n}\n```',1,'2024-09-04 02:17:23','2024-09-04 02:17:23','2024-09-04 09:49:50',0),(1772568783219695618,'Java 中 hashCode 和 equals 方法是什么？它们与 == 操作符有什么区别？','','[\'Java基础\', \'Java\']','`hashCode、equals` 和 `==` 都是 `Java` 中用于比较对象的三种方式，但是它们的用途和实现还是有挺大区别的。 \n\n### hashCode\n\n方法返回对象的哈希码（整数），主要用于支持基于哈希表的集合，用来确定对象的存储位置，如 `HashMap、HashSet` 等。\n\n`Object` 类中的默认实现会根据对象的内存地址生成哈希码（`native` 方法）。\n\n<img src=\"https://pic.code-nav.cn/mianshiya/question_picture/1772087337535152129/ag0G48da_image_mianshiya.png\" alt=\"image.png\" width=\"100%\" />\n\n在 `Java` 中，`hashCode` 方法和 `equals` 方法之间有一个 **“合约”**：\n- 如果两个对象根据 `equals` 方法被认为是相等的，那么它们必须具有相同的哈希码。\n- 如果两个对象具有相同的哈希码，它们并不一定相等，但会被放在同一个哈希桶中。\n\n### equals\n\n用于比较两个对象的内容是否相等。`Object` 类中的默认实现会使用 == 操作符来比较对象的内存地址。\n\n<img src=\"https://pic.code-nav.cn/mianshiya/question_picture/1772087337535152129/epOMLaLx_image_mianshiya.png\" alt=\"\" width=\"100%\" />\n\n通常我们需要在自定义类中重写 `equals` 方法，以基于对象的属性进行内容比较。比如你可以自定义两个对象的名字一样就是相等的、年龄一样就是相等，可以灵活按照需求定制。\n\n如果两个对象的 `equals` 方法返回 `true，则它们的` `hashCode` 方法必须返回相同的值，反之则不需要。\n\n对于 `equals` 定义的比较，实际上还有以下五个要求：\n\n- 自反性：对于任何非空引用值 `x`，`x.equals(x)` 必须返回 `true`。\n- 对称性：对于任何非空引用值 `x` 和 `y`，如果 `x.equals(y)` 返回 `true`，则 `y.equals(x)` 也必须返回 `true`。\n- 传递性：对于任何非空引用值 `x`、`y` 和 `z`，如果 `x.equals(y)` 返回 `true` 且 `y.equals(z)` 返回 `true`，则 `x.equals(z)` 也必须返回 `true`。\n- 一致性：对于任何非空引用值 `x` 和 `y`，只要对象在比较中没有被修改，多次调用 `x.equals(y)` 应返回相同的结果。\n- 对于任何非空引用值 `x`，`x.equals(null)` 必须返回 `false`。\n\n### ==\n\n`==` 操作符用于比较两个引用是否指向同一个对象（即比较内存地址），如果是基本数据类型，`==` 直接比较它们的值。\n\n### 区别总结\n\n`hashCode` 用于散列存储结构中确定对象的存储位置。可用于快速比较两个对象是否不同，因为如果它们的哈希码不同，那么它们肯定不相等。\n\n`equals` 用于比较两个对象的内容是否相等，通常需要重写自定义比较逻辑。\n\n`==` 用于比较两个引用是否指向同一个对象（即内存地址）。对于基本数据类型，比较它们的值。',1,'2024-09-04 01:13:07','2024-09-04 01:13:07','2024-09-04 09:50:30',0),(1772880236942245889,'什么是 BIO、NIO、AIO？','','[\'并发编程\']','BIO、NIO、AIO 都是 Java 的 IO 模型。\n\nBIO (Blocking IO) 是传统的 IO 模型，它在读写数据时会**阻塞线程**，直到数据读写完成，适用于**并发不高**的场景。\n\nNIO (Non-blocking IO) 是 Java 的新 IO 模型，它在读写数据时不会阻塞线程，而是通过**轮询**的方式检查是否有数据可读写，适用于**并发量较高**的场景。\n\nAIO (Asynchronous IO) 是 JDK 7 开始引入的新 IO 模型，它的读写方式与 NIO 相似，但在读写数据时，不需要自己手动轮询是否有数据可读写，而是**交由系统完成**，适用于**高并发且处理较大数据量**的场景。\n\n总的来说，BIO 的并发处理能力较差，NIO 的并发处理能力较好，但使用起来较为复杂，AIO 的并发处理能力最好，但也是最为复杂的一种 IO 模型。选择适合自己场景的 IO 模型是非常重要的。\n\n> 鱼皮补充：这题比较建议大家举一个例子来区分这些概念，比如：人等待水壶烧水',1,'2024-09-04 01:20:35','2024-09-04 01:20:35','2024-09-04 09:51:09',0),(1772882950057148418,'如何设计一个点赞系统？','','[\'系统设计\', \'场景题\']','点赞系统看似简单，实则非常复杂，它可以从系统架构、库表设计、数据存储、性能优化、容灾备份等多个角度来思考设计。\n\n我们可以由浅入深的向面试官来说出这个实现方案：\n\n### 系统架构设计\n\n从架构方面需要考虑：服务拆分、异步、缓存。\n\n1）分布式架构\n\n大流量场景下，可以将点赞功能独立成一个服务，解耦业务逻辑，便于扩展和维护。例如点赞服务压力倍增的时候，可以仅扩容点赞服务即可。\n\n2）异步处理\n\n只要涉及到大流量，且实时性并没有那么强烈的场景，就需要考虑异步。可以使用消息队列（如 Kafka、RocketMQ）来异步处理点赞请求，减少直接写数据库的压力。\n\n3）缓存机制\n\n除了异步，其实也可以利用缓存（如 Redis、Memcached）存储点赞数，减少数据库访问\n\n### 库表设计\n\n这边简单给一个库表设计供大家参考：\n\n1）点赞记录表\n\n```sql\nCREATE TABLE like_record (\n    id BIGINT AUTO_INCREMENT PRIMARY KEY,\n    user_id BIGINT NOT NULL,\n    item_id BIGINT NOT NULL,\n    liked_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,\n    UNIQUE KEY unique_user_item (user_id, item_id)\n) ENGINE=InnoDB;\n```\n2）点赞数汇总表\n\n```sql\nCREATE TABLE like_count (\n    item_id BIGINT PRIMARY KEY,\n    like_count BIGINT DEFAULT 0\n) ENGINE=InnoDB;\n```\n\n### 数据存储\n\n上面我们提到了缓存，实际上很多公司除了用 MySQL 存储数据之外，还会利用缓存来存储这种高并发修改的数据。\n\n例如使用 Redis 存储点赞数，承接实时的热数据，后续再将点赞数落库存储至 MySQL 中。即将热门的点赞数缓存到 Redis 中，设置适当的过期时间，定期同步到数据库。\n\n有些大公司还会对缓存进行改造，保证缓存本身的数据持久性。\n\n### 性能优化\n\n1）数据库优化\n\n例如为常用查询添加合适的索引。like_record 表的 user_id 和 item_id 字段。\n\n如果整体的数据量过大，我们还根据 item_id 或 user_id 对数据进行分库分表，减少单个表的写压力。\n\n2）缓存优化\n\n处理上面提到的 Redis 分布式缓存，还可以利用本地缓存来减轻 Redis 的压力，但是要考虑好数据同步的问题。\n\n3）异步批量处理\n\n对于点赞数的写入，我们可以将一定时间窗口内的点赞请求批量更新到数据库，减少数据库的写操作。\n\n如果用了缓存，那么可以使用定时任务定期将 Redis 中的数据同步到数据库，确保数据一致性。\n\n### 容灾备份\n\n一个系统的设计肯定需要考虑容灾备份，所以这点跟面试官提出来，会觉得你考虑周到，比较有经验。\n\n1）数据备份\n\n- 定期备份：对数据库进行定期备份，使用增量备份和全量备份相结合的策略。\n- 异地备份：有条件的公司（几乎很少）会进行异地备份，防止极端情况发生。\n\n2）高可用架构\n\n- 数据库主从复制：使用 MySQL 主从复制或 Redis 主从复制，实现数据的高可用性。\n\n3）容灾演练\n\n定期进行容灾演练，确保在发生故障时系统能够快速恢复。有些公司还有混沌工程。\n\n> 混沌工程是一种故意向系统注入故障以测试其恢复能力的做法。其目的是找出潜在的故障点，并在它们造成实际中断或其他破坏之前加以纠正\n\n简单来说，例如随便把线上的一台服务停了，看看系统是否能正常运行，来测试故障情况下系统的稳定性。\n',1,'2024-09-04 01:21:03','2024-09-04 01:21:03','2024-09-04 09:51:48',0),(1772892114301009921,'Linux 中的硬链接和软连接是什么，二者有什么区别？','','[\'Linux\']','在 Linux 文件系统中，硬链接（hard link）和软链接（symbolic link）都是一种文件链接的方式，可以用于将一个文件链接到另一个文件上。它们的主要区别在于创建方式、所占空间和使用限制等方面。\n\n硬链接是通过在文件系统中创建一个新的目录项（directory entry）指向同一文件 inode 的位置来实现的。因为硬链接实际上是指向同一 inode，所以如果原文件被删除，硬链接依然能够访问到原文件的内容。硬链接的使用范围比较受限，因为硬链接只能指向同一个文件系统内的文件，不能跨文件系统创建。\n\n软链接是通过在文件系统中创建一个新的文件来实现的，该文件中包含指向另一个文件的路径。软链接可以跨文件系统创建，并且可以指向任何类型的文件。但是，当原文件被删除时，软链接将会失效。\n\n总的来说，硬链接更加高效，因为它只是添加了一个新的目录项，所以对磁盘空间的消耗比软链接要小。但是，硬链接不能跨文件系统，所以在实际应用中需要根据具体的需求来选择使用哪种链接方式。',1,'2024-09-04 02:24:16','2024-09-04 02:24:16','2024-09-04 09:52:28',0),(1772892490454581250,'CC 攻击是什么？什么叫 DDOS 攻击？什么是网站数据库注入？','','[\'Linux\']','1. CC 攻击（CC Attack）是一种网络攻击方式。它通常是指对服务器进行大量并发请求的攻击，从而导致服务器的瘫痪。攻击者通过使用大量的机器或网络中的代理服务器，向目标服务器发送大量的请求，以消耗服务器的带宽和资源，从而使其无法正常提供服务。CC 攻击可以是攻击者自己编写的脚本，也可以是专门的 CC 攻击工具。\n2. DDOS 攻击（Distributed Denial of Service Attack）是一种网络攻击方式，它通常是指利用大量的计算机或网络中的代理服务器，同时向目标服务器发送大量的请求，从而导致目标服务器的瘫痪。DDOS 攻击可以采用多种方式实现，如 SYN 攻击、UDP 攻击、ICMP 攻击等。\n3. 网站数据库注入（SQL Injection）是一种利用 Web 应用程序漏洞的攻击方式，攻击者通过将恶意 SQL 代码插入到 Web 应用程序的输入字段中，从而获取对数据库的未授权访问。网站数据库注入攻击可以导致许多问题，如破坏数据库的完整性、泄漏敏感数据、执行未经授权的操作等。常见的防御措施包括输入验证、参数化查询、使用安全的 API 等。',1,'2024-09-04 02:24:16','2024-09-04 02:24:16','2024-09-04 09:53:06',0),(1772892870856982530,'如何在 Linux 中查看系统资源使用情况？比如内存、CPU、网络端口。','','[\'Linux\']','在 Linux 中，可以使用一些命令和工具来查看系统资源使用情况。下面介绍一些常用的命令和工具：\n\n1. top：top 命令可以实时地显示系统中各个进程的资源使用情况，包括 CPU 使用率、内存使用率、进程 ID 等信息。可以通过 top 命令来查看当前系统的 CPU 和内存使用情况。\n2. free：free 命令可以查看系统中的内存使用情况，包括总内存量、已使用内存量和可用内存量等。可以通过 free 命令来查看当前系统的内存使用情况。\n3. df：df 命令可以查看系统中磁盘的使用情况，包括磁盘总容量、已使用空间和可用空间等。可以通过 df 命令来查看当前系统的磁盘使用情况。\n4. iostat：iostat 命令可以查看系统的 CPU 和磁盘 I/O 使用情况。可以通过 iostat 命令来查看当前系统的 CPU 和磁盘 I/O 使用情况。\n5. netstat：netstat 命令可以查看系统中的网络连接情况，包括本地地址、远程地址、连接状态等信息。可以通过 netstat 命令来查看当前系统的网络连接情况。\n6. lsof：lsof 命令可以查看系统中打开的文件和网络连接情况，包括文件名、文件描述符、进程 ID、进程名等信息。可以通过 lsof 命令来查看当前系统的文件和网络连接情况。\n\n这些命令和工具都可以帮助我们了解当前系统资源的使用情况，方便我们对系统进行优化和管理。同时，也可以通过一些其他的工具，如 htop、iotop 等，来查看系统资源使用情况。',1,'2024-09-04 02:24:16','2024-09-04 02:24:16','2024-09-04 09:53:45',0),(1772893116840329217,'Nginx 是什么？它有哪些应用场景？','','[\'Nginx\']','Nginx（发音为“engine-x”）是一个**高性能的开源 Web 服务器**和**反向代理服务器**，可以处理大量的并发连接和请求。它使用**事件驱动的异步架构和多线程设计**，可以高效地处理并发请求，同时也支持**反向代理、负载均衡、动态HTTP缓存、SSL/TLS终止、基于模块的扩展**等功能。\n\nNginx 的应用场景非常广泛，以下是其中的几个：\n\n- **Web 服务器**：Nginx 可以作为 HTTP 服务器，处理并发的静态请求和动态请求，并且可以支持**负载均衡和缓存**，为网站提供高性能和高可用性。\n- **反向代理服务器**：Nginx 可以作为反向代理服务器，接收客户端请求并将其转发到后端服务器，同时也可以支持负载均衡和缓存。\n- **邮件代理服务器**：Nginx 可以作为邮件代理服务器，支持 POP3、IMAP 和 SMTP 协议，并且可以支持 SSL/TLS 加密和反垃圾邮件功能。\n- **流媒体服务器**：Nginx 可以作为流媒体服务器，支持 RTMP、HLS 和 DASH 协议，可以用于实现直播、点播和视频-on-demand（VoD）等场景。\n\n总之，Nginx 具有高性能、可扩展性和可靠性等特点，被广泛应用于大型网站、互联网公司、云计算、视频流媒体、游戏等领域。\n\n> 鱼皮补充：这题建议大家说一下自己是怎么使用 Nginx 的，这是一个很重要、但是却容易被忽略的后端技术',1,'2024-09-04 02:29:46','2024-09-04 02:29:46','2024-09-04 09:54:25',0),(1772893331903266817,'什么是正向代理和反向代理，如何使用 Nginx 做反向代理？','','[\'Nginx\']','**正向代理**和**反向代理**都是代理服务器的两种应用场景，它们在网络请求的处理过程中扮演不同的角色：\n\n**正向代理**（Forward Proxy）：正向代理**位于客户端和目标服务器之间**，客户端通过正向代理来访问目标服务器。正向代理代表客户端发起请求，**隐藏客户端的真实身份**。常见的应用场景包括**使用魔法、访问内网资源、缓存和过滤**等。\n\n**反向代理（Reverse Proxy）：反向代理位于客户端和目标服务器之间**，客户端直接访问反向代理服务器，反向代理将请求转发给目标服务器。反向代理代表目标服务器接收请求，隐藏目标服务器的真实身份。常见的应用场景包括**负载均衡、安全防护、缓存和SSL终端**等。\n\n使用 Nginx 作为反向代理的方法如下：\n\n安装Nginx：根据操作系统和需求选择合适的Nginx版本进行安装。安装完成后，启动Nginx。\n\n配置反向代理：编辑 Nginx 的配置文件（通常位于/etc/nginx/nginx.conf或/etc/nginx/sites-available/default），在 http 或 server 块中添加反向代理配置。\n\n示例配置：\n\n```\nhttp {\n    ...\n    server {\n        listen 80; # 监听的端口号\n        server_name example.com; # 反向代理的域名\n\n        location / {\n            proxy_pass http://backend_server; # 将请求转发给目标服务器\n            proxy_set_header Host $host; # 设置请求头部信息\n            proxy_set_header X-Real-IP $remote_addr;\n            proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;\n        }\n    }\n    \n}\n```\n\n在这个示例中，将客户端的请求转发给名为 backend_server 的目标服务器。同时设置了一些请求头部信息，以便目标服务器获取客户端的真实 IP 地址。\n\n重启 Nginx：保存配置文件并重启 Nginx，使配置生效。通常可以使用 nginx -s reload 或 systemctl restart nginx 命令重启 Nginx。\n\n完成以上步骤后，Nginx 就被配置为反向代理服务器，可以将客户端的请求转发给目标服务器。',1,'2024-09-04 02:29:46','2024-09-04 02:29:46','2024-09-04 09:55:05',0),(1772893879301881857,'如何用 Nginx 做限流，有几种限流算法，分别如何实现？','','[\'Nginx\']','Nginx 可以通过配置限制每个客户端请求的速率来实现限流。具体来说，Nginx 有两种限流方式：**基于请求速率限制和基于连接速率限制。**\n\n下面分别介绍这两种方式以及常用的限流算法。\n\n1）基于请求速率限制：基于请求速率限制是指限制每个客户端的请求速率，常用的限流算法有以下几种：\n\n   - 漏桶算法：在单位时间内处理一定数量的请求，多余的请求则会放入一个“漏桶”中，随后以固定速率处理。\n\n    - 令牌桶算法：在每个单位时间内，将一定数量的“令牌”放入桶中，每次请求需要获取一个令牌才能被处理，当桶中没有令牌时，请求将被拒绝。\n\n    - 计数器算法：简单地对请求计数，并限制每个客户端在单位时间内最多可以处理的请求数量。\n\n在 Nginx 中实现基于请求速率的限流通常需要使用模块，如 ngx_http_limit_req_module、ngx_http_limit_conn_module 等。\n\n2）基于连接速率限制：基于连接速率限制是指限制每个客户端的连接速率，常用的限流算法有以下几种：\n\n   - 并发连接数：限制每个客户端同时能够建立的连接数，以此来限制连接速率。\n\n   - 队列长度：将每个连接加入到一个队列中，限制队列中同时存在的连接数量，以此来限制连接速率。\n\n在 Nginx 中实现基于连接速率的限流通常需要使用模块，如 ngx_http_limit_conn_module 等。\n\n要实现基于请求速率或连接速率的限流，我们需要在 Nginx 配置文件中设置相应的限流规则。以下是一个基于漏桶算法的 Nginx 配置示例：\n\n```\nhttp {\n    limit_req_zone $binary_remote_addr zone=one:10m rate=10r/s;\n\n    server {\n        location / {\n            limit_req zone=one burst=20;\n            proxy_pass http://backend;\n        }\n    }\n}\n```\n\n其中，limit_req_zone 指定了一个名为 one 的共享内存区域，用于存储请求的统计信息，同时指定了速率为 10r/s。在 location 中，limit_req 指定了限流规则，并将请求转发到后端服务器。\n\n需要注意的是，不同的限流算法适用于不同的场景，我们需要根据实际情况选择合适的算法和配置参数。同时，在实际应用中，为了防止恶意攻击和 DDOS 攻击，通常需要将多种限流算法组合起来使用。',1,'2024-09-04 02:29:46','2024-09-04 02:29:46','2024-09-04 09:55:46',0),(1772958710109396994,'什么是 Elasticsearch？Elasticsearch 和 MySQL 分别有哪些应用场景和优缺点？','','[\'后端\', \'Elasticsearch\', \'编程导航\']','Elasticsearch 是一个开源的分布式搜索引擎，提供了强大的全文搜索和复杂查询功能。\n\n1）Elasticsearch\n\n主要的应用场景：全文搜索、日志分析\n\n优点：搜索性能高、能够实现灵活的全文搜索、实时性强、支持分布式扩容\n\n缺点：部署运维成本较大，且查询操作学习成本较高\n\n2）MySQL\n\n主要的应用场景：关系型数据存储、事务和数据一致性支持（比如财务系统）\n\n优点：支持事务、成熟稳定\n\n缺点：实时搜索性能和灵活性较差，不利于大数据量的扩展\n\n在实际业务中，可以结合使用这两种数据库，把需要全文检索功能的数据同步到 Elasticsearch 上（比如文章数据）；而其他无需检索的关系型数据（比如用户数据）存储在 MySQL 中。',1,'2024-09-04 02:32:09','2024-09-04 02:32:09','2024-09-04 09:56:25',0),(1772959022333386754,'Elasticsearch 为什么能实现更灵活的查询？','','[\'后端\', \'Elasticsearch\', \'编程导航\']','这题有 2 种回答方式，比较推荐的一种是把重点放在 Elasticsearch 的倒排索引和分词原理，请阅读这篇文章：搜索引擎工作原理 。\n\n另外一种是从相对较广的角度回答，Elasticsearch 实现灵活查询的几个原因：\n\n1）强大的查询DSL：Elasticsearch 提供了丰富的查询 DSL（领域特定语言），允许用户以更高级别的抽象方式构建查询。DSL支持多种查询类型，包括全文搜索、精确匹配、范围查询、布尔查询、嵌套查询、通配符查询、模糊查询\n等。这些查询类型可以根据不同的搜索需求组合和嵌套，以构建复杂的查询条件。 \n\n2）全文搜索能力：Elasticsearch以全文搜索为基础，具有出色的文本搜索功能。它使用分析器和标记化技术来处理文本数据，支持词干分析、停用词过滤、同义词处理等，从而能够实现高效的文本搜索和相关性排名。 \n\n3）倒排索引：Elasticsearch使用倒排索引来加速搜索。倒排索引是一种反向映射，将每个词汇与其出现在文档中的位置建立关联。这允许Elasticsearch在非常快的时间内查找到包含特定词汇的文档。 \n\n4）分布式架构：Elasticsearch采用分布式架构，数据分片和复制到多个节点上。这意味着查询可以并行执行，并且可以在多个节点上分散负载，以提高性能和可伸缩性。这对于处理大规模数据和高并发查询非常重要。 \n\n5）动态映射：Elasticsearch 具有动态映射功能，可以根据文档中的字段自动推断其数据类型。这意味着您可以灵活地插入文档，而不需要事先定义模式。这种灵活性允许您存储各种不同结构的文档，并以多种方式查询它们。 \n\n6）插件和定制性：Elasticsearch具有丰富的插件生态系统，可以轻松扩展其功能。您可以选择性地添加插件以满足特定需求，例如地理位置搜索、词汇推荐等。此外，Elasticsearch允许您自定义分析器、标记化器和过滤器，以适应不同的数据类型和语言。 \n',1,'2024-09-04 02:32:09','2024-09-04 02:32:09','2024-09-04 09:57:05',0),(1773173341281148929,'什么是 Vue Router 的动态路由？你在项目中如何使用动态路由实现不同页面切换？','','[\'前端\', \'Vue Router\', \'编程导航\']','Vue Router 的动态路由是指在路由配置中使用动态的路径参数来匹配和渲染不同的页面。在页面中可以根据不同的输入参数动态加载不同的数据，通常用于展示类似于用户个人资料、文章详情、商品详情等需要根据不同的参数显示不同内容的情况。\n\n参考 Vue Router 官方文档：https://router.vuejs.org/zh/guide/essentials/dynamic-matching.html\n\n本项目中，我定义了一个以数据类型作为参数的动态路由（/:category），在主页面（搜索页面）中获取动态路由参数并且同步到 tab 栏的选中状态；当用户点击 tab 栏切换数据类型时，会同步改变 url。',1,'2024-09-04 02:51:00','2024-09-04 02:51:00','2024-09-04 09:57:44',0),(1773176025258221570,'有哪些常用的 HTML 标签？','','[\'HTML\']','HTML（Hyper Text Markup Language）是一种用于创建 Web 页面的标准标记语言。常用的 HTML 标签有：\n\n- 标题标签（\\<h1>~\\<h6>）：定义页面中的标题，h1 表示最高级别的标题，h6 表示最低级别的标题。\n- 段落标签（\\<p>）：定义一个段落，通常用于组织页面内容。\n- 链接标签（\\<a>）：定义一个超链接，指向另一个文档或 Web 页面。\n- 图像标签（\\<img>）：插入一个图像，可以通过指定图像的 URL 或相对路径来显示。\n- 列表标签（\\<ul>、\\<ol>、\\<li>）：用于创建无序列表和有序列表。\n- 表格标签（\\<table>、\\<tr>、\\<th>、\\<td>）：用于创建表格。\n- 表单标签（\\<form>、\\<input>、\\<textarea>、\\<select>、\\<button>）：用于创建用户输入表单。\n- 样式标签（\\<style>）：定义 CSS 样式。\n- 脚本标签（\\<script>）：用于嵌入 JavaScript 脚本代码。\n- 分割线标签（\\<hr>）：用于在页面中插入一条水平分割线。\n\n以上是一些常用的 HTML 标签，通过组合使用这些标签，可以创建出各种复杂的 Web 页面。',1,'2024-09-04 02:53:24','2024-09-04 02:53:24','2024-09-04 09:58:25',0),(1773176176957808641,'什么是 HTML5，HTML5 有哪些新特性？','','[\'HTML\']','HTML5 是 HTML 的第五个版本，是用于创建网页和其他 web 应用程序的标记语言。与之前的 HTML 版本相比，HTML5 引入了许多新特性和改进，包括以下几个方面：\n\n- 语义化标签：HTML5引入了很多新的标签，如\\<header>、\\<footer>、\\<nav>、\\<article>、\\<section>等，这些标签都是为了更好地表达文档内容的语义而设计的。\n- 多媒体支持：HTML5 支持多媒体内容，包括音频、视频、SVG 和 Canvas 等图形元素，这些都可以直接在网页中嵌入，无需使用第三方插件。\n- 新的表单控件：HTML5 引入了一些新的表单控件，如日期选择器、搜索框、滑块等，这些控件都能够提高用户体验。\n- Web 存储：HTML5 提供了两种新的客户端存储机制：localStorage 和 sessionStorage，它们可以让 Web 应用程序在客户端上存储数据，从而提高性能和用户体验。\n- Web Workers：HTML5 提供了一种新的机制，即 Web Workers，它们可以让 Web 应用程序在后台运行，从而提高性能和响应速度。\n- 地理位置支持：HTML5 提供了一种新的 API，即 Geolocation API，它可以让 Web应用程序获取用户的地理位置信息。\n\nHTML5的新特性为 Web 开发提供了更多的功能和工具，让开发者能够更加方便地开发 Web 应用程序，并提高用户体验。',1,'2024-09-04 02:53:24','2024-09-04 02:53:24','2024-09-04 09:59:06',0),(1773176429941448705,'iframe 标签的作用是什么？有哪些优缺点？','','[\'HTML\']','\\<iframe> 标签是 HTML 中的一个元素，用于在当前 HTML 文档中嵌入另一个 HTML 文档。它可以在一个 HTML 页面中嵌入另一个 HTML 页面或其他类型的文档，比如 PDF 文件或视频文件。\n\n\\<iframe> 标签的主要作用是将一个页面嵌入到另一个页面中。例如，在一个页面中嵌入一个地图或一个视频，或者在一个页面中嵌入一个在线表单，都可以使用 \\<iframe> 标签。\n\n\\<iframe> 标签的优点包括：\n\n- 可以让页面嵌入其他网站或文档，从而扩展页面的功能。\n- 可以使用一个单独的文档来管理页面的内容，从而简化页面的管理。\n- 可以在一个页面中嵌入多个 ，从而允许多个不同的内容在同一页面中显示。\n\n\\<iframe> 标签的缺点包括：\n\n- 可能会影响页面的加载速度和性能，特别是在页面中嵌入大型媒体文件时。\n- 可能会影响页面的可访问性，因为屏幕阅读器可能无法读取嵌入的内容。\n- 可能会导致安全风险，因为嵌入的文档可以访问父页面的 JavaScript 对象，从而可能被用于恶意攻击。\n\n要实现 \\<iframe> 的效果，可以使用以下代码：\n\n```\n<iframe src=\"http://example.com\"></iframe>\n```\n\n其中 src 属性指定要嵌入的文档的 URL，可以是一个 HTML 页面、一个 PDF 文件或一个视频文件等等。通过设置 width 和 height 属性可以指定 \\<iframe> 元素的尺寸。\n\n> 鱼皮补充：这题如果有同学能提到部分微前端的实现是基于 iframe 的，会加分',1,'2024-09-04 02:53:24','2024-09-04 02:53:24','2024-09-04 09:59:46',0),(1773176565945950209,'什么是 HTML 语义化？为什么要语义化？','','[\'HTML\']','HTML 语义化是指在编写 HTML 代码时，使用具有含义的标签来描述页面内容的结构和意义，而不是只关注页面的表现形式。比如使用 \\<header> 标签来表示页面头部，使用 \\<nav> 标签来表示页面导航，使用 \\<article> 标签来表示文章内容等。\n\nHTML 语义化的目的在于增强页面的可读性和可维护性，使得开发人员和搜索引擎更容易理解页面的结构和内容。此外，语义化的 HTML 代码也更符合无障碍标准，使得视力受限的用户等特定人群能够更方便地访问页面。\n\n除此之外，语义化的 HTML 代码还有利于 SEO（搜索引擎优化），可以使得搜索引擎更好地抓取页面内容，提高网站在搜索引擎中的排名。\n\n综上所述，HTML 语义化可以使得页面更易读、易维护、易访问和易优化。',1,'2024-09-04 02:53:24','2024-09-04 02:53:24','2024-09-04 10:00:25',0),(1773176837539717122,'CSS 选择器有哪些？优先级分别是什么？','','[\'CSS\']','CSS 选择器可以根据不同的属性、标签名、类名、ID 等条件来选择页面中的元素，常用的选择器包括：\n\n1. 标签选择器：通过标签名选取元素，如 p、h1、div 等。\n2. 类选择器：以 \".\" 开头，选取具有相同类名的元素，如 .red、.bold 等。\n3. ID 选择器：以 \"#\" 开头，选取具有相同 ID 的元素，如 #header、#content 等。\n4. 属性选择器：根据元素的属性值选取元素，如 [href]、[title]、[src] 等。\n5. 后代选择器：选取元素的后代元素，如 div p 选取所有 div 元素的后代 p 元素。\n6. 相邻兄弟选择器：选取元素的相邻兄弟元素，如 h1 + p 选取紧接在 h1 元素后面的 p 元素。\n7. 通用选择器：选取所有元素，使用 * 表示。\n\nCSS 选择器的优先级按照如下规则计算：\n1. 标签内部样式（内联样式）具有最高优先级，其次是 ID 选择器，然后是类选择器和属性选择器，最后是标签选择器和通用选择器。\n2. 如果存在多个选择器的优先级相同，那么后面出现的选择器具有更高的优先级。\n3. !important 声明具有最高优先级。',1,'2024-09-04 02:53:24','2024-09-04 02:53:24','2024-09-04 10:01:03',0),(1773177018335191041,'有哪些常见的 CSS 布局？','','[\'CSS\']','CSS 布局是指在网页上排版并定位元素的方式，常见的 CSS 布局包括：\n\n1. 盒模型布局：盒模型布局是指通过设置元素的 margin、padding、border 等属性，控制元素在页面中的位置和大小。\n2. 浮动布局：浮动布局是通过设置元素的 float 属性，使元素脱离文档流并向左或向右浮动，从而实现对页面布局的控制。\n3. 定位布局：定位布局是指通过设置元素的 position 属性为 relative、absolute 或 fixed，控制元素在页面上的位置。\n4. 弹性布局：弹性布局是通过设置元素的 display 属性为 flex 或 inline-flex，控制元素在页面中的位置和大小，从而实现响应式布局。\n5. 网格布局：网格布局是通过设置元素的 display 属性为 grid，使用网格线将页面分为若干行和列，控制元素在页面中的位置和大小。\n6. 还有表格布局，以及一些衍生的布局，比如：圣杯布局、双飞翼布局\n   以上是常见的 CSS 布局，开发者可以根据具体的需求和情况选择合适的布局方式，从而实现对页面布局和样式的控制。',1,'2024-09-04 02:53:24','2024-09-04 02:53:24','2024-09-04 10:01:43',0),(1773177192306532353,'CSS 中的 1 像素问题是什么？有哪些解决方案？','','[\'CSS\']','CSS 中的 1 像素问题指的是在高分辨率屏幕上显示的 1 像素边框或者细线在实际显示时会比 1 个物理像素更宽或更粗，从而导致边框或者细线看上去比预期的更粗或者更宽，影响页面的美观性和用户体验。\n\n造成这个问题的原因是由于高分辨率屏幕的像素密度比传统的屏幕要高，所以在屏幕上显示的一个 CSS 像素对应的物理像素个数也会相应地增多，当使用 CSS 中的 1px 来设置边框或者细线时，实际上渲染出来的线条在屏幕上会被拆分为多个物理像素，从而导致看上去更粗。\n\n解决这个问题的方法有以下几种：\n\n1）使用图片代替边框或细线，这种方法能够保证显示效果的一致性，但是需要制作多张图片，增加了页面加载的开销。\n\n2）使用 scale 进行缩放，使用 transform 缩放 0.5 像素大小的边框，以达到渲染 1 像素的效果。例如：\n\n```\n.border {\n  position: relative;\n  border: 1px solid #000;\n}\n.border:after {\n  content: \"\";\n  position: absolute;\n  top: -1px;\n  left: -1px;\n  right: -1px;\n  bottom: -1px;\n  border: 1px solid #000;\n  transform: scale(0.5);\n}\n```\n\n3）使用 border-image，border-image 可以实现将一张图片作为边框样式，图片会自动拉伸或者重复以填充边框。这种方法需要制作一张边框的图片，但是可以通过 CSS 控制图片的填充方式和边框样式，比较灵活。例如：\n\n```\n.border {\n  border: 1px solid transparent;\n  border-image: url(border.png) 1 1 stretch;\n}\n```\n\n4）使用 CSS3 的 box-shadow，可以用 box-shadow 属性来模拟边框。例如：\n\n```\n.border {\n  box-shadow: 0 0 0 1px #000;\n}\n```\n\n使用 viewport，在 head 中添加如下代码可以解决 1px 问题：\n\n```\n<meta name=\"viewport\" content=\"width=device-width,initial-scale=1.0,minimum-scale=1.0,maximum-scale=1.0,user-scalable=no\">\n```\n\n',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:02:24',0),(1773177337010020353,'什么是 CSS 盒子模型？','','[\'CSS\']','CSS 盒子模型（CSS box model）指的是用于布局和设计网页的 CSS 样式规范。CSS 盒子模型将每个 HTML 元素表示为一个矩形的盒子，这个盒子包括内容（content）、内边距（padding）、边框（border）和外边距（margin）四个部分。\n\n具体来说，盒子模型中各个部分的含义如下：\n\n- 内容（content）：元素的实际内容，由 width 和 height 属性决定。\n- 内边距（padding）：内容和边框之间的空间，由 padding 属性决定。\n- 边框（border）：内容和外边距之间的边框，由 border 属性决定。\n- 外边距（margin）：盒子边缘和其它元素之间的空间，由 margin 属性决定。\n\nCSS 盒子模型中，盒子的总大小由这四个部分加起来决定，即 width + padding + border + margin。需要注意的是，CSS 盒子模型有两种，分别是标准盒子模型和怪异盒子模型。\n\n- 标准盒子模型中，盒子的大小 = width + padding + border + margin\n- 怪异盒子模型中，盒子的大小 = width + margin，因为 width 已经包含了 padding + border',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:03:03',0),(1773177818826498049,'哪些 CSS 属性可以继承？','','[\'CSS\']','在 CSS 中，并不是所有的属性都可以继承。下面是一些常见的可继承属性：\n\n- font-family\n- font-size\n- font-weight\n- font-style\n- color\n- letter-spacing\n- word-spacing\n- line-height\n- text-align\n- text-indent\n- text-transform\n- visibility\n\n这些属性在父元素中设置后，子元素可以继承相同的属性值。但需要注意的是，这些属性只能继承，而不能被子元素覆盖。此外，并不是所有的 HTML 元素都可以继承这些属性，具体需要查看相关属性的文档。\n\n鱼皮补充：这道题目如果能补充回答 “你在什么情况下用到了继承” 会更好',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:03:44',0),(1773177948652789762,'什么是响应式设计？响应式设计的基本原理是什么？如何进行实现？','','[\'CSS\']','响应式设计是指通过一些技术手段，使得网站或应用在不同终端设备（如桌面电脑、平板电脑、手机等）上能够自适应地呈现最佳的用户体验。\n\n响应式设计的基本原理是根据屏幕的尺寸和分辨率等信息，动态调整页面的布局和元素的样式，以便使页面在不同的设备上呈现出最佳的效果。实现响应式设计通常需要使用 HTML、CSS 和 JavaScript 技术，其中 CSS 媒体查询是实现响应式设计的核心技术之一。\n\n为了实现响应式设计，开发人员需要为不同屏幕尺寸和分辨率等场景提供不同的布局和样式。一种实现方式是使用流体网格布局和百分比尺寸等技术，以便根据设备屏幕的宽度和高度等信息自适应地调整页面的布局和元素的大小。另一种实现方式是使用 CSS 媒体查询，根据设备的屏幕尺寸和分辨率等信息，加载不同的样式文件或应用不同的样式规则，以便实现不同场景下的最佳效果。\n\n响应式设计的优点包括可以提高用户体验、提高网站访问率和转化率、降低开发成本等。同时，响应式设计也有一些缺点，例如需要在各种设备上进行充分的测试和调试、可能需要加载大量的 CSS 和 JavaScript 文件等。\n\n总之，响应式设计是一种非常重要的前端开发技术，能够帮助开发人员在不同终端设备上提供最佳的用户体验，提高网站的访问率和转化率，同时也能减少开发成本和维护成本。\n\n> 鱼皮补充：这道题的最后一问 “如何实现” 非常好，能直接反映你的前端经验，可以从最原始的实现（媒体查询）、CSS 响应式布局、组件库框架等方面回答，聊聊自己尝试过的布局',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:04:23',0),(1773178073940844545,'CSS3 新增了哪些特性？','','[\'CSS\']','CSS3 新增了很多新的特性，其中一些主要的特性包括：\n\n1. Flexbox 弹性布局\n2. Grid 网格布局\n3. Animation 动画效果\n4. Transform 变换效果\n5. Transition 过渡效果\n6. Box-sizing 盒模型\n7. Shadow 阴影效果\n8. Text-shadow 文字阴影效果\n9. Gradient 渐变效果\n10. Border-radius 圆角效果\n\n这些特性可以大大增强 CSS 的功能，帮助开发者更方便地实现一些复杂的布局和动画效果。同时，这些特性也使得网页的视觉效果更加丰富和生动。\n\n> 鱼皮补充：这题的标准题解不够具体，大家可以针对某一类特性聊聊自己在项目中是如何使用的',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:05:02',0),(1773178289481932801,'怎么用 CSS 实现一个宽高自适应的正方形？','','[\'CSS\']','可以使用 CSS 的 padding 或者利用vw单位来实现一个宽高自适应的正方形。\n\n一种比较常见的实现方法是：\n\n```\n<div class=\"square\"></div>\n```\n\n```\n.square {\n  width: 25vw; /* 利用vw单位实现自适应宽度 */\n  padding-top: 25vw; /* 利用padding实现自适应高度 */\n  background-color: red;\n}\n```\n\n上面的代码中，利用vw单位设置了正方形的宽度为屏幕宽度的 1/4（25%），同时利用 padding-top 设置正方形的高度也为屏幕宽度的 1/4，这样就实现了一个宽高自适应的正方形。\n\n另外，也可以使用伪元素来实现：\n\n```\n<div class=\"square\"></div>\n\n.square {\n  position: relative;\n  width: 50%;\n  background-color: red;\n}\n\n.square::before {\n  content: \"\";\n  display: block;\n  padding-top: 100%;\n}\n```\n\n上面的代码中，通过设置 div 元素的宽度为 50% ，再利用 ::before 伪元素设置 padding-top 为 100% ，就可以实现一个宽高自适应的正方形。\n\n> 鱼皮评论：这题建议大家自己实现一下',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:05:42',0),(1773178393634889730,'CSS 中，有哪些方式可以隐藏页面元素？有什么区别?','','[\'CSS\']','在 CSS 中，有以下几种方式可以隐藏页面元素：\n\n1. display: none;：完全隐藏元素，元素不占据任何空间。\n2. visibility: hidden;：隐藏元素，但元素在页面中仍占据空间。\n3. opacity: 0;：将元素的透明度设为 0，元素隐藏但仍占据空间。\n4. position: absolute; left: -9999px;：将元素移出屏幕范围之外，元素隐藏但仍占据空间。\n5. z-index: -1;：将元素的层级设置为负数，元素隐藏但仍占据空间。\n\n这些方式的区别在于是否占据空间和是否可见，开发者可以根据实际情况选择不同的方式来隐藏页面元素。',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:06:21',0),(1773178528276242434,'怎么使用 CSS3 来实现动画？你实现过哪些动画？','','[\'CSS\']','CSS3 提供了丰富的动画效果，通过使用 CSS3 动画可以实现许多视觉效果，比如旋转、平移、缩放、淡入淡出等。\n\nCSS3 动画的实现需要使用 @keyframes 规则和 animation 属性，具体的实现步骤如下：\n\n定义关键帧 使用 @keyframes 规则定义动画关键帧。例如，定义一个旋转动画：\n\n```\n@keyframes spin {\n  from { transform: rotate(0deg); }\n  to { transform: rotate(360deg); }\n}\n```\n\n这个关键帧定义了从 0 度到 360 度的旋转动画。\n\n应用动画 使用 animation 属性将动画应用到元素上。例如，将上面定义的 spin 动画应用到一个元素：\n\n```\ndiv {\n  animation: spin 2s linear infinite;\n}\n```\n\n这个样式定义了一个 2 秒线性旋转动画，并且无限循环。\n\nCSS3 动画的优点在于它不需要使用 JavaScript，可以通过 CSS 代码实现各种复杂的动画效果，并且动画效果比使用 JavaScript 实现的动画效果更加平滑。\n\n在实际开发中，我们可以使用 CSS3 动画来实现各种动态效果，比如页面切换、元素滚动、菜单展开等。具体实现要根据具体的需求来选择使用哪种动画效果，一些常见的动画效果包括：\n\n- 淡入淡出\n- 旋转\n- 缩放\n- 平移\n- 拉伸\n- 闪烁 我们可以使用 CSS3 动画来实现这些效果，提高用户体验和交互性。',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:07:01',0),(1773178661395062786,'CSS 有哪些常用单位？这些单位各有什么区别？','','[\'CSS\']','CSS 中常用的单位有以下几种：\n\n1. px（像素）：像素是相对于显示器分辨率而言的，是一个固定的单位。1px 可以被理解为显示器上的一个物理像素点，其大小和颜色由显示器自身控制。\n2. em（相对长度单位）：em 是相对于父元素的字体大小的单位，当父元素没有设置字体大小时，em 相对于浏览器的默认字体大小。\n3. rem（相对长度单位）：rem 同样是相对长度单位，但相对于根元素（即 html 元素）的字体大小。\n4. %（百分比）：百分比是相对于父元素的宽度、高度、字体大小等的百分比。\n5. vw、vh（视口单位）：vw 和 vh 分别代表视口的宽度和高度的百分比。\n6. pt（点）：1pt 等于 1/72 英寸，常用于打印页面。\n7. em 和 rem 的区别：em 和 rem 都是相对长度单位，但 em 的大小是相对于其父元素的字体大小，而 rem 的大小则是相对于根元素（即 html 元素）的字体大小。因此，rem 更加稳定，能够更好地控制页面布局和字体大小。\n\n在使用 CSS 单位时，需要根据实际情况选择合适的单位。一般情况下，像素是最常用的单位，因为它在大多数情况下可以提供良好的显示效果。对于需要在不同设备上适配的情况，可以使用 em、rem 和 vw、vh 等相对单位。',1,'2024-09-04 02:53:25','2024-09-04 02:53:25','2024-09-04 10:07:40',0),(1773178830719115265,'有哪些 CSS 性能优化的操作或技巧？','','[\'CSS\']','以下是一些常用的 CSS 性能优化操作和技巧：\n\n1. **使用合适的选择器**：选择器的复杂度会影响 CSS 渲染性能。尽量使用简单的选择器，避免使用通配符和后代选择器等复杂的选择器。\n2. **避免使用 @import：@import** 可以在 CSS 文件中导入其他 CSS 文件，但它会阻塞页面的渲染，影响性能。建议使用 link 标签来引入 CSS 文件。\n3. **避免使用 !important：!important** 会影响 CSS 属性的优先级，而且会增加解析和渲染时间。建议尽量避免使用 !important。\n4. **避免使用 inline 样式**：inline 样式的优先级最高，但它会增加 HTML 文件的大小，降低页面的加载速度。建议使用外部 CSS 文件和内部样式表。\n5. 压缩和合并 CSS 文件：压缩和合并 CSS 文件可以减小文件大小，提高页面加载速度。可以使用工具例如 CSSMin 和 YUI Compressor 等来进行压缩和合并操作。\n   6.** 使用 CSS Sprites**：CSS Sprites 可以将多个小图片合并成一张大图片，并使用 CSS 来显示不同的部分，减少 HTTP 请求次数，提高页面加载速度。\n6. **避免过度继承**：过度继承会导致样式的冗余和继承链的深度增加，影响 CSS 的解析和渲染性能。\n7. **避免使用高消耗的属性和值**：某些属性和值的计算成本比较高，例如 box-shadow、border-radius 等，应该尽量避免使用。\n\n以上是一些常用的 CSS 性能优化操作和技巧，可以帮助提高页面的加载速度和渲染性能。',1,'2024-09-04 02:53:26','2024-09-04 02:53:26','2024-09-04 10:08:20',0),(1773179304394448897,'JavaScript 中如何中止网络请求？','','[\'JavaScript\']','在 JavaScript 中，我们可以通过 AbortController 和 AbortSignal 来中止网络请求。\n\n使用 AbortController 创建一个新的 AbortController 对象，然后使用它的 abort() 方法来中止请求。在创建请求时，将 AbortController.signal 分配给请求的 signal 属性，以便在调用 abort() 方法时取消请求。\n\n以下是一个使用 AbortController 中止 fetch 请求的示例：\n\n```\nconst controller = new AbortController();\nconst signal = controller.signal;\n\nfetch(url, { signal }).then(response => {\n  // Handle the response\n}).catch(error => {\n  if (error.name === \'AbortError\') {\n    console.log(\'Request was cancelled\');\n  } else {\n    console.log(\'Request failed:\', error);\n  }\n});\n\n// To abort the request, call the following:\ncontroller.abort();\n```\n\n在上面的示例中，我们通过调用 controller.abort() 方法来取消网络请求。\n\n使用 AbortController 和 AbortSignal 是中止网络请求的一种可靠方式，并且在现代浏览器中得到了广泛支持。',1,'2024-09-04 02:53:26','2024-09-04 02:53:26','2024-09-04 10:09:00',0),(1773179431582523394,'什么是 BOM 和 DOM？分别列举一些它们的函数','','[\'JavaScript\']','BOM 和 DOM 都是 JavaScript 中的概念，但它们具有不同的作用。\n\nBOM（Browser Object Model）是浏览器对象模型，它提供了一些浏览器窗口和框架的对象，并提供了一些操作这些对象的方法。BOM 不是 W3C 标准，而是由浏览器厂商制定的。\n\n下面是一些常见的BOM函数：\n\n- alert()：在浏览器中显示一个警告框。\n- confirm()：在浏览器中显示一个确认框，要求用户单击“确定”或“取消”按钮。\n- prompt()：在浏览器中显示一个提示框，要求用户输入文本。\n- setTimeout()：用于在指定的时间后执行一段代码。\n- setInterval()：用于以指定的时间间隔重复执行一段代码。\n\nDOM（Document Object Model）是文档对象模型，它定义了一种标准的方法来访问和操作 HTML 或 XML 文档中的元素和内容。DOM 是 W3C 标准。\n\n下面是一些常见的 DOM 函数：\n\n- getElementById()：根据元素 ID 获取元素对象。\n- getElementsByTagName()：根据标签名获取元素对象数组。\n- getElementsByClassName()：根据类名获取元素对象数组。\n- appendChild()：将一个节点添加到指定父节点的子节点列表的末尾。\n- removeChild()：从指定父节点的子节点列表中删除一个子节点。\n\n总体来说，BOM 主要用于操作浏览器窗口和框架，而 DOM 主要用于访问和操作 HTML 或 XML 文档中的元素和内容。',1,'2024-09-04 02:53:26','2024-09-04 02:53:26','2024-09-04 10:09:39',0),(1773179610322788354,'深拷贝和浅拷贝有什么区别？JS 怎么实现深拷贝？','','[\'JavaScript\']','深拷贝和浅拷贝是复制数据结构的两种不同方式。\n\n浅拷贝是创建一个新的对象，新对象的一些属性引用原始对象中相同的属性。这意味着在原始对象或新对象上的更改会相互影响。\n\n深拷贝是创建一个新的对象，并复制原始对象的所有属性，包括嵌套的对象和数组。这意味着在原始对象或新对象上的更改不会相互影响。\n\n在 JavaScript 中，可以通过以下方式实现深拷贝：\n\nJSON.parse() 和 JSON.stringify() 方法\n\n这是实现深拷贝的一种简单方式，但它有一些限制，例如不能复制函数和特殊对象（如 Date）。同时，它不能处理包含循环引用的对象。\n\n以下是使用 JSON.parse() 和 JSON.stringify() 方法实现深拷贝的示例代码：\n\n```\nconst obj = { name: \'John\', age: 30, address: { city: \'New York\', state: \'NY\' } };\n\nconst obj2 = JSON.parse(JSON.stringify(obj));\n\nobj2.address.city = \'Chicago\';\n\nconsole.log(obj.address.city); // Output: New York\nconsole.log(obj2.address.city); // Output: Chicago\n```\n\n递归拷贝对象\n\n这种方法涉及递归遍历对象，并创建一个新的对象，复制原始对象的属性，并在需要时递归复制嵌套的对象和数组。这种方法可以处理循环引用，并复制函数和特殊对象。\n\n以下是使用递归拷贝对象实现深拷贝的示例代码：\n\n```\nfunction deepClone(obj) {\n  if (typeof obj === \'object\' && obj !== null) {\n    let result = Array.isArray(obj) ? [] : {};\n    for (let key in obj) {\n      if (obj.hasOwnProperty(key)) {\n        result[key] = deepClone(obj[key]);\n      }\n    }\n    return result;\n  }\n  return obj;\n}\n\nconst obj = { name: \'John\', age: 30, address: { city: \'New York\', state: \'NY\' } };\n\nconst obj2 = deepClone(obj);\n\nobj2.address.city = \'Chicago\';\n\nconsole.log(obj.address.city); // Output: New York\nconsole.log(obj2.address.city); // Output: Chicago\n```\n\n深拷贝的缺点是它可能会更加耗时，因为需要递归遍历整个对象图，复制所有属性和嵌套的对象和数组。而浅拷贝是一种更快的复制方式，因为它只复制了对象的引用。在某些情况下，浅拷贝可能会更有效。',1,'2024-09-04 02:53:26','2024-09-04 02:53:26','2024-09-04 10:10:19',0),(1773179721002082305,'如何使用 JavaScript 来判断用户设备类型？比如判断是 PC 端还是移动端访问？','','[\'JavaScript\']','可以通过以下两种方式来判断用户设备类型：\n\n一、利用 navigator.userAgent 属性来获取用户代理信息，然后通过正则表达式判断是否为移动设备。示例代码如下：\n\n```\nfunction isMobile() {\n  return /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent);\n}\n\n// 使用示例\nif (isMobile()) {\n  console.log(\'This is a mobile device.\');\n} else {\n  console.log(\'This is a desktop device.\');\n}\n```\n\n这里的正则表达式匹配了一些移动设备的关键词，如果用户代理信息中包含这些关键词，则可以认为是移动设备。\n\n二、利用 window.matchMedia 方法来根据屏幕宽度判断是否为移动设备。示例代码如下：\n\n```\nfunction isMobile() {\n  return window.matchMedia(\'(max-width: 768px)\').matches;\n}\n\n// 使用示例\nif (isMobile()) {\n  console.log(\'This is a mobile device.\');\n} else {\n  console.log(\'This is a desktop device.\');\n}\n```\n\n这里的参数 (max-width: 768px) 表示屏幕宽度最大为 768 像素，如果当前屏幕宽度小于等于 768 像素，则可以认为是移动设备。\n\n> 鱼皮评论：这题是相对比较简单的， 上面几种方法大家都可以试试',1,'2024-09-04 02:53:26','2024-09-04 02:53:26','2024-09-04 10:10:58',0),(1773179845656797186,'JS 中数组是如何在内存中存储的？','','[\'JavaScript\']','在 JavaScript 中，数组是一种特殊的对象，可以用于存储一组有序的数据。数组在内存中的存储方式与其他对象类似，都是存储在堆中。\n\nJavaScript 中的数组是一种动态数组，可以自动扩展和收缩。当一个数组需要扩展时，JavaScript 引擎会为其分配更多的内存空间，同时将原有数据拷贝到新的内存空间中。当一个数组需要收缩时，JavaScript 引擎会将其内存空间释放掉。\n\n在 JavaScript 中，数组的每个元素是通过其索引来访问的。索引是一个整数，用于指定数组中的一个元素。JavaScript 中的数组索引是以 0 开始的，也就是说，第一个元素的索引为 0，第二个元素的索引为 1，以此类推。\n\n由于 JavaScript 中的数组是动态数组，所以它的索引可以随时改变。因此，当你访问一个数组时，需要确保你正在访问的索引是有效的，否则会导致数组越界的错误。\n\n> 鱼皮评论：这题比较基础，了解一下即可',1,'2024-09-04 02:53:27','2024-09-04 02:53:27','2024-09-04 10:11:38',0),(1773179969673977857,'JS 中 Map 和 WeakMap 有什么区别？','','[\'JavaScript\']','在 JavaScript 中，Map 和 WeakMap 都是键值对的集合，但它们有几个重要的区别：\n\n1. 键类型：Map 对象的键可以是任何类型，包括基本数据类型和对象类型，而 WeakMap 对象的键必须是对象类型。\n2. 垃圾回收：Map 对象中的键和值都会被常规垃圾回收机制回收，而 WeakMap 中的键是弱引用，即在对象被垃圾回收时，WeakMap 中对应的键值对也会被自动删除。这使得 WeakMap 通常用于缓存或元数据，当对象不再被使用时，WeakMap 可以自动清除对应的数据，避免内存泄漏。\n3. 迭代器：Map 对象有内置的迭代器，可以通过 for...of 循环来遍历键值对，而 WeakMap 没有内置的迭代器，因此不能直接遍历键值对。\n\n综上所述，Map 和 WeakMap 在功能上有所重叠，但应用场景不同。Map 可以存储任何类型的键值对，适用于大部分情况；WeakMap 适用于需要自动清除的缓存和元数据场景。',1,'2024-09-04 02:53:27','2024-09-04 02:53:27','2024-09-04 10:12:16',0),(1773180120794750978,'用 CSS 和 JS 来实现动画分别有哪些优缺点？','','[\'JavaScript\']','用 CSS 和 JS 来实现动画各有其优缺点，具体如下：\n\n使用 CSS 实现动画的优缺点：\n\n优点：\n\n- **硬件加速**：CSS 动画会使用浏览器的 GPU 来进行硬件加速，能够更加流畅和高效地运行。\n- **简单易用**：CSS 动画通常只需要几行代码就能实现基本的动画效果，不需要使用 JavaScript 来控制动画。\n- **低资源占用**：CSS 动画通常比 JavaScript 动画使用更少的 CPU 和内存资源，因此更适合用于简单的动画效果。\n\n缺点：\n\n- **限制较大**：CSS 动画在实现复杂的动画效果时，受到限制较大，不能像 JavaScript 动画那样自由控制动画的速度、方向等。\n- **兼容性问题**：由于不同浏览器对 CSS 动画支持程度不同，因此在实现时需要考虑浏览器兼容性问题。\n- **可维护性差**：当动画效果较为复杂时，使用 CSS 实现的代码会变得冗长和难以维护，因此需要进行代码优化和结构设计。\n\n使用 JavaScript 实现动画的优缺点：\n\n优点：\n\n- **自由控制**：JavaScript 动画能够更加自由地控制动画的速度、方向等，可以实现更加复杂的动画效果。\n- **兼容性好**：由于 JavaScript 是浏览器通用的语言，因此在实现动画效果时，能够更好地兼容不同的浏览器。\n- **可维护性强**：使用 JavaScript 实现动画时，代码结构更加灵活，能够更好地维护和扩展。\n\n缺点：\n\n- **资源占用高**：JavaScript 动画通常需要更多的 CPU 和内存资源，因此在实现动画效果时需要考虑系统资源的消耗问题。\n- **性能问题**：JavaScript 动画性能受 JavaScript 引擎的影响，而不是浏览器引擎，因此需要对代码进行优化以提高动画性能。\n- **复杂度高**：JavaScript 动画的实现复杂度通常比 CSS 动画高，因此需要对动画效果进行设计和规划。',1,'2024-09-04 02:53:27','2024-09-04 02:53:27','2024-09-04 10:12:56',0),(1773180336625246209,'JS 中怎么阻止事件冒泡和事件默认行为？','','[\'JavaScript\']','在 JavaScript 中，可以通过以下方式阻止事件的冒泡和默认行为：\n\n**阻止事件冒泡**： 事件冒泡是指当一个子元素触发了某个事件后，事件会一直冒泡到它的父元素，直到到达文档根节点。为了阻止事件冒泡，可以使用事件对象的 stopPropagation() 方法。例如：\n\n```\ndocument.getElementById(\"child\").addEventListener(\"click\", function(event) {\n  // 阻止事件冒泡\n  event.stopPropagation();\n});\n```\n\n上面的代码中，当子元素被点击时，事件不会继续冒泡到父元素。\n\n**阻止事件默认行为：**\n\n事件的默认行为是指事件发生时，浏览器会默认执行的一些操作，例如提交表单、打开链接等。为了阻止事件的默认行为，可以使用事件对象的 preventDefault() 方法。例如：\n\n```\ndocument.getElementById(\"link\").addEventListener(\"click\", function(event) {\n  // 阻止链接的默认跳转行为\n  event.preventDefault();\n});\n```\n\n上面的代码中，当链接被点击时，链接不会跳转到指定的地址。\n\n需要注意的是，阻止事件的冒泡和默认行为可能会影响用户体验，因此需要谨慎使用。在一些场景下，可以使用阻止事件传播的方式来实现事件委托、事件代理等功能。\n\n',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:13:37',0),(1773180517613658113,'什么是防抖和节流？如何用 JS 编码实现？','','[\'JavaScript\']','防抖和节流都是一种优化技术，用来降低函数调用的频率，提高性能。\n\n防抖（Debounce）：在连续触发某个事件时，只有当一定时间内没有再次触发事件，才会执行事件处理函数。比如说，我们需要监听用户输入框中的文字，只有用户停止输入一段时间，才去发送请求获取数据。\n\n节流（Throttle）：在一段时间内只执行一次函数，无论事件被触发多少次。比如说，当我们需要监听用户滚动页面时，我们可以在用户滚动时，每隔一定时间就执行一次滚动事件。\n\n下面是防抖和节流的实现代码：\n\n防抖实现：\n\n```\nfunction debounce(func, delay) {\n  let timer;\n  return function(...args) {\n    clearTimeout(timer);\n    timer = setTimeout(() => {\n      func.apply(this, args);\n    }, delay);\n  };\n}\n```\n\n节流实现：\n\n```\nfunction throttle(func, delay) {\n  let timer;\n  return function(...args) {\n    if (!timer) {\n      timer = setTimeout(() => {\n        func.apply(this, args);\n        timer = null;\n      }, delay);\n    }\n  };\n}\n```\n\n其中 func 是需要进行防抖或节流处理的函数，delay 是事件执行的最小时间间隔。在防抖中，只有当事件触发后 delay 时间内没有再次触发事件，才会执行一次 func 函数；在节流中，每隔 delay 时间执行一次 func 函数。\n\n需要注意的是，在实际使用时，防抖和节流的处理函数应该在需要进行防抖或节流的事件上进行绑定，而不是在函数内部进行处理。\n\n> 鱼皮的补充：这题可以补充一些防抖或节流在页面中的应用场景，会加分',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:14:17',0),(1773180711184982018,'前端有哪些实现跨页面通信的方法？','','[\'JavaScript\']','前端有以下几种实现跨页面通信的方法：\n\n1. Cookie：通过在页面间共享 Cookie 实现简单的跨页面通信，但是 Cookie 大小有限制，不能存储过多的数据。\n\n2. localStorage 和 sessionStorage：HTML5 提供了本地存储的能力，可以通过 localStorage 或 sessionStorage 实现页面间数据共享，相比 Cookie 更加方便，但是也有大小限制。\n3. BroadcastChannel API：这是一个 HTML5 新增的 API，允许多个页面间通信，可以广播消息或向特定页面发送消息。\n4. SharedWorker：SharedWorker 是一种特殊类型的 Web Worker，可以在多个页面间共享数据，可以通过 postMessage API 实现消息传递。\n5. postMessage API：这是 HTML5 提供的一种消息传递机制，可以在不同窗口或 iframe 间传递消息，可以用来实现跨域通信。\n6. WebSocket：WebSocket 是一种持久化的协议，可以在浏览器和服务器之间实现双向通信，也可以在不同页面之间实现通信。\n\n以上这些方法都有其适用的场景和限制条件，需要根据具体情况进行选择和使用。',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:14:56',0),(1773180837664219138,'什么是虚拟 DOM？使用虚拟 DOM 一定更快吗？','','[\'JavaScript\']','虚拟 DOM（Virtual DOM）是一种将浏览器 DOM 抽象为 JavaScript 对象的技术，用于提高 DOM 操作的效率和性能。虚拟 DOM 可以在渲染前对组件的变化进行计算，减少 DOM 操作的次数，从而提高渲染性能。\n\n使用虚拟 DOM 可以提高性能，但并不是一定更快。虚拟 DOM 需要进行额外的计算和比较操作，而这些操作也会消耗一定的时间和性能。因此，虚拟 DOM 适用于大规模、高度动态的页面，而在简单的静态页面中使用虚拟 DOM 并不能提高性能。此外，虚拟 DOM 还可以提高开发效率，使代码更易于维护和调试。\n\n',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:15:37',0),(1773181083978915841,'JS 脚本延迟加载的方式有哪些？','','[\'JavaScript\']','JS 脚本的延迟加载主要有以下几种方式：\n\n1. defer 属性：在 HTML 中通过设置 script 标签的 defer 属性来实现脚本的延迟加载，即脚本的下载与 HTML 的解析不会阻塞彼此，脚本会在 HTML 解析完成后才执行。\n2. async 属性：在 HTML 中通过设置 script 标签的 async 属性来实现脚本的异步加载，即脚本的下载与 HTML 的解析不会阻塞彼此，脚本下载完成后会立即执行，但脚本执行时可能会阻塞 HTML 解析。\n3. 动态加载脚本：通过 JavaScript 动态创建 script 标签，并设置其 src 属性来实现脚本的异步加载，这种方式需要在脚本加载完成后手动执行脚本。\n4. 懒加载模式：在需要时再加载脚本，可以使用 jQuery 等库实现，或者通过自己编写的函数来实现。\n\n这些方式都可以在一定程度上优化页面加载性能，具体选择哪种方式要根据实际场景进行选择。\n\n> 鱼皮评论：这题可以再补充回答：什么时候适合使用延迟加载？\n\n',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:16:15',0),(1773181293622812674,'什么是点击穿透，怎么解决？','','[\'JavaScript\']','点击穿透是指在某些场景下，用户在快速点击页面元素时，由于某些原因（例如网络延迟），在前一个元素上的点击事件还没有完成时，下一个元素的点击事件就已经触发了，导致用户感觉到页面点击无效或者出现异常。\n\n解决点击穿透的方法有以下几种：\n\n1. 使用 debounce 或 throttle 函数。这两种函数可以控制函数的执行频率，减少短时间内函数的执行次数，从而减少点击穿透的可能性。\n2. 使用 CSS pointer-events 属性。将当前元素的 pointer-events 属性设为 none，可以禁用当前元素的鼠标事件，从而避免在事件处理函数执行过程中发生点击穿透。\n3. 使用 touch 事件代替 click 事件。在移动设备上，click 事件有300ms的延迟，可能会导致点击穿透。使用 touchstart、touchend 等 touch 事件可以避免这个问题。\n4. 在 click 事件中使用 preventDefault 函数。在 click 事件的处理函数中调用 preventDefault 函数，可以阻止默认的事件行为，从而避免点击穿透。但是这种方法有可能会影响到一些用户习惯，因此需要慎用。',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:16:55',0),(1773181423931449346,'什么是 JS 对象的可枚举性（enumerable）？','','[\'JavaScript\']','JS 对象的可枚举性指的是对象的某些属性是否可以被 for...in 循环枚举到。每个对象属性都有一个可枚举性标识，这个标识决定了这个属性是否可以被枚举。在对象属性创建时，可以通过 Object.defineProperty() 方法的 enumerable 属性来设置这个属性是否可枚举，默认为 true。\n\n有些内置对象的属性是不可枚举的，例如 Object.prototype 上的属性，这些属性可以通过 Object.getOwnPropertyNames() 方法获取。\n\n在 ES6 中，引入了 Object.keys()、Object.values() 和 Object.entries() 方法来获取对象可枚举属性的键、值和键值对。同时，也提供了 Reflect.enumerate() 方法来获取对象的所有属性（包括不可枚举属性），但该方法已经被废弃。\n\n> 鱼皮补充：这里题解表达的不清晰，如果你用了 defineProperty，没传参数就相当于设置为 false。这些属性默认为 true\n\n',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:17:35',0),(1773181719361445890,'JS 如何顺序执行 10 个异步任务？','','[\'JavaScript\']','JS 中可以使用 Promise 和 async/await 来顺序执行异步任务。\n\n使用 Promise 可以通过 then() 方法的链式调用来实现顺序执行异步任务，例如：\n\n```\nfunction asyncTask1() {\n  return new Promise(resolve => {\n    setTimeout(() => {\n      console.log(\'Async task 1\');\n      resolve();\n    }, 1000);\n  });\n}\n\nfunction asyncTask2() {\n  return new Promise(resolve => {\n    setTimeout(() => {\n      console.log(\'Async task 2\');\n      resolve();\n    }, 2000);\n  });\n}\n\n// 顺序执行异步任务\nasyncTask1().then(() => {\n  return asyncTask2();\n}).then(() => {\n  // 执行完异步任务1和异步任务2后的逻辑\n});\n```\n\n使用 async/await 可以将异步任务看作同步代码来执行，例如：\n\n```\nasync function runAsyncTasks() {\n  await asyncTask1();\n  await asyncTask2();\n  // 执行完异步任务1和异步任务2后的逻辑\n}\n\nrunAsyncTasks();\n```\n\n在这里，runAsyncTasks() 函数会先执行异步任务 1，等待异步任务 1 完成后再执行异步任务 2。',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:18:15',0),(1773181875494412289,'介绍一下 JS 中 setTimeout 的运行机制？','','[\'JavaScript\']','在 JavaScript 中，setTimeout() 方法被用于在指定的时间间隔后执行一个指定的代码块。它接受两个参数：第一个参数是需要执行的代码块，第二个参数是代码块的延迟时间（以毫秒为单位）。setTimeout() 方法执行完毕后，代码块将被推入 JavaScript 的执行队列中，等待 JavaScript 引擎在一段时间后执行。\n\nsetTimeout() 方法具有异步的特性，因此即使 setTimeout() 方法指定了一个很短的时间，它也不会在调用代码之后立即执行。相反，它会将代码块放在事件队列的末尾，直到事件队列中没有任何待处理的任务，才会执行。因此，当代码块执行时，当前执行的上下文（也称为堆栈）已经被清空。\n\n如果 setTimeout() 方法在代码块执行之前被清除或者代码块执行时间过长，那么代码块将会在 JavaScript 引擎空闲时尽快被执行。因此，setTimeout() 方法不是一个精确的时间控制器，而是一个粗略的时间控制器。如果需要更精确的时间控制器，可以考虑使用 requestAnimationFrame() 或 Web Workers。\n\n',1,'2024-09-04 02:53:28','2024-09-04 02:53:28','2024-09-04 10:18:53',0),(1773182079404695554,'怎么用 JS 实现大型文件上传？要考虑哪些问题？','','[\'JavaScript\']','在前端实现大型文件上传，需要考虑以下几个问题：\n\n分片上传：将大文件切割成多个小块进行上传，可以避免一次性上传大文件导致的上传时间过长，网络中断等问题。通常情况下，每个块大小为 1MB 左右。\n\n断点续传：由于网络等因素，上传过程中可能出现中断，此时需要能够从中断的地方恢复上传。\n\n并发上传：多个文件同时上传，需要对上传队列进行管理，保证上传速度和顺序。\n\n上传进度显示：及时显示上传进度，让用户知道上传进度和状态。\n\n可以通过使用第三方库来实现大型文件上传，比如 Plupload、Resumable.js 等。\n\n以下是一个使用 Plupload 实现大型文件上传的示例：\n\n```\n<!-- 引入 Plupload 的 JavaScript 和 CSS 文件 -->\n<script type=\"text/javascript\" src=\"plupload.full.min.js\"></script>\n<link rel=\"stylesheet\" href=\"plupload.css\">\n\n<!-- 上传控件的容器 -->\n<div id=\"uploader\">\n  <p>Your browser doesn\'t have Flash, Silverlight or HTML5 support.</p>\n</div>\n\n<!-- 初始化上传控件 -->\n<script type=\"text/javascript\">\n  var uploader = new plupload.Uploader({\n    browse_button: \'uploader\', // 上传控件的容器\n    url: \'/upload\', // 上传文件的 URL\n    multi_selection: false, // 是否允许同时上传多个文件\n    filters: {\n      max_file_size: \'100mb\', // 最大上传文件大小\n      mime_types: [\n        { title: \'Image files\', extensions: \'jpg,jpeg,gif,png\' },\n        { title: \'Zip files\', extensions: \'zip,rar\' }\n      ]\n    },\n    init: {\n      // 添加文件到上传队列之前触发的事件\n      BeforeUpload: function (up, file) {\n        console.log(\'BeforeUpload:\', file.name);\n      },\n      // 开始上传文件时触发的事件\n      UploadFile: function (up, file) {\n        console.log(\'UploadFile:\', file.name);\n      },\n      // 上传进度改变时触发的事件\n      UploadProgress: function (up, file) {\n        console.log(\'UploadProgress:\', file.percent);\n      },\n      // 上传成功时触发的事件\n      FileUploaded: function (up, file, info) {\n        console.log(\'FileUploaded:\', file.name, info.response);\n      },\n      // 上传出错时触发的事件\n      Error: function (up, err) {\n        console.log(\'Error:\', err.message);\n      }\n    }\n  });\n\n  // 初始化上传控件\n  uploader.init();\n</script>\n\n```\n\n在后端，需要根据上传控件发送的请求，来实现文件的接收和存储。具体实现方式视具体情况而定，可以使用 SpringMVC、Express.js 等框架来实现。同时，也需要考虑上传文件大小限制、上传速度控制等问题。\n\n> 鱼皮补充：建议大家可以尝试手写下大文件上传，这里涉及很多知识和可优化点，写好了就是一个独立的项目',1,'2024-09-04 02:53:29','2024-09-04 02:53:29','2024-09-04 10:19:32',0),(1773182297827270658,'什么是箭头函数？能使用 new 来创建箭头函数么？','','[\'JavaScript\']','箭头函数是 ES6 中新增的一种函数定义方式，可以用来简化函数的定义和书写。箭头函数的特点是：简洁的语法、绑定 this 关键字、不能用作构造函数。\n\n箭头函数使用箭头（=>）来定义，基本语法如下：\n\n```\n(parameters) => { statements }\n```\n\n其中，parameters 是函数的参数列表，可以是一个或多个参数，多个参数之间用逗号分隔；statements 是函数的执行语句，可以是一个或多个语句，多个语句之间用花括号包裹起来。\n\n在箭头函数中，this 关键字指向的是函数定义时所在的对象，而不是执行时所在的对象。这个特性有助于避免 this 的指向问题，使得代码更加简洁易读。\n\n需要注意的是，箭头函数不能用作构造函数，也就是不能通过 new 关键字来创建实例。因为箭头函数没有自己的 this，而是继承了外层作用域的 this。如果用 new 来创建实例，就会出现意料之外的结果。\n\n鱼皮补充：”在箭头函数中，this 关键字指向的是函数定义时所在的对象，而不是执行时所在的对象。这个特性有助于避免 this 的指向问题，使得代码更加简洁易读” —— 这句话很关键',1,'2024-09-04 02:53:29','2024-09-04 02:53:29','2024-09-04 10:20:11',0),(1773182543294717954,'什么是前端路由？什么时候适合使用前端路由？它有哪些优点和缺点？','','[\'JavaScript\']','前端路由是指在前端页面内部实现页面之间的跳转，而不是像传统的网页跳转那样在后端进行页面跳转。前端路由使用浏览器的 history 接口，通过改变浏览器的 URL，来更新页面的视图。\n\n前端路由适合用于单页面应用（SPA）的开发。当一个应用中需要经常切换页面时，使用前端路由可以避免频繁向服务器发起请求，提高页面切换的速度和用户体验。\n\n前端路由的优点：\n\n- 单页面应用的页面跳转速度快，用户体验好\n- 可以根据不同的 URL 显示不同的页面内容，可以更好地实现前端的页面控制\n- 可以更好地实现前端路由权限控制\n\n前端路由的缺点：\n\n- 不支持搜索引擎爬虫，对于 SEO 不利\n- 对于复杂的页面控制逻辑和状态管理，需要额外的工作\n- 需要注意浏览器的前进后退等操作对页面的影响\n\n总的来说，前端路由适用于对页面跳转速度和用户体验有要求的单页面应用，但在一些场景下，需要权衡其带来的一些缺点。',1,'2024-09-04 02:53:29','2024-09-04 02:53:29','2024-09-04 10:20:51',0),(1773182677529223170,'为什么 JS 要被设计为单线程？','','[\'JavaScript\']','JS 被设计为单线程的主要原因是为了避免多线程编程所带来的复杂性。如果 JS 是多线程的，那么在处理并发问题时，需要考虑锁、同步等一系列复杂的问题，这会增加代码的复杂度和开发难度。\n\n此外，JS 最初是为了解决网页交互的问题而诞生的，而网页交互的需求大部分是基于用户事件的，比如点击按钮、输入文本等。这些操作的响应速度要求很高，如果在响应事件的同时还要处理其他任务，可能会导致网页卡顿、响应变慢等用户体验不佳的问题。\n\n因此，为了避免多线程所带来的复杂性和降低开发难度，并且满足网页交互的高响应速度需求，JS 被设计为单线程。虽然单线程有局限性，但是可以通过异步编程、事件循环机制等技术手段来实现高效的并发处理。\n\n',1,'2024-09-04 02:53:29','2024-09-04 02:53:29','2024-09-04 10:21:30',0),(1773182921658687490,'JS 代码中的 use strict 是什么？有什么作用？','','[\'JavaScript\']','use strict\" 是 ECMAScript 5 引入的一种严格模式，它用于指示 JavaScript 引擎采用更严格的解析和执行模式。\n\n当在 JavaScript 代码中使用 \"use strict\" 声明时，代码将会在严格模式下执行。严格模式包含了一些额外的规则和限制，有助于开发者避免一些常见的错误。\n\n使用 \"use strict\" 的主要作用包括：\n\n1. 消除 JavaScript 中的一些不合理、不安全的语法，减少代码出错的可能性。\n2. 防止使用未声明的变量、函数，强制开发者进行声明。\n3. 强制函数中的 this 值只能在函数内部使用，避免在全局作用域中误用 this 值。\n4. 禁止删除变量、函数等，避免意外删除重要的变量和函数。\n5. 提高代码性能，因为 JavaScript 引擎可以更好地进行优化。  \n\n使用 \"use strict\" 的方式有两种：\n\n1. 在 JavaScript 文件开头使用 \"use strict\"。\n2. 在函数体内第一条语句中使用 \"use strict\"。  \n\n例如，在 JavaScript 文件开头使用 \"use strict\" 的方式如下：\n\n```\n\"use strict\";\nvar x = 1;\n```\n\n在函数体内第一条语句中使用 \"use strict\" 的方式如下：\n\n```\nfunction myFunction() {\n  \"use strict\";\n  var x = 1;\n}\n```\n\n总之，\"use strict\" 是一种在 JavaScript 中使用严格模式的方法，它可以提高代码的可靠性和性能，避免一些常见的错误。\n\n',1,'2024-09-04 02:53:29','2024-09-04 02:53:29','2024-09-04 10:22:08',0),(1773183066127294465,'如何使用 JS 判断某个字符串长度（要求支持 Emoji 表情）？','','[\'JavaScript\']','在 JavaScript 中，可以使用 String 类型的 length 属性来获取字符串的长度。但是，由于 Emoji 表情在字符串中占用了两个字符的位置，因此直接使用 length 属性得到的结果并不准确。\n\n为了正确地获取字符串的长度，可以使用如下的方法：\n\n```\n/**\n * 计算字符串的长度（支持 Emoji 表情）\n * @param {string} str - 要计算长度的字符串\n * @returns {number} - 字符串的长度\n */\nfunction getLength(str) {\n  let length = 0;\n  for (let i = 0; i < str.length; i++) {\n    const code = str.charCodeAt(i);\n    if (code >= 0xd800 && code <= 0xdbff) {\n      i++;\n    }\n    length++;\n  }\n  return length;\n}\n```\n\n举个例子，对于字符串 \"Hello,🌍!\"，使用该函数计算出的长度为 8，而使用 length 属性计算出的长度则为 9。',1,'2024-09-04 02:53:29','2024-09-04 02:53:29','2024-09-04 10:22:47',0),(1773183270662529026,'JS 在什么情况下会存在数字精度丢失的问题，如何解决？','','[\'JavaScript\']','在 JavaScript 中，数字类型是采用 IEEE 754 标准的双精度浮点数表示的，由于双精度浮点数只有 52 位精度，因此在进行精度较高的数值计算时，可能会出现数字精度丢失的问题。例如：\n\n```\nconsole.log(0.1 + 0.2); // 输出结果为 0.30000000000000004\n```\n\n可以看到，实际上 0.1 + 0.2 的结果并不等于 0.3，这是因为双精度浮点数的精度限制导致的。在处理货币等需要高精度计算的场景时，这种精度丢失的问题可能会导致计算错误。\n\n为了解决这个问题，可以采用以下几种方法：\n\n使用整数进行计算：可以将数字转换成整数进行计算，例如将货币的单位从元转换成分进行计算，避免小数计算带来的精度问题。\n\n使用第三方库：例如 decimal.js 和 big.js 等第三方库，可以提供更高精度的数字计算功能，避免精度丢失的问题。\n\n使用 toFixed 方法：可以使用 JavaScript 中的 toFixed 方法将数字转换成指定位数的字符串，例如将 0.1 和 0.2 转换成一位小数的字符串再进行相加，避免精度丢失的问题。\n\n```\nconsole.log((0.1 + 0.2).toFixed(1)); // 输出结果为 \"0.3\"\n```\n\n总之，在进行精度较高的数值计算时，需要注意 JavaScript 中存在的数字精度丢失问题，并根据具体情况选择合适的解决方案。',1,'2024-09-04 02:53:29','2024-09-04 02:53:29','2024-09-04 10:23:25',0),(1773183396873330690,'说说你对 JS 模块化方案的理解，比如 CommonJS、AMD、CMD、ES Module 分别是什么？','','[\'JavaScript\']','JS 模块化是指将一个 JS 应用拆分成多个模块或文件，并通过一定的规范或语法定义它们之间的依赖关系，从而达到复用、维护、扩展的目的。常见的 JS 模块化方案有以下几种：\n\n1. CommonJS：一种用于服务器端的模块化规范，主要用于 Node.js，它通过 require 来引入模块，通过 module.exports 或 exports 来导出模块。\n2. AMD：一种用于浏览器端异步加载模块的规范，主要用于 RequireJS，它通过 define 来定义模块，通过 require 来异步加载模块。\n3. CMD：一种用于浏览器端延迟执行的模块化规范，主要用于 SeaJS，它通过 define 来定义模块，通过 require 来延迟执行模块。\n4. ES Module：一种官方规范，用于浏览器端和 Node.js 中，通过 import 来引入模块，通过 export 来导出模块。\n\n这些模块化方案在实现上有不同的语法和规范，但它们都是为了实现 JS 的模块化而产生的，都可以使 JS 应用更易于维护和扩展。\n\n其中，ES Module 是官方规范，具有更好的兼容性和可扩展性，而 CommonJS 和 AMD/CMD 则更多地用于 Node.js 和浏览器端的异步加载，各有优缺点。',1,'2024-09-04 02:53:29','2024-09-04 02:53:29','2024-09-04 10:24:05',0),(1773183528297652226,'如果使用 Math.random() 来计算中奖概率，会有什么问题吗？','','[\'JavaScript\']','使用 Math.random() 来计算中奖概率是不可靠的。因为 Math.random() 函数的随机性并不是真正的随机，它是基于一个种子值（seed）生成的伪随机数序列。如果你在相同的环境中使用相同的种子值，那么生成的随机数序列是相同的。因此，如果不使用合适的种子值生成伪随机数，就有可能出现概率计算错误的情况。\n\n为了准确地计算中奖概率，可以使用其他的随机数生成算法，比如 crypto 模块中的 randomBytes() 方法，它可以生成真正的随机数。例如，如果要计算 1/1000 的中奖概率，可以使用如下代码：\n\n```\nconst crypto = require(\'crypto\');\n\nfunction isWinner() {\n  const rand = crypto.randomBytes(4).readUInt32BE();\n  return rand < 429496729; // 429496729 = Math.pow(2, 32) / 1000\n}\n```\n\n在上面的代码中，使用 crypto.randomBytes() 生成 4 个字节的随机数，然后将它转换为无符号的 32 位整数，判断该随机数是否小于 429496729，如果小于，则认为中奖了。这样计算中奖概率是比较准确的。',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:24:45',0),(1773183673856778242,'怎么使用 JS 实现元素拖拽功能？','','[\'JavaScript\']','要使用 JavaScript 实现元素的拖拽功能，您可以按照以下步骤操作：\n\n为需要拖拽的元素添加 mousedown、mousemove和mouseup 事件监听器。 在 mousedown 事件处理函数中，记录鼠标按下时的位置，以及鼠标相对于元素的位置。 在 mousemove 事件处理函数中，计算鼠标移动的距离，并更新元素的位置。 在 mouseup 事件处理函数中，移除 mousemove 和 mouseup 事件监听器。 以下是一个简单的实现示例：\n\n```\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Draggable Element</title>\n    <style>\n        #draggable {\n            width: 100px;\n            height: 100px;\n            background-color: blue;\n            position: absolute;\n            cursor: move;\n        }\n    </style>\n</head>\n<body>\n    <div id=\"draggable\"></div>\n\n    <script>\n        const draggableElement = document.getElementById(\'draggable\');\n\n        draggableElement.addEventListener(\'mousedown\', (event) => {\n            // 记录鼠标按下时的位置\n            let startX = event.clientX;\n            let startY = event.clientY;\n\n            // 计算鼠标相对于元素的位置\n            let offsetX = startX - draggableElement.offsetLeft;\n            let offsetY = startY - draggableElement.offsetTop;\n\n            // 处理鼠标移动事件\n            const onMouseMove = (event) => {\n                // 计算鼠标移动的距离\n                let deltaX = event.clientX - startX;\n                let deltaY = event.clientY - startY;\n\n                // 更新元素的位置\n                draggableElement.style.left = `${event.clientX - offsetX}px`;\n                draggableElement.style.top = `${event.clientY - offsetY}px`;\n            };\n\n            // 处理鼠标松开事件\n            const onMouseUp = () => {\n                document.removeEventListener(\'mousemove\', onMouseMove);\n                document.removeEventListener(\'mouseup\', onMouseUp);\n            };\n\n            // 添加事件监听器\n            document.addEventListener(\'mousemove\', onMouseMove);\n            document.addEventListener(\'mouseup\', onMouseUp);\n        });\n    </script>\n</body>\n</html>\n```\n\n这个示例将实现一个简单的拖拽功能，您可以在此基础上根据需要进行调整和优化。注意，这个示例未考虑边界限制和性能优化，请根据实际需求进行相应调整。',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:25:24',0),(1773183885060956162,'JS 会出现内存泄漏问题么？在哪些情况下可能会出现内存泄漏？','','[\'JavaScript\']','JavaScript 也会出现**内存泄漏问题**。内存泄漏是指一些**被分配的内存空间**，因为某些原因而无法被**垃圾回收机制**回收，导致占用内存空间无法被释放，最终会导致程序崩溃。\n\n在 JavaScript 中，内存泄漏通常出现在以下情况：\n\n1. **意外的全局变量**：如果一个变量没有被垃圾回收，那么它的作用域会被认为是全局的，这样就会造成意外的全局变量，导致内存泄漏。\n2. **定时器没有被清除**：如果在页面关闭前，某个定时器没有被清除，它所引用的对象就不会被垃圾回收，从而导致内存泄漏。\n3. **闭包**：如果一个闭包中引用了外部变量，而这个闭包被其他代码引用，那么它所引用的外部变量就不会被垃圾回收，从而导致内存泄漏。\n4. **DOM 引用**：如果在页面上有大量的 DOM 元素，而这些元素被 JavaScript 代码所引用，但是却没有被正确地释放，就会导致内存泄漏。\n5. **循环引用**：如果两个或多个对象之间形成了循环引用，即相互引用对方，那么它们都不会被垃圾回收，从而导致内存泄漏。\n\n为了避免 JavaScript 中的内存泄漏问题，可以采取以下措施：\n\n1. **避免意外的全局变量**，可以使用 \"use strict\" 模式，或者在函数中使用 var、let 或 const 声明变量。\n2. 在使用**定时器**时，一定要记得及时清除定时器。\n3. 尽量避免使用**闭包**，如果必须使用闭包，要注意不要引用外部变量或者及时清除闭包。\n4. 在操作 DOM 元素时，要**及时释放引用**，避免 DOM 引用导致内存泄漏。\n5. **避免循环引用**，可以在对象不再使用时，手动断开对象之间的引用关系。',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:26:04',0),(1773184012311945218,'什么是 Javascript 的事件流？有哪些事件流模型？','','[\'JavaScript\']','JavaScript 的事件流是指浏览器中所有事件的传递和处理过程。事件流可以分为三个阶段：事件捕获、目标阶段和事件冒泡。\n\n1. 事件捕获阶段：事件从最外层的文档节点一直往下传递，直到事件到达事件的目标元素。在这个过程中，事件会经过父节点和祖先节点，直到到达目标节点。如果在这个过程中有事件处理程序，则事件将被调用。\n2. 目标阶段：事件到达了目标元素后，将在目标元素上调用事件处理程序。如果有多个事件处理程序绑定到目标元素上，将按照它们的顺序执行。\n3. 事件冒泡阶段：事件在目标元素上处理后，会从目标元素开始，向上传递回文档节点。在这个过程中，事件也会遇到任何绑定的事件处理程序。\n\n目前有两种事件流模型：\n\n1. W3C 标准事件模型（DOM2级事件模型）：事件流由三个阶段组成：捕获阶段、目标阶段和冒泡阶段。这种事件模型中，事件处理程序的调用顺序与它们注册的顺序相同。\n2. Microsoft 事件模型（IE 事件模型）：事件流由两个阶段组成：目标阶段和冒泡阶段。在这个事件模型中，事件处理程序的调用顺序与它们注册的相反。\n\n总体来说，W3C 标准事件模型是当前主流的事件流模型。对于事件流，我们需要了解事件捕获、目标阶段和事件冒泡，以便于正确地使用事件处理程序。',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:26:44',0),(1773184160303767554,'ES6 有哪些新特性？','','[\'ES6 \']','ES6（ECMAScript 6）是 JavaScript 的第六个版本，也称为 ES2015，引入了很多新特性来增强 JavaScript 语言的能力。下面是 ES6 中一些常见的新特性：\n\n1. let 和 const 声明变量\n2. 模板字符串（Template Literals）\n3. 解构赋值（Destructuring）\n4. 箭头函数（Arrow Functions）\n5. Promise 对象\n6. 函数参数默认值\n7. 对象字面量增强（Object Literal Enhancements）\n8. 类和继承（Classes and Inheritance）\n9. 迭代器（Iterators）\n10. 生成器（Generators）\n11. 模块（Modules）\n12. Set 和 Map 数据结构\n13. Symbol 数据类型\n14. for...of 循环\n15. let 和 const 块级作用域\n16. 异步函数 async/await\n\nES6 的新特性增强了 JavaScript 的表现力和编程能力，使得开发者可以更加高效和便捷地编写代码。',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:27:24',0),(1773184612944666625,'ES5 中的类和 ES6 中的 class 有什么区别？','','[\'ES6 \']','在 ES5 中，我们通常使用构造函数来创建对象和实现继承，而在 ES6 中，引入了类（class）的概念来简化对象创建和继承的过程。下面是 ES5 中类和 ES6 中的 class 的一些区别：\n\n- 语法不同：ES5 中使用构造函数来定义类，而 ES6 中使用 class 关键字来定义类。\n\n- 继承方式不同：ES5 中使用原型链继承来实现继承，而 ES6 中使用 extends 关键字和 super 函数来实现继承。\n\n- 类方法的定义方式不同：ES5 中类方法定义在构造函数的原型对象上，而 ES6 中类方法定义在类的内部。\n\n- 类属性的定义方式不同：ES5 中类属性定义在构造函数的原型对象上，而 ES6 中类属性定义在类的内部，并且需要使用 static 关键字来定义静态属性。\n\n- 类的调用方式不同：ES5 中需要使用 new 关键字来创建类的实例，而 ES6 中类的调用方式更加简单，只需要像函数一样调用即可。\n\n需要注意的是，虽然 ES6 中引入了类的概念，但在底层实现上仍然是基于原型链的。因此，理解原型链继承和类的继承是理解 JavaScript 面向对象编程的关键。',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:28:05',0),(1773184720817971201,'什么是 ES6 中的 Promise？它的使用场景有哪些？','','[\'ES6 \']','ES6 中的 Promise 是一种处理异步操作的方式，它是一个对象，用于表示一个异步操作的最终完成或失败及其结果值的表示。Promise 对象有三种状态：pending（等待中）、fulfilled（已完成）和 rejected（已失败）。\n\nPromise 有以下几个优点：\n\n1. 可以避免回调地狱：将回调函数转换成了链式调用，代码可读性更好。\n2. 可以支持多个并发请求：Promise.all() 可以让多个 Promise 并行执行，提高了执行效率。\n3. 可以在异步代码中捕获错误：Promise.catch() 可以捕获异步代码中的错误。\n\nPromise 的使用场景包括：\n\n1. 处理异步操作：比如 Ajax 请求、文件读取等。\n2. 优化回调函数：将回调函数转换成 Promise 链，提高代码可读性。\n3. 实现并发请求：Promise.all() 可以让多个请求并行执行。\n4. 解决回调地狱：将嵌套的回调函数转换成链式调用，提高代码可读性。\n\n以下是使用 JS 编码实现 Promise 的例子\n\n```\n// 定义一个 Promise\nconst promise = new Promise((resolve, reject) => {\n  // 异步操作\n  setTimeout(() => {\n    if (Math.random() > 0.5) {\n      resolve(\'成功\');\n    } else {\n      reject(new Error(\'失败\'));\n    }\n  }, 1000);\n});\n\n// 处理 Promise 的结果\npromise.then((value) => {\n  console.log(value);\n}).catch((error) => {\n  console.error(error);\n});\n```\n\n> 鱼皮补充：这题可以多说说自己在项目中是如何运用 promise 的',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:28:44',0),(1773184830406746113,'ES6 中的 Reflect 对象有什么用？','','[\'ES6 \']','在 ES6 中，Reflect 对象是一个内置的对象，提供了一组用于操作对象的方法。它的作用是对对象的某些操作进行拦截和修改，从而提供更加灵活和强大的对象操作方式。\n\n以下是一些 Reflect 对象的常用方法和用途：\n\n1. Reflect.get(target, property, receiver)：读取对象的属性值。与对象的点运算符和方括号运算符相比，这个方法提供了更加灵活和可控的属性读取方式。\n2. Reflect.set(target, property, value, receiver)：设置对象的属性值。与对象的点运算符和方括号运算符相比，这个方法提供了更加灵活和可控的属性设置方式。\n3. Reflect.has(target, property)：检查对象是否具有指定的属性。与 in 运算符相比，这个方法提供了更加灵活和可控的属性检查方式。\n4. Reflect.deleteProperty(target, property)：删除对象的属性。与 delete 运算符相比，这个方法提供了更加灵活和可控的属性删除方式。\n5. Reflect.construct(target, argumentsList[, newTarget])：使用给定的参数列表创建对象。与 new 运算符相比，这个方法提供了更加灵活和可控的对象创建方式。\n6. Reflect.apply(target, thisArgument, argumentsList)：调用对象的方法。与函数调用运算符相比，这个方法提供了更加灵活和可控的方法调用方式。\n\n除了上述方法之外，Reflect 对象还提供了许多其他的方法，例如 Reflect.defineProperty、Reflect.getOwnPropertyDescriptor、Reflect.getPrototypeOf、Reflect.setPrototypeOf 等，都可以用于对对象进行拦截和修改。\n\n总之，Reflect 对象提供了一组灵活和强大的对象操作方法，可以用于实现代理、拦截、元编程等功能，使 JavaScript 更加强大和灵活。\n\n',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:29:23',0),(1773185035889893377,'什么是浏览器的同源策略？为什么要有同源策略？','','[\'浏览器 \']','同源策略（Same-Origin Policy）是指浏览器安全策略中的一项重要规则，它规定了浏览器只允许当前网页的脚本与来自同一站点（协议、主机、端口号相同）的窗口进行交互，而限制了与不同源（协议、主机、端口号任一不同）的窗口进行交互。这种限制能够有效保障用户的信息安全和隐私。\n\n同源策略限制了跨域请求、Cookie、LocalStorage、IndexedDB 等跨站点资源的访问，防止恶意网站窃取用户数据和攻击。同源策略的存在是 Web 安全的重要保障，是浏览器防范跨站脚本攻击（XSS）、跨站请求伪造（CSRF）等安全威胁的关键措施。\n\n如果需要进行跨域请求或共享数据，可以通过特定的手段（如 JSONP、CORS、代理等）来实现。同时，Web 应用开发中应当严格遵守同源策略的原则，避免将敏感信息暴露在跨域页面中。\n\n> 鱼皮补充：这道题目建议大家可以多讲下自己在项目中遇到的跨域问题、以及是如何解决的',1,'2024-09-04 02:53:32','2024-09-04 02:53:32','2024-09-04 10:30:03',0),(1773185211346018305,'怎么解决跨域问题？','','[\'浏览器 \']','**跨域问题**（Cross-Origin Resource Sharing，CORS）是由于浏览器的**同源策略**（Same-Origin Policy）导致的。同源策略指的是，**如果两个 URL 的协议、主机名和端口号都相同，那么它们就是同源的，否则就是跨域的**。当网页发起跨域请求时，**浏览器会根据同源策略限制请求**。解决跨域问题的方法有以下几种：\n\n**JSONP（JSON with Padding）**\n\nJSONP 是一种**跨域请求数据**的方式，它利用了 \\<script> 标签不受同源策略限制的特性，可以从不同的域名请求数据。实现原理是在服务端生成一个 JavaScript 函数，客户端使用 \\<script> 标签请求该函数，服务端返回该函数的调用，并将需要传输的数据作为函数参数传入。\n\n**CORS（Cross-Origin Resource Sharing）**\n\nCORS 是一种通过**添加一些 HTTP 头**来允许浏览器**跨域访问资源**的机制，主要是服务端配置。服务端需要在响应头中添加 **Access-Control-Allow-Origin** 和其他一些参数，指示允许哪些域名进行跨域请求。\n\n**反向代理**\n\n反向代理是**将客户端的请求转发到真正的服务端**，从而解决跨域问题。反向代理服务器和真正的服务端在**同一个域名下**，客户端的请求只需要向反向代理服务器发起，由反向代理服务器将请求转发到真正的服务端，最后将响应返回给客户端。\n\n**WebSocket**\n\nWebSocket 是一种在单个 TCP 连接上进行**全双工通信**的协议，可以用于**跨域通信**。由于 **WebSocket 协议并不受同源策略的限制**，因此可以实现跨域通信。\n\n总的来说，不同的解决方案有各自的优缺点，应根据实际情况选择最适合的方式。例如，如果需要在客户端和服务端之间进行**实时通信**，**WebSocket 是最佳选择**；如果只需要在客户端发起**简单的 GET 请求**，可以使用 **JSONP 等**方式。\n\n> 鱼皮补充：这题在回答时可以先把解决方案分为两类：服务端解决和客户端解决',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:30:44',0),(1773185387385151490,'浏览器的本地存储方式有哪些，有什么区别，分别有哪些应用场景？','','[\'浏览器 \']','浏览器的本地存储方式主要有以下几种：\n\n1. Cookie：Cookie 是浏览器中最古老的本地存储方式，它可以存储少量的文本数据，并在之后的 HTTP 请求中自动携带发送给服务器。Cookie 可以设置过期时间，也可以设置作用域（只在特定域名或路径下有效）。 应用场景：一般用于存储会话信息、用户偏好设置等少量的文本数据。\n2. LocalStorage：LocalStorage 是 HTML5 新增的本地存储方式，可以存储较大量的数据，数据保存在浏览器本地且不会过期，除非手动删除或清除缓存。 应用场景：适用于存储用户个性化数据、本地数据缓存等。\n3. SessionStorage：SessionStorage 也是 HTML5 新增的本地存储方式，与 LocalStorage 类似，但是数据只在会话期间有效，会话结束或关闭浏览器后数据会被清除。 应用场景：适用于需要短期保存数据的场景，如表单数据暂存、页面数据缓存等。\n4. IndexedDB：IndexedDB 是 HTML5 中的一个本地数据库存储方案，可以存储大量结构化数据，支持事务处理和索引查找，功能比较强大。 应用场景：适用于需要离线存储数据、本地数据库操作等。\n5. Web SQL：Web SQL 是 HTML5 中的另一种本地数据库存储方案，采用 SQL 语句进行数据存储和查询，但是目前已经被弃用，不建议使用。 应用场景：类似于 IndexedDB，适用于需要离线存储数据、本地数据库操作等。\n\n不同的本地存储方式适用于不同的场景，选择合适的方式可以提高用户体验和网站性能。',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:31:24',0),(1773185512601903106,'什么是回流和重绘？什么场景下会触发？怎么减少回流和重绘？','','[\'浏览器 \']','回流（Reflow）和重绘（Repaint）是浏览器渲染过程中的两个关键概念，它们对网页性能产生重要影响。理解回流和重绘以及它们的触发场景有助于我们优化网页性能。\n\n回流（Reflow）： 回流是当浏览器需要重新计算元素的布局、尺寸和位置时所发生的过程。回流通常发生在以下场景：\n\n1. 添加或删除可见的 DOM 元素。\n2. 元素尺寸发生变化，如宽度、高度、边距、填充等。\n3. 页面布局发生变化，如改变窗口大小。\n4. CSS 伪类激活，如:hover。\n5. 计算 offsetWidth、offsetHeight 等属性。\n\n重绘（Repaint）： 重绘是浏览器在元素的外观发生变化，但不影响布局时所发生的过程。重绘通常发生在场景：改变元素的颜色、背景、边框等样式，但不影响元素尺寸和位置。\n\n减少回流和重绘的方法：\n\n1. 避免频繁操作样式：多次修改样式时，可以使用一个 class 来修改，或者通过修改 style 属性进行批量操作。\n2. 避免逐项改变样式：使用 CSS 的 transform、opacity 等属性进行动画，而不是改变宽度、高度、位置等会触发回流的属性。\n3. 使用文档片段（DocumentFragment）或者 offscreen 元素进行批量操作：在对 DOM 元素进行大量操作时，可以先将它们从文档流中移除，然后在内存中进行操作，最后再插入文档流中。\n4. 避免使用 table 布局：table 布局中的元素发生回流时，会影响到整个表格，从而导致更多的回流。\n5. 对具有复杂动画的元素使用绝对定位：将动画元素脱离文档流，减少回流对其他元素的影响。\n6. 避免频繁访问布局信息：如 offsetWidth、offsetHeight 等，可以在访问前将这些值缓存起来，避免多次触发回流。\n\n回流和重绘对性能影响较大，尤其是在移动设备上。因此，优化代码以减少回流和重绘次数是提高网页性能的重要手段。',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:32:03',0),(1773185887534931970,'说说 Vue 中的 diff 算法','','[\'Vue\']','Vue 中的 diff 算法是用于更新 Virtual DOM 树，从而实现高效的 DOM 操作。diff 算法会对比新旧两棵 Virtual DOM 树的差异，然后只更新必要的部分，从而减少 DOM 操作的次数。Vue 中的 diff 算法包括以下几个步骤：\n\n- 新旧节点的比较 diff 算法会首先比较新旧节点是否相同，如果相同，则继续比较子节点；如果不同，则进行下一步操作。\n- 对子节点进行比较 对新旧节点的子节点进行比较，具体分为以下四种情况：\n  - 新节点没有子节点，旧节点有子节点：直接删除旧节点的子节点\n  - 旧节点没有子节点，新节点有子节点：直接添加新节点的子节点\n  - 新旧节点都有子节点：继续比较子节点\n  - 新旧节点都有相同的子节点：对相同的子节点进行递归比较\n\n- 对旧节点多余的子节点进行删除 如果旧节点的子节点比新节点的子节点多，那么对于多余的子节点，直接进行删除。\n\n在 diff 算法中，由于只更新必要的部分，所以可以大大提高 DOM 操作的效率。这也是 Vue 可以实现高效渲染的重要原因之一。\n\n',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:32:41',0),(1773186052660486145,'Vue 模板是如何编译的？经历了哪些过程？','','[\'Vue\']','Vue 模板在运行时会被编译成渲染函数，最终生成 Virtual DOM，进行页面渲染。\n\nVue 模板编译的过程主要分为以下三个步骤：\n\n1. **解析模板**：Vue 会使用正则表达式解析模板字符串，解析出其中的指令、标签、属性等内容。\n2. **生成 AST（抽象语法树）**：将解析后的模板字符串转化为抽象语法树，抽象语法树是一个以 JavaScript 对象表示的树形结构，它将模板中的各个节点和属性用 JavaScript 对象的形式表示出来，方便后续对模板进行分析和处理。\n\n3. **生成渲染函数**：将 AST 转化为渲染函数，渲染函数是一个纯 JavaScript 函数，用于将模板转化为 Virtual DOM。\n\n在模板的编译过程中，还会涉及到动态指令、插槽、组件等特殊情况的处理，不同的编译器实现可能存在一些差异，但大体的编译流程是相似的。\n\n通过模板的编译，我们可以将模板转化为可被 JavaScript 运行的函数，从而更高效地渲染页面，提高应用的性能。\n\n> 鱼皮补充：这题很关键的一个点就是 Vue 最后是转化为 js 来执行的，其他细节的话根据自己的时间来，能了解多少了解多少吧',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:33:22',0),(1773186189252190210,'Vue 中 computed 和 watch 区别？分别适用于什么场景？','','[\'Vue\']','Vue 中的 computed 和 watch 是两种用于响应式数据更新的方法。\n\ncomputed 是计算属性，它会根据响应式数据的变化自动计算出新的值，并缓存结果，只有在计算属性所依赖的响应式数据发生改变时才会重新计算。computed 适用于需要根据响应式数据计算得出结果的场景，例如根据商品的数量和单价计算商品的总价，或者根据选中的过滤条件过滤出数据列表。\n\nwatch 是侦听器，它可以监听指定的响应式数据的变化，并在数据发生改变时执行指定的回调函数。watch 适用于需要执行一些异步或复杂操作的场景，例如监听表单输入框的变化并发送 Ajax 请求，或者监听路由变化并根据路由参数切换页面。\n\n总的来说，computed 适用于计算数据的场景，而 watch 适用于需要执行异步或复杂操作的场景。',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:34:00',0),(1773186531058606082,'什么是 Vuex？使用 Vuex 有哪些好处？','','[\'Vue\']','Vuex是Vue.js框架中用于实现集中式状态管理的插件。它的主要作用是在多个组件之间共享状态，并且提供了一些工具来方便地管理应用程序的状态。\n\n使用Vuex可以将应用程序的状态存储在一个集中的地方，从而使状态管理更加容易、可维护性更高。它还提供了一些工具来简化状态的更改和操作，例如：在组件中使用mutations来修改状态，或者使用actions来异步操作数据。\n\n使用Vuex的好处包括：\n\n1. 集中化的状态管理：将应用程序的状态集中存储在一个地方，可以方便地进行状态管理和维护。\n2. 易于调试：使用Vuex可以方便地跟踪和记录状态的更改历史，有助于快速诊断和解决问题。\n3. 状态共享：在多个组件之间共享状态，避免了组件之间繁琐的传值，提高了组件之间的解耦性。\n4. 插件化：Vuex提供了插件机制，可以方便地扩展和自定义Vuex的功能。\n\nVuex的缺点包括：\n\n1. 增加了学习成本：Vuex相对于直接在组件中管理状态来说，增加了一些学习成本，需要花费时间去学习Vuex的概念和使用方式。\n2. 增加了代码复杂度：在使用Vuex的过程中，需要增加一些额外的代码来管理状态，有时可能会增加代码的复杂度。\n\n> 鱼皮补充：注意，不是说什么情况下都要用 Vuex，要理解【状态管理】的含义。因为有的时候你自己定义一个全局变量也许就能解决问题',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:34:40',0),(1773186662935912449,'Vue Router 的 $route 和 $router 对象有什么区别？','','[\'Vue\']','在 Vue.js 中，$route 和 $router 都是 Vue Router 提供的对象，但它们的作用不同。\n\n$route 对象代表着当前激活的路由信息，它包含了当前 URL 解析得到的信息，如当前路径、参数、查询参数等。$route 对象是一个只读对象，我们无法通过改变 $route 对象来改变当前路由。\n\n$router 对象则是 Vue Router 的实例对象，它负责管理整个路由的状态，包括当前路径、路由参数、路由切换等。$router 对象可以通过编程的方式来改变当前路由，如通过 $router.push()、$router.replace()、$router.go() 等方法。\n\n总的来说，$route 对象是获取当前路由信息的方式，$router 对象则是控制当前路由状态的方式。\n\n',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:35:19',0),(1773188556848717825,'Vue Router 路由有哪些模式？各模式有什么区别？','','[\'Vue\']','Vue Router 路由有三种模式：\n\n1）**hash 模式：** 使用 URL 中的 hash（即 # 后面的内容）来作为路由路径。这种模式下，页面不会重新加载，只会更新 hash 值，并触发路由变化，从而渲染对应的组件。\n\n2）**history 模式：** 使用 HTML5 中新增的 History API 来管理浏览历史记录，从而实现页面的前进和后退。在这种模式下，URL 中不会带有 # 号，而是使用真实的 URL 路径来作为路由路径。\n\n3）**abstract 模式：** 在不需要基于浏览器的 API 时，可以使用这种模式。在这种模式下，路由器并不会监听 URL 变化，而是通过调用 router.replace 或 router.push 来进行导航。\n\n区别：\n\n1）**hash 模式**可以兼容较老的浏览器，但 URL 中会带有 # 号。\n\n2）**history 模式**无需带有 # 号，更加美观，但需要后端支持，否则刷新页面会导致 404 错误。\n\n3）**abstract 模式**主要用于一些特定场景，例如在使用 Node.js 时，可以使用 abstract 模式来构建路由。\n\n一般来说，如果需要支持较老的浏览器，或者不需要后端支持，可以使用 hash 模式；否则建议使用 history 模式。',1,'2024-09-04 02:53:33','2024-09-04 02:53:33','2024-09-04 10:35:58',0),(1773189002707427330,'React 中的路由懒加载是什么？原理是什么？','','[\'React\']','React 中的路由懒加载指的是在使用 React Router 进行页面路由时，将页面组件按需加载，而不是一次性加载所有页面组件。这可以提高页面加载速度和性能，尤其在页面中有大量组件的情况下更为明显。\n\n路由懒加载的原理是基于 ES6 的动态 import 特性，通过在 Webpack 打包时使用 React.lazy() 和 Suspense 进行懒加载，当路由被匹配时才会加载对应的组件，而不是一次性加载所有路由组件，从而减少页面加载时间和网络带宽的消耗。\n\n下面是一个使用路由懒加载的例子：\n\n```\nimport React, { lazy, Suspense } from \'react\';\nimport { Route, Switch } from \'react-router-dom\';\n\nconst Home = lazy(() => import(\'./components/Home\'));\nconst About = lazy(() => import(\'./components/About\'));\nconst Contact = lazy(() => import(\'./components/Contact\'));\n\nfunction App() {\n  return (\n    <div>\n      <Suspense fallback={<div>Loading...</div>}>\n        <Switch>\n          <Route exact path=\"/\" component={Home} />\n          <Route path=\"/about\" component={About} />\n          <Route path=\"/contact\" component={Contact} />\n        </Switch>\n      </Suspense>\n    </div>\n  );\n}\n\nexport default App;\n\n```\n\n',1,'2024-09-04 02:53:34','2024-09-04 02:53:34','2024-09-04 10:36:38',0),(1773189173906333697,'你常用的 React Hooks 有哪些?','','[\'React\']','React Hooks 是 React 16.8.0 引入的一个新特性，它可以让我们在函数组件中使用 state、生命周期等特性，不再需要使用类组件。我常用的 React Hooks 包括：\n\n1. useState：用于在函数组件中使用 state，可以通过调用 useState 方法来设置初始值，返回一个数组，包含当前的 state 值和一个更新 state 值的函数。\n2. useEffect：用于在函数组件中使用生命周期，可以通过调用 useEffect 方法来实现 componentDidMount、componentDidUpdate 和 componentWillUnmount。\n3. useContext：用于在函数组件中使用 context，可以通过调用 useContext 方法来获取 context 的值。\n4. useRef：用于在函数组件中使用 ref，可以通过调用 useRef 方法来创建一个 ref 对象，可以用于获取组件的 DOM 元素或保存一个值，在组件重新渲染时不会改变。\n5. useMemo：用于在函数组件中使用记忆化计算，可以通过调用 useMemo 方法来缓存计算结果，避免重复计算。\n6. useCallback：用于在函数组件中使用记忆化函数，可以通过调用 useCallback 方法来缓存函数，避免重复创建函数。\n\n这些 Hooks 非常方便，能够大大简化我们编写 React 代码的过程，提高开发效率。\n\n> 鱼皮补充：这题可以结合自己的项目经验去说一说你在什么时候会用哪些 hooks？',1,'2024-09-04 02:53:34','2024-09-04 02:53:34','2024-09-04 10:37:18',0),(1773189888045309954,'React 组件间怎么进行通信？','','[\'React\']','React 组件间通信可以通过以下方式实现：\n\n1. Props 传递：父组件可以通过 Props 将数据传递给子组件，从而实现数据通信。\n2. Context：Context 是 React 提供的一种组件间通信的机制，可以通过 Context 在组件树中传递数据，避免 Props 层层传递的麻烦。\n3. Refs：Refs 允许我们直接操作组件实例或者 DOM 元素，从而实现组件间通信。\n4. 自定义事件：可以通过自定义事件的方式实现组件间的通信。在组件中定义一个事件，当需要在其他组件中触发这个事件时，可以通过回调函数的方式实现。\n5. 全局状态管理：使用全局状态管理工具（如 Redux、Mobx）来管理组件状态，从而实现组件间通信。\n\n需要根据实际场景选择适合的通信方式。\n\n> 鱼皮补充：这题还是挺重要的，因为组件通信是开发中的一个必备技能，建议大家把以上几种方式都实践一下',1,'2024-09-04 02:53:35','2024-09-04 02:53:35','2024-09-04 10:37:57',0),(1773190029888282626,'React.memo() 和 useMemo() 的用法是什么，有哪些区别？','','[\'React\']','**React.memo()** 和 **useMemo()** 是 **React** 中用于性能优化的两个钩子函数。\n\n**React.memo()** 是一个高阶组件，用于优化组件的性能。它会比较组件的新旧 props，如果 props 没有发生改变，则跳过渲染，直接使用上一次渲染的结果。使用 **React.memo()** 可以避免组件不必要的重新渲染，从而提高应用程序的性能。\n\n用法示例：\n\n```\nconst MemoizedComponent = React.memo(MyComponent);\n```\n\n**useMemo()** 是一个 Hook，用于缓存函数的计算结果。它可以缓存组件的 props 或其他数据的计算结果，只有当依赖项发生改变时才重新计算。\n\n用法示例：\n\n```\nconst memoizedValue = useMemo(() => computeExpensiveValue(a, b), [a, b]);\n```\n\n区别：\n\n- **React.memo()** 用于优化组件的性能，它会比较组件的新旧 props，如果 props 没有发生改变，则跳过渲染，直接使用上一次渲染的结果。而 useMemo() 用于缓存函数的计算结果，只有当依赖项发生改变时才重新计算。\n- **React.memo()** 是一个高阶组件，必须包裹组件才能使用，而 **useMemo()** 是一个 Hook，可以在函数组件中使用。\n  综上所述，**React.memo()** 用于缓存组件的渲染结果，从而提高应用程序的性能，而 **useMemo()** 则用于缓存函数的计算结果，可以在函数组件中使用。\n\n',1,'2024-09-04 02:53:35','2024-09-04 02:53:35','2024-09-04 10:38:36',0),(1773190315717517314,'说说你对 TypeScript 的理解？与 JavaScript 的区别？','','[\'TypeScript \']','TypeScript是一种开源的编程语言，它是JavaScript的一个超集，支持静态类型、类、接口等特性，并且在编译时进行类型检查。TypeScript的设计目标是提高代码的可维护性和可读性，并且可以在大型项目中提供更好的代码组织和重用。\n\n相比于JavaScript，TypeScript具有以下特点：\n\n- 支持类型：TypeScript支持静态类型，在编译时进行类型检查，能够在代码编写阶段发现类型错误，减少运行时错误。\n\n- 支持面向对象编程：TypeScript支持类、接口、泛型等面向对象编程特性，可以更好地组织代码和重用代码。\n\n- 支持ES6+特性：TypeScript支持ES6+的语法和特性，可以使用最新的语言特性来提高代码质量和可读性。\n\n- 更好的编辑器支持：TypeScript 提供了更好的编辑器支持，包括类型检查、代码补全、重构等功能，可以提高开发效率。\n\n- 更好的可维护性：TypeScript 的类型系统和面向对象特性可以提高代码的可维护性和可读性，使得代码更加易于维护和扩展。\n',1,'2024-09-04 02:53:35','2024-09-04 02:53:35','2024-09-04 10:39:16',0),(1773190556206325761,'TypeScript 的内置数据类型有哪些？','','[\'TypeScript \']','TypeScript 的内置数据类型包括：\n\n1. boolean：布尔类型，true 或 false。\n2. number：数值类型，包括整数和浮点数。\n3. string：字符串类型，表示文本。\n4. Array：数组类型，可以存储多个相同类型的值。\n5. Tuple：元组类型，可以存储多个不同类型的值，每个值的类型可以自定义。\n6. Enum：枚举类型，用于定义一些具有特定含义的常量。\n7. any：任意类型，表示不确定的数据类型。\n8. void：空类型，表示没有返回值。\n9. null 和 undefined：表示 null 和 undefined 值。\n10. never：表示永远不会返回的类型。',1,'2024-09-04 02:53:35','2024-09-04 02:53:35','2024-09-04 10:39:56',0),(1773190713916350465,'TypeScript 中的 Declare 关键字有什么用？','','[\'TypeScript \']','TypeScript 中的 declare 关键字用于声明一个变量、函数、类等的类型信息，但不实现其具体实现。它主要用于在编译时进行静态类型检查，并在编译后移除声明的代码，以减少 JavaScript 文件的大小。\n\n使用 declare 关键字声明的类型信息可以是任何类型，如对象、函数、类、变量、命名空间等。常见的使用场景有：\n\n声明全局变量或模块\n\n```\n// 声明全局变量\ndeclare const jQuery: (selector: string) => any;\n\n// 声明模块\ndeclare module \"lodash\" {\n  export function debounce(fn: Function, wait: number): Function;\n}\n```\n\n声明外部的 JavaScript 库\n\n```\ndeclare module \"some-library\" {\n  export function someFunction(): void;\n  export const someVariable: number;\n}\n```\n\n声明命名空间\n\n```\ndeclare namespace MyNamespace {\n  function myFunction(): void;\n}\n```\n\n通过使用 declare 关键字，可以让 TypeScript 在编译时检查代码的类型信息，并避免一些类型错误。同时，也可以提高代码的可读性和维护性。',1,'2024-09-04 02:53:35','2024-09-04 02:53:35','2024-09-04 10:40:37',0),(1773191686105686017,'什么是 TypeScript 中的命名空间和模块？两者有什么区别？','','[\'TypeScript \']','在 TypeScript 中，命名空间和模块都是用来组织和管理代码的方式。\n\n命名空间提供了一种将代码划分为逻辑单元的方式，可以避免命名冲突。在命名空间内，所有变量、函数、类等都是私有的，需要使用 export 关键字进行导出，才能被其他代码使用。例如：\n\n```\nnamespace MyNamespace {\n  export const PI = 3.14;\n  export function sayHello(name: string) {\n    console.log(`Hello, ${name}!`);\n  }\n  export class Person {\n    constructor(public name: string) {}\n  }\n}\n```\n\n模块是用来组织和管理代码的方式，与命名空间类似，不同之处在于模块是按文件划分的，一个文件就是一个模块。模块可以使用 export 和 import 关键字来导出和导入代码。例如：\n\n```\n// moduleA.ts\nexport const PI = 3.14;\nexport function sayHello(name: string) {\n  console.log(`Hello, ${name}!`);\n}\nexport class Person {\n  constructor(public name: string) {}\n}\n\n// moduleB.ts\nimport { PI, sayHello, Person } from \'./moduleA\';\nconsole.log(PI); // 3.14\nsayHello(\'world\'); // Hello, world!\nconst person = new Person(\'Alice\');\nconsole.log(person.name); // Alice\n```\n\n命名空间和模块的主要区别在于，命名空间是将代码划分为逻辑单元，而模块是按照文件划分的。在使用模块时，可以使用 import 和 export 进行代码的导入和导出，可以更方便地组织和管理代码。',1,'2024-09-04 02:53:35','2024-09-04 02:53:35','2024-09-04 10:41:17',0),(1773193712248119297,'说说你对Node.js 的理解？优缺点？应用场景？','','[\'Node.js \']','Node.js 是一个基于 Chrome V8 引擎的 JavaScript 运行环境，它允许开发者使用 JavaScript 进行服务器端编程。\n\nNode.js 拥有事件驱动、非阻塞I/O的特性，能够处理高并发的请求，因此它被广泛应用于实时应用、Web 应用和 API 的开发。\n\n以下是 Node.js 的优缺点：\n\n优点：\n\n- 事件驱动和非阻塞I/O的特性能够处理高并发的请求，提高了程序的性能和响应速度；\n- 使用 JavaScript 进行开发，具有丰富的开源模块和组件，可以大大提高开发效率；\n- 支持跨平台，可以在 Windows、Linux、MacOS 等多个操作系统上运行；\n- 可以进行快速原型开发和实时调试。\n\n缺点：\n\n- Node.js 对于计算密集型的任务和多线程编程支持不够好，适合于 I/O 密集型任务；\n- 因为 Node.js 是基于事件驱动和回调机制的，开发时需要特别注意回调地狱和异步操作的异常处理，否则容易导致代码难以维护。\n\nNode.js 的应用场景主要包括以下几个方面：\n\n- Web 开发：使用 Node.js 可以快速搭建 Web 服务器，进行 Web 开发；\n\n- 实时应用：Node.js 支持事件驱动和非阻塞I/O，可以用于实时数据传输和消息通信等领域；\n\n- 命令行工具：Node.js 可以用于编写命令行工具和脚本；\n\n- 微服务：Node.js 支持跨平台和轻量级开发，可以用于编写微服务。\n\n总之，Node.js 具有很多优点，如高并发处理能力、跨平台性、丰富的开源组件等，但也需要注意其局限性，开发者需要在实践中根据具体需求合理选用技术。\n\n鱼皮补充：这道题目面试官其实很想知道你是否用过 Node.js、用 Node.js 做过什么，以及前端同学经常用来拿 Node.js 做什么？（比如后端中间层）',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:41:55',0),(1773194297517105154,'什么是 Node.js 中的 process？它有哪些方法和应用场景？','','[\'Node.js \']','在 Node.js 中，process 是一个全局变量，它提供了与当前 Node.js 进程相关的信息和控制。process 对象是 EventEmitter 的一个实例，因此它可以使用 EventEmitter 的 API，例如注册事件监听器和触发事件。\n\nprocess 对象的一些常用方法和属性：\n\n- process.argv：返回一个数组，其中包含命令行参数。第一个元素是 Node.js 可执行文件的路径，第二个元素是正在执行的 JavaScript 文件的路径，后面的元素是命令行参数。\n- process.env：返回一个包含当前 Shell 环境变量的对象。\n- process.exit([code])：终止 Node.js 进程。如果指定了 code，那么进程将以 code 退出。\n- process.cwd()：返回当前工作目录的路径。\n- process.chdir(directory)：将 Node.js 进程的工作目录更改为 directory。\n- process.pid：返回 Node.js 进程的进程 ID。\n- process.nextTick(callback[, arg1][, arg2][, ...])：将 callback 添加到下一个 tick 队列。callback 会在当前操作完成后、事件循环继续之前调用。\n- process.on(event, listener)：注册事件监听器。常用的事件包括 \"exit\"、\"uncaughtException\"、\"SIGINT\" 等。\n\nprocess 对象的应用场景：\n\n- 监听进程退出事件，执行资源清理操作。\n- 通过 process.argv 读取命令行参数。\n- 通过 process.env 读取环境变量。\n- 通过 process.cwd 和 process.chdir 修改 Node.js 进程的工作目录。\n- 通过 process.pid 获取进程 ID。\n- 通过 process.nextTick 将某个操作放到下一个 tick 队列中，以实现异步执行。\n\n总之，process 对象提供了与 Node.js 进程相关的许多信息和控制，是 Node.js 编程中不可或缺的一部分。\n\n> 鱼皮补充：可以说下自己在项目中是如何用 process 的，比较常见的就是 process.env 读取环境变量',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:42:36',0),(1773194402945130497,'什么是 npm？你用过哪些 npm 包？是否开发过自己的 npm 包？','','[\'Node.js\']','npm（Node Package Manager）是一个基于 Node.js 的包管理器，用于管理 Node.js 项目中的依赖和包。npm 提供了一种简单、方便的方式来安装、更新和卸载第三方库和工具，同时还可以用于发布和共享自己开发的包。通过 npm，开发者可以轻松地引入各种库，提高开发效率。\n\n提供一些常见的 npm 包：\n\n1. express：一个简洁、灵活的 Node.js Web 应用框架，提供了一系列强大的功能来开发 Web 和 API 应用。\n2. react：一个用于构建用户界面的 JavaScrip t库，由 Facebook 开发，广泛应用于前端开发。\n3. lodash：一个强大的 JavaScript 实用库，提供了许多有用的工具函数，如数组操作、对象操作、函数操作等。\n4. axios：一个基于 Promise 的 HTTP 客户端库，用于浏览器和 Node.js，提供了简单、易用的 API 来发起 HTTP 请求。\n5. moment：一个用于解析、处理和显示日期和时间的 JavaScript 库，提供了丰富的 API 来处理各种日期和时间操作。\n6. nodemon：一个实用的开发工具，用于监视 Node.js 应用程序中的文件更改，并在发生更改时自动重启应用。\n\n开发自己的 npm 包的过程大致如下：\n\n1. 创建项目文件夹，并在文件夹中初始化 npm 项目，使用 npm init 命令生成 package.json 文件。\n2. 开发功能模块，确保遵循模块化的原则，编写模块的导出和引入。\n3. 编写详细的 README 文件，说明模块的用途、安装方法、使用方法以及 API 文档。\n4. 确保项目中包含.gitignore 和 .npmignore 文件，以排除不需要发布到 npm 的文件和文件夹。\n5. 在 npm 官网 https://www.npmjs.com/ 注册一个账号，然后在命令行中使用 npm login 命令登录。\n6. 使用 npm publish 命令发布包到 npm 仓库。\n\n发布后，其他开发者可以通过 npm install 命令安装和使用您的包。注意在开发过程中遵循语义化版本规范（Semantic Versioning），便于其他开发者理解版本变更。',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:43:16',0),(1773194512705871873,'什么是 Node.js 的事件循环机制？它是怎么实现的？','','[\'Node.js \']','Node.js 的事件循环（Event Loop）机制是 Node.js 中实现异步非阻塞I/O的核心。事件循环允许 Node.js 可以在单个线程中处理高并发的请求，提高了程序的性能和响应能力。\n\n事件循环是 Node.js 的运行机制，负责调度和处理各种事件（如I/O操作、定时器、网络请求等）。以下是事件循环的主要实现流程：\n\n1. Node.js 在启动时会初始化事件循环。\n2. 执行输入的脚本，可能会注册各种事件（如I/O操作、定时器等）。\n3. 事件循环开始运行，进入不同的阶段（Phases），如Timers、I/O callbacks、Idle/Prepare、Poll、Check和Close callbacks。每个阶段负责处理特定类型的事件。\n4. 当事件队列中的事件被处理完毕，事件循环会检查是否还有待处理的事件或回调。如果没有，事件循环结束，程序退出；否则，事件循环继续运行，处理新的事件。\n\nNode.js 的事件循环机制是基于 libuv 库实现的。libuv 是一个跨平台的异步I/O库，提供了事件循环、线程池等功能。Node.js 使用 libuv 来实现事件循环，处理各种异步操作，如文件I/O、网络请求、定时器等。\n\n值得注意的是，Node.js 的事件循环与浏览器的事件循环有一定的区别。虽然它们的核心概念相似，但在实现细节和运行环境上有所不同。在使用 Node.js 时，需要理解其事件循环的特点，以便更好地编写异步代码。\n\n',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:43:56',0),(1773194603890040833,'Node.js 有哪些全局对象？它们分别有什么作用？','','[\'Node.js \']','Node.js 中有一些全局对象，它们可以在任何模块中直接访问，无需进行导入。以下是一些常见的全局对象及其作用：\n\n1. global：它是 Node.js 的全局命名空间，类似于浏览器环境中的 window 对象。在 global 对象上定义的属性和方法可以在任何地方访问。然而，在实际开发中，应避免在 global 对象上添加属性，以防止全局命名空间污染。\n2. process：它是一个全局对象，提供了关于当前 Node.js 进程的信息和对其进行控制的方法。process 对象包含诸如环境变量、命令行参数、内存使用情况、当前工作目录等属性和方法。\n3. console：它是一个全局对象，提供了用于输出信息和调试的方法，如 console.log()、console.error()、console.warn() 等。\n4. setTimeout 和 clearTimeout：这两个方法用于设置和清除定时器。setTimeout 方法用于在指定的毫秒数后执行一个回调函数，clearTimeout 方法用于取消一个先前通过 setTimeout 设置的定时器。\n5. setInterval 和 clearInterval：这两个方法用于设置和清除周期性定时器。setInterval 方法用于每隔指定的毫秒数执行一个回调函数，clearInterval 方法用于取消一个先前通过 setInterval 设置的定时器。\n6. setImmediate 和 clearImmediate：这两个方法用于在当前事件循环结束时执行一个回调函数。setImmediate 方法会将回调函数添加到事件循环的队列末尾，以便在当前事件循环的所有 I/O 事件和定时器事件处理完毕后执行。clearImmediate 方法用于取消一个先前通过 setImmediate 设置的回调函数。\n7. Buffer：它是一个全局的构造函数，用于处理二进制数据，如文件 I/O、网络 I/O 等。Buffer 提供了一系列方法来创建和操作字节缓冲区。\n8. require 和 module：require 是一个全局函数，用于导入其他模块。module 是一个全局对象，表示当前模块。每个 Node.js 文件都是一个模块，模块可以导出函数、对象或值，以便其他模块使用。\n\n注意，虽然这些对象在全局范围内可用，但它们并非严格意义上的全局变量。在 Node.js 模块中，它们是模块作用域内的变量，这意味着在一个模块中定义的变量不会自动成为全局变量。',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:44:34',0),(1773194726594404354,'怎么调试 Node.js 程序？','','[\'Node.js \']','调试 Node.js 程序有多种方法，以下是一些常见的调试技巧和工具：\n\n使用 console.log()：在代码中添加 console.log() 语句，输出变量值、函数执行情况等，以便了解程序运行状态。这是最基本的调试手段，适用于简单的问题排查。\n\n使用内置调试器：Node.js 提供了一个内置的命令行调试器。要使用它，只需在启动脚本时在命令行中添加 inspect 或 inspect-brk 标志，例如：\n\n```\nnode inspect app.js\n```\n\n或\n\n```\nnode --inspect-brk app.js\n```\n\n这将启动一个调试会话。你可以在代码中添加 debugger; 语句，作为断点。调试器将在遇到断点时暂停执行。\n\n使用 Chrome DevTools：你可以使用 Chrome DevTools 来调试 Node.js 程序。首先，使用 inspect 或 inspect-brk 标志启动 Node.js 应用，然后打开 Chrome 浏览器，输入 chrome://inspect，在 \"Devices\" 下找到你的 Node.js 应用，并点击 \"inspect\"。这将打开一个 DevTools 实例，你可以像调试浏览器中的 JavaScript 代码一样调试 Node.js 代码。\n\n使用 Visual Studio Code：Visual Studio Code 是一个流行的开源代码编辑器，内置了对 Node.js 的调试支持。要在 VSCode 中调试 Node.js 应用，需要创建一个名为 .vscode/launch.json 的配置文件，配置调试参数。以下是一个简单的配置示例：\n\n```\n{\n    \"version\": \"0.2.0\",\n    \"configurations\": [\n        {\n            \"type\": \"node\",\n            \"request\": \"launch\",\n            \"name\": \"Launch Program\",\n            \"program\": \"${workspaceFolder}/app.js\"\n        }\n    ]\n}\n```\n\n然后，按下 F5 或点击左侧 \"Run and Debug\" 选项卡上的 \"Run\" 按钮开始调试。你可以在代码中添加断点、查看变量值、使用控制台等。\n\n使用其他 IDE 和编辑器：许多其他 IDE 和代码编辑器也提供了 Node.js 调试支持，如 WebStorm、Atom 等。具体操作方法因工具而异，请参考相应工具的文档。\n\n选择合适的调试工具和方法可以帮助你更高效地找到和解决 Node.js 程序中的问题。',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:45:14',0),(1773194928780828673,'介绍下从 HTTP/1.0、HTTP/1.1 到 HTTP/2 再到 HTTP/3 的演化过程，各个阶段相对前一阶段做了哪些优化？','','[\'计算机网络 \']','**HTTP/1.0、HTTP/1.1 到 HTTP/2 再到 HTTP/3 的演化**过程主要是为了解决 HTTP 协议在网络传输过程中出现的一些问题，提高网络传输效率和性能。\n\n**HTTP/1.0** 是最早的 HTTP 协议，它使用一条**长连接**（keep-alive）传输一个请求和响应，存在以下问题：\n\n- **队头阻塞问题**：因为只有一个连接，所以如果有一个请求被阻塞，后续请求也会被阻塞。\n- **无法多路复用**：只能按顺序传输一个请求和响应，无法同时传输多个请求和响应。\n- **每次请求需要新建连接**：每次请求都需要新建连接，连接的建立和关闭过程会消耗时间。\n\n**HTTP/1.1** 引入了以下优化：\n\n- **持久连接**：即**连接重用**，通过一个 TCP 连接传输多个请求和响应，减少了连接建立和关闭的时间。\n- **分块传输编码**（chunked）：把响应数据分成多个块，每个块前面加上长度信息，便于客户端逐步接收。\n- **虚拟主机**（Virtual Host）：通过在请求头中添加 **Host** 字段来区分不同的主机。\n\n**HTTP/2** 引入了以下优化：\n\n- **多路复用**：允许同时通过**同一个连接并行传输多个请求和响应**，解决了**队头阻塞**问题。\n- **二进制分帧**：将传输的数据分成一个个**二进制帧**，每个帧都有自己的 ID，可以**独立传输**，解决了**队头阻塞**问题，提高了传输效率。\n- 头部压缩：使用 HPACK 算法对头部信息进行压缩，减少了头部信息的传输量。\n\n**HTTP/3** 引入了以下优化：\n\n- **QUIC 协议**：使用 QUIC 协议替代 TCP，支持更快的连接建立和更快的重传，能够解决 **TCP 队头阻塞**和 **TCP 握手延迟**的问题。\n- **数据流分离**：将一个连接分成多个数据流，每个数据流都有独立的 ID，可以独立控制和传输数据。\n\n总的来说，HTTP/1.0、HTTP/1.1 到 HTTP/2 再到 HTTP/3 的演化过程主要是从**连接**的角度进行了优化，提高了**并发能力和传输效率**，提高了**用户体验**。\n\n> 鱼皮补充：这题还蛮重要的，建议大家学习一下，面试的时候很容易被问到：HTTP/2 为什么快之类的问题',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:45:54',0),(1773195229889912833,'DNS HTTP 缓存有哪些实现方式？什么是协商缓存和强制缓存？','','[\'计算机网络 \']','**HTTP 缓存**可以通过以下几种方式进行实现：\n\n1. **浏览器缓存**：浏览器可以将最近请求过的资源保存到本地，下次请求时可以直接从本地读取，从而提高访问速度。\n2. **代理缓存**：代理服务器可以缓存响应，减少对原始服务器的请求次数，从而加快响应速度。\n3. **网关缓存**：网关可以缓存来自多个原始服务器的响应，然后将响应发送到客户端，从而提高性能。\n\nHTTP 缓存可以分为**协商缓存**和**强制缓存**两种类型。\n\n强制缓存是指浏览器在请求资源时，不会发送任何请求头，直接从本地缓存中读取资源，从而提高响应速度。常见的实现方式包括：\n\n1. Expires 头部：指定资源过期的时间，如果在过期时间之前再次请求该资源，浏览器将直接从缓存中读取资源。\n2. Cache-Control 头部：可以指定资源的缓存策略，包括 public、private、no-cache 等，控制浏览器的缓存行为。\n\n**协商缓存**是指浏览器在请求资源时，会发送一些**请求头**到服务器，**询问服务器资源是否已经发生改变**。如果资源未发生改变，服务器将返回 **304 状态码**，告诉浏览器可以从缓存中读取资源，从而减少了网络带宽的使用。常见的实现方式包括：\n\n1. **Last-Modified / If-Modified-Since 头部**：浏览器在请求资源时，会将资源最后修改时间（Last-Modified）发送到服务器，服务器检查资源是否发生变化，如果没有发生变化，返回 304 状态码，否则返回新的资源。\n2. **ETag / If-None-Match 头部**：服务器可以给每个资源分配一个唯一的标识符（ETag），浏览器在请求资源时，将该标识符发送到服务器，服务器检查资源是否发生变化，如果没有发生变化，返回 304 状态码，否则返回新的资源。\n\n需要注意的是，**协商缓存**虽然可以**减少网络带宽的使用**，但是需要服务器进行资源比较，因此会**增加服务器的负载**。',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:46:35',0),(1773195324832178178,'简述 TCP/IP 网络模型，分为几层？每层的职责和作用是什么？','','[\'计算机网络 \']','TCP/IP 网络模型（也称为互联网协议套件）是一种用于描述网络通信的概念模型。它分为四层，每层都有特定的职责和作用，它们分别是：\n\n1. **应用层（Application Layer）**：应用层负责处理与应用程序的通信和数据传输。它包括各种应用层协议，例如 HTTP、HTTPS、FTP、SMTP、IMAP、POP3、DNS 等。这些协议定义了客户端和服务器之间如何互相发送和接收数据。应用层的主要职责是为应用程序提供用户接口、数据传输以及数据封装和解封装。\n2. **传输层（Transport Layer）**：传输层主要负责在网络中进行端到端的可靠数据传输。它提供了两种主要的传输协议：TCP（传输控制协议）和 UDP（用户数据报协议）。TCP 提供了可靠、面向连接的数据传输，它可以确保数据在传输过程中不会丢失、重复或乱序。UDP 提供了不可靠、无连接的数据传输，它不能保证数据的传输质量，但传输速度更快，适用于实时通信等场景。\n3. **网络层（Internet Layer）**：网络层负责在不同网络之间进行数据包的路由和传输。它使用 IP（互联网协议）进行寻址和路由，将数据包从源主机传输到目的主机。网络层的主要职责包括：IP 地址分配、路由选择、分片和重组以及错误检测和处理。除了 IP 协议，网络层还包括其他协议，如 ICMP（互联网控制消息协议）和 IGMP（互联网组管理协议）。\n4. **链路层（Link Layer）**：链路层（又称网络接口层或数据链路层）负责在同一网络中进行数据帧的发送和接收。链路层的协议因网络硬件而异，如 Ethernet、Wi-Fi、PPP 等。链路层的主要职责包括：物理寻址、数据帧封装和解封装、差错检测、流量控制以及链路管理。\n\n总的来说，TCP/IP 网络模型将网络通信划分为四个层次，每层都有自己的职责和功能。这种分层模型有助于降低网络系统的复杂性，便于设计、实现和维护网络协议和设备。',1,'2024-09-04 02:53:36','2024-09-04 02:53:36','2024-09-04 10:47:14',0),(1773195648028467201,'什么是 webpack？它有什么作用？','','[\'打包工具 \']','Webpack 是一个开源的前端打包工具，它主要用于将多个 JavaScript 文件打包成一个或多个文件，以便在浏览器中加载。Webpack 的核心功能是对模块进行打包，并支持多种资源的加载和打包，如 JavaScript、CSS、图片、字体等。\n\nWebpack 的主要作用包括：\n\n1. **模块化**：Webpack 支持各种模块化规范，包括 ES6、CommonJS、AMD 等，可以将应用程序拆分为多个模块，方便管理和维护。\n2. **资源加载**：Webpack 可以处理各种类型的文件，包括 JavaScript、CSS、图片、字体等，可以将这些文件作为模块进行加载和打包。块热替换，可以在开发过程中快速预览应用程序的变化，提高开发效率。\n6. **优化打包速度**：Webpack 可以使用多线程打包、缓存等技术，优化打包速度。\n\n需要注意的是，Webpack 本身只是一个打包工具，对于项目的构建和管理，通常需要结合其他工具和插件一起使用，如 Babel、ESLint、PostCSS、Vue Loader 等。同时，Webpack 的配置也比较复杂，需要一定的学习成本。但是一旦熟练掌握，Webpack 可以大大提高项目的可维护性和开发效率。\n',1,'2024-09-04 02:53:37','2024-09-04 02:53:37','2024-09-04 10:47:55',0),(1773195801124757506,'如何提高 webpack 的打包速度？','','[\'打包工具 \']','Webpack 的打包速度受多个因素影响，以下是一些提高打包速度的方法：\n\n1. 升级 webpack 版本：Webpack 不断更新优化打包速度，升级到最新版本可以获得更好的性能。\n2. 使用更快的文件系统：使用更快的文件系统（如 RAM 磁盘）可以提高读写速度，加快 webpack 打包速度。\n3. 减少文件搜索范围：在 Webpack 的配置中指定更少的文件搜索路径，可以减少文件搜索的范围，提高打包速度。\n4. 使用 loader 缓存：Webpack 的 loader 会缓存处理后的结果，加快下次打包的速度。可以使用 cache-loader 和 hard-source-webpack-plugin 等插件来进一步优化 loader 的缓存。\n5. 拆分代码块：将代码拆分为更小的代码块，可以减少打包时间。可以使用 Webpack 的 code splitting 功能或手动将代码拆分为多个文件。\n6. 避免不必要的插件和 loader：减少不必要的插件和 loader 可以减少打包时间。\n7. 使用 Happypack：Happypack 可以将 Webpack 的 loader 转换为多线程模式，加快打包速度。\n8. 启用 Tree Shaking：Tree Shaking 可以排除未使用的代码，减少打包大小，加快打包速度。\n\n总之，提高 webpack 打包速度需要从多个方面综合考虑，需要不断进行尝试和优化。\n\n> 鱼皮补充：这题建议大家自己尝试一下，学好打包工具可以让你的前端水平上升一个档次，不再是像我一样的页面仔\n\n',1,'2024-09-04 02:53:37','2024-09-04 02:53:37','2024-09-04 10:48:34',0),(1773195913582436353,'什么是 webpack 的热更新？它的实现原理是什么？','','[\'打包工具 \']','webpack 的热更新（Hot Module Replacement，简称 HMR）是一种开发时提高开发效率的技术，可以实现无需刷新页面即可看到代码修改后的效果。在使用 HMR 后，当修改了代码后，webpack 只会重新编译修改的代码，并将新的模块发送到客户端，替换掉旧的模块，从而达到实时更新页面的目的。\n\n实现 HMR 的关键是在客户端和服务器端之间建立一个 WebSocket 连接，当代码发生变化时，服务器端会将新的模块发送给客户端，客户端接收到新的模块后会用新模块替换旧模块，从而实现实时更新。\n\n具体来说，webpack HMR 主要分为以下几个步骤：\n\n1. 启动 webpack-dev-server，配置 HMR 插件\n2. 当代码变化时，webpack-dev-server 会编译出新的模块\n3. HMR runtime（客户端运行时）会通过 WebSocket 与服务器通信，获取最新的模块\n4. 当 HMR runtime 接收到新模块时，会将新模块加载到浏览器中，并通过模块热替换算法将新模块与旧模块进行比较，只替换有变化的模块部分\n5. 页面更新完成，无需刷新页面即可看到最新的效果。\n\n总之，HMR 可以大大提高开发效率，同时也能够减少代码变更时的刷新操作，提高开发体验。',1,'2024-09-04 02:53:37','2024-09-04 02:53:37','2024-09-04 10:49:13',0),(1773196032763584513,'什么是前后端分离？它有什么优点和缺点？','','[\'前端工程化\']','前后端分离是指将前端和后端分别进行独立开发和部署。使前端和后端分别由不同的开发团队负责，通过 API 接口进行数据交互。前端负责页面展示和用户交互，后端负责业务逻辑和数据存储，两者通过 API 进行通信。\n\n前后端分离的优点包括：\n\n1. 分工明确：前端和后端分别由不同的开发团队负责，各司其职，有利于开发流程的管理和控制。\n2. 前后端解耦：前后端分离可以使前端和后端解耦，前端只关注页面展示和用户交互，后端只关注业务逻辑和数据存储，有利于模块化开发和维护。\n3. 更好的性能和用户体验：前后端分离可以使前端采用现代化的前端框架和技术，提高网站的性能和用户体验。\n4. 更好的可扩展性：前后端分离可以使后端提供更丰富的 API，方便前端进行开发和维护，同时也使得后端更易于扩展和修改。\n\n前后端分离的缺点包括：\n\n1. 开发难度增加：前后端分离需要前端和后端分别进行开发，需要更多的协调和沟通，开发难度增加。\n2. 维护难度增加：前后端分离使得前端和后端的代码分离，需要分别进行维护，维护难度增加。\n3. 安全问题：前后端分离可能会导致一些安全问题，例如跨站点脚本攻击（XSS）和跨站点请求伪造（CSRF），需要采取相应的安全措施来解决。  \n\n总之，前后端分离有其优点和缺点。前后端分离可以提高开发效率、网站性能和用户体验，但也可能会增加开发和维护的难度，需要采取相应的措施来解决。',1,'2024-09-04 02:53:37','2024-09-04 02:53:37','2024-09-04 10:49:51',0),(1773196133829533697,'你用过哪些包管理工具？它们各有什么特点？','','[\'前端工程化\']','前端常见的包管理工具包括 npm、Yarn 和 PNPM，它们各有不同的特点：\n\n1. npm：npm 是 Node.js 自带的包管理工具，也是前端开发中最常用的包管理工具之一。它是一个基于命令行的工具，可以方便地安装、管理和升级依赖包。npm 拥有丰富的开源包，使用方便，但可能会出现包冲突等问题。\n2. Yarn：Yarn 是 Facebook 开源的包管理工具，它是为了解决 npm 在包安装速度和版本管理上的一些问题而开发的。Yarn 支持离线安装、并行下载等特性，可以提高包安装的速度和可靠性。与 npm 相比，Yarn 具有更好的性能和稳定性，但是可能会出现版本冲突的问题。\n3. PNPM：PNPM 是另一种基于命令行的包管理工具，它也可以用于安装和管理依赖包。与 npm 和 Yarn 不同的是，PNPM 支持重用已安装的包，减少了重复下载包的问题，从而提高了安装速度和减少了磁盘空间占用。PNPM 支持锁定版本、并行安装、缓存依赖等特性，但可能需要更多的学习成本。\n\n综上所述，npm、Yarn 和 PNPM 都是可靠的包管理工具，使用场景和需求不同可以选择不同的工具。一般来说，对于小型项目或初学者，使用 npm 即可；对于大型项目或需要更好的性能和可靠性的项目，可以考虑使用 Yarn 或 PNPM。\n\n',1,'2024-09-04 02:53:37','2024-09-04 02:53:37','2024-09-04 10:50:29',0),(1773196217493315585,'什么是 CSS 工程化？你用过哪些相关的工具？','','[\'前端工程化\']','CSS 工程化是指将 CSS 在项目中进行模块化、组件化、可维护性、可重用性等方面的处理，以达到工程化管理 CSS 的目的。\n\n在 CSS 工程化中，通常会使用一些相关的工具来辅助管理 CSS，常用的工具包括：\n\n1. CSS 预处理器：如 Sass、Less、Stylus 等，可以通过变量、函数、混合等方式，提高 CSS 的可维护性和可重用性。\n2. CSS 后处理器：如 PostCSS，可以用来处理 CSS 代码，通过插件的形式可以实现一些自动化处理，如自动添加前缀、压缩 CSS 等。\n3. CSS 模块化工具：如 CSS Modules、styled-components 等，可以将 CSS 样式与组件代码结合在一起，提高 CSS 的可维护性和可重用性。\n4. CSS 命名规范：如 BEM、SMACSS、OOCSS 等，可以通过规范化 CSS 的命名方式，提高 CSS 的可读性和可维护性。\n\n通过使用这些工具，可以提高 CSS 的可维护性、可重用性和可读性，从而使得前端开发更加高效、简洁。\n\n> 鱼皮补充：建议大家实践一下上面提到的技术，最少掌握一个 CSS 预处理器。',1,'2024-09-04 02:53:38','2024-09-04 02:53:38','2024-09-04 10:51:09',0),(1773196336183730177,'说说常规的前端性能优化手段','','[\'性能优化 \']','前端性能优化是一个重要的工作，可以有效地提升用户的体验和网站的访问速度。以下是一些常规的前端性能优化手段：\n\n- 减少 HTTP 请求：合并文件、使用 CSS 精灵、减小图片大小等。\n- 压缩文件：使用压缩工具压缩 HTML、CSS、JavaScript、图片等文件大小。\n- 缓存：使用缓存来减少网络请求。\n- 懒加载：图片或者资源在真正需要的时候再加载，可以有效减少页面加载时间。\n- 静态资源 CDN 加速：利用 CDN 分发静态资源，减少服务器压力，提高网站的访问速度。\n- 减少 DOM 操作：DOM 操作是很耗费性能的，所以要尽量减少 DOM 操作的次数，尽量使用批量操作。\n- 使用 CSS3 动画：使用 CSS3 动画而不是 JavaScript 动画，因为 CSS3 动画的性能更优。\n- 使用字体图标：使用字体图标可以减少图片的请求，提高页面性能。\n- 去除不必要的插件：移除不必要的插件可以提高页面加载速度，减少不必要的代码。\n- 图片优化：对图片进行压缩和优化，减少图片的大小和请求次数。\n\n以上是一些常规的前端性能优化手段，可以根据实际项目情况选择适合的优化手段来提高页面性能。\n\n> 鱼皮补充：建议大家在上线网站后，可以尝试一下性能优化，并且学习下网站性能的分析工具的用法，得到明确的性能优化数据，比如网页首屏渲染时间由 2 s 优化为 1.1 s',1,'2024-09-04 02:53:38','2024-09-04 02:53:38','2024-09-04 10:51:47',0),(1773196512143171585,'前端性能优化指标有哪些？怎么进行性能检测？','','[\'性能优化 \']','前端性能优化主要是通过一系列技术手段和优化策略来提升网站或应用的性能，从而提高用户的体验。下面列举一些常见的前端性能优化的指标和性能检测的方法：\n\n1. 加载速度：网站或应用的加载速度是用户体验的重要因素。可以使用工具（如 WebPagetest、PageSpeed Insights）来测试网站或应用的加载速度，并通过优化图片大小、减少 HTTP 请求、使用浏览器缓存等方式来提升加载速度。\n2. 渲染速度：渲染速度是指页面加载完成后页面内容渲染的速度。可以使用 Chrome 开发者工具中的 Performance 面板来检测页面渲染速度，并通过减少 DOM 操作、使用 CSS3 动画、减少 JavaScript 的执行时间等方式来提升渲染速度。\n3. 响应速度：响应速度是指网站或应用处理请求的速度。可以使用工具（如 Pingdom、GTmetrix）来测试响应速度，并通过优化服务器响应时间、压缩 JavaScript 和 CSS 文件等方式来提升响应速度。\n4. 可访问性：可访问性是指网站或应用是否易于使用和访问。可以通过使用 HTML5、WAI-ARIA 标准、有意义的网页标题、有意义的链接等方式来提高可访问性。\n5. 移动端性能：随着移动设备的普及，移动端性能越来越重要。可以使用工具（如 Google Mobile-Friendly Test）来测试移动端性能，并通过使用响应式设计、优化图片和视频大小、使用 viewport meta 标签等方式来提高移动端性能。\n\n总结：前端性能优化指标包括加载速度、渲染速度、响应速度、可访问性和移动端性能等方面。可以使用各种工具来检测这些指标，并采取相应的优化策略来提高网站或应用的性能。',1,'2024-09-04 02:53:38','2024-09-04 02:53:38','2024-09-04 10:52:28',0),(1773196628728045570,'DNS 预解析是什么？怎么实现？','','[\'性能优化 \']','DNS 预解析（DNS Prefetching）是一种网络性能优化技术，用于提前解析用户可能访问的域名，以减少实际请求时的 DNS 解析时间。通过预解析，浏览器可以在用户实际访问一个链接之前就已经获取到对应的IP地址，从而降低网络延迟，加快页面加载速度。\n\nDNS 预解析主要有两种实现方式：\n\n自动预解析：现代浏览器通常会自动进行 DNS 预解析。浏览器会根据用户的浏览历史和页面内容分析可能需要预解析的域名，然后在后台进行 DNS 解析。这种方式无需开发者进行任何操作，浏览器会自动进行预解析。\n\n手动预解析：开发者可以通过在 HTML 文档中添加标签来手动指定需要进行预解析的域名。这种方式可以让开发者更精确地控制哪些域名需要进行预解析。示例如下：\n\n```\n<head>\n  ...\n  <link rel=\"dns-prefetch\" href=\"//example.com\">\n  <link rel=\"dns-prefetch\" href=\"//cdn.example.com\">\n  ...\n</head>\n```\n\n在这个示例中，使用标签并设置 rel 属性为 dns-prefetch，将 href 属性设置为需要预解析的域名。注意，域名前需要加上//，表示使用当前页面的协议（HTTP 或 HTTPS）。\n\n使用DNS预解析可以在一定程度上提高网页的加载速度和用户体验，但需要注意的是，过多的预解析可能会消耗用户的网络资源和带宽。因此，在实际应用中，应该根据实际需求合理地使用 DNS 预解析。',1,'2024-09-04 02:53:39','2024-09-04 02:53:39','2024-09-04 10:53:08',0),(1773196729504587777,'怎么进行站点内的图片性能优化？','','[\'性能优化 \']','站点内的图片性能优化可以从以下几个方面入手：\n\n1. **图片压缩**：通过压缩图片的大小和质量，可以减少图片的加载时间。可以使用图片压缩工具（如 TinyPNG、JPEGmini 等）来压缩图片。\n2. **图片格式优化**：选择正确的图片格式可以减少图片的大小。常见的图片格式有 JPEG、PNG 和 GIF，可以根据图片的特点和用途选择合适的格式。\n   延迟加载：对于页面中的长列表或懒加载场景，可以延迟加载图片，减少页面加载时间。可以使用工具（如 lazysizes、Lozad.js 等）来实现图片的延迟加载。\n   3.**图片预加载**：在用户访问页面之前，可以预加载一些重要的图片，从而提高用户体验。可以使用工具（如 PreloadJS、image-preload 等）来实现图片的预加载。\n3. **响应式图片**：对于不同大小的屏幕，可以使用不同大小的图片来提高用户体验。可以使用 HTML 标签的 srcset 和 sizes 属性来实现响应式图片。\n   5.**CDN 加速**：使用 CDN 可以加速图片的加载速度，缩短图片的响应时间。可以选择静态文件托管服务商（如七牛云、阿里云等）来实现 CDN 加速。\n4. **图片懒加载**：对于网页中需要加载大量图片的场景，可以使用图片懒加载技术，即当页面滚动到某个区域时再加载该区域内的图片，从而减少页面加载时间和网络带宽的消耗。可以使用工具（如 lazyload、intersection-observer 等）来实现图片懒加载。\n\n需要注意的是，以上优化策略都是针对特定场景和需求进行优化的，需要根据实际情况选择合适的优化策略。同时，在进行图片优化时，需要保证图片质量和用户体验，并注意不要过度压缩图片，影响用户体验。\n\n总结一下：减少传输时间（减小图片尺寸、网络优化），按需传图（懒加载、延迟加载、响应式）',1,'2024-09-04 02:53:39','2024-09-04 02:53:39','2024-09-04 10:53:46',0),(1773196823259865089,'SPA（单页应用）首屏加载速度慢怎么解决？',NULL,NULL,NULL,1,'2024-09-04 02:53:39','2024-09-04 02:53:39','2024-09-04 02:53:39',0),(1773197768555323394,'git stash 命令有什么作用？什么时候适合用它？',NULL,NULL,NULL,1,'2024-09-04 02:53:39','2024-09-04 02:53:39','2024-09-04 02:53:39',0),(1773197918069678081,'git pull 和 git fetch 命令分别有什么作用？二者有什么区别？',NULL,NULL,NULL,1,'2024-09-04 02:53:39','2024-09-04 02:53:39','2024-09-04 02:53:39',0),(1773229102262738946,'什么是低代码？你用过哪些低代码工具？',NULL,NULL,NULL,1,'2024-09-04 02:53:39','2024-09-04 02:53:39','2024-09-04 02:53:39',0),(1773229211906039810,'什么是前端跨平台？你用过哪些跨平台框架？',NULL,NULL,NULL,1,'2024-09-04 02:53:39','2024-09-04 02:53:39','2024-09-04 02:53:39',0),(1773281285528182786,'什么是 Docker？为什么要在项目中用到 Docker？以及你在项目中是如何使用 Docker 的？',NULL,NULL,NULL,1,'2024-09-04 02:21:23','2024-09-04 02:21:23','2024-09-04 02:21:23',0),(17732814