．管理计算机系统资源是操作系统关心的主要问题\nA I、Ⅲ\nB Ⅱ、Ⅲ\nC I、Ⅱ、Ⅲ、IV\nD 以上答案都正确',NULL,NULL,NULL,1,'2024-09-04 03:07:07','2024-09-04 03:07:07','2024-09-04 03:07:07',0),(1806351061272731650,'下列说法中，正确的是（ ）。\nⅠ. 批处理的主要缺点是需要大量内存\nⅡ.当计算机提供了核心态和用户态时，输入/输出指令必须在核心态下执行\nⅢ. 操作系统中采用多道程序设计技术的最主要原因是提高CPU和外部设备的可靠性\nⅣ．操作系统中，通道技术是一种硬件技术\nA I、Ⅱ\nB I、Ⅲ\nC Ⅱ、IV\nD Ⅱ、Ⅲ、IV',NULL,NULL,NULL,1,'2024-09-04 03:07:07','2024-09-04 03:07:07','2024-09-04 03:07:07',0),(1806675122867642370,'下列关于系统调用的说法中，正确的是（ ）。\nⅠ. 用户程序设计时，使用系统调用命令，该命令经过编译后，形成若干参数和陷入（trap）指令\nⅡ. 用户程序设计时，使用系统调用命令，该命令经过编译后，形成若干参数和屏蔽中断指令\nⅢ．系统调用功能是操作系统向用户程序提供的接口\nⅣ. 用户及其应用程序和应用系统是通过系统调用提供的支持和服务来使用系统资源完成其操作的\nA I、Ⅲ\nB Ⅱ、IV\nC I、Ⅲ、IV\nD Ⅱ、Ⅲ、IV',NULL,NULL,NULL,1,'2024-09-04 03:07:07','2024-09-04 03:07:07','2024-09-04 03:07:07',0),(1806676236711206913,'（ ）是操作系统必须提供的功能。\nA 图形用户界面(GUI)\nB 为进程提供系统调用命令\nC 中断处理\nD 编译源程序',NULL,NULL,NULL,1,'2024-09-04 03:07:07','2024-09-04 03:07:07','2024-09-04 03:07:07',0),(1806676887621050369,'用户程序在用户态下要使用特权指令引起的中断属于（ ）。\nA 硬件故障中断\nB 程序中断\nC 外部中断\nD 访管中断',NULL,NULL,NULL,1,'2024-09-04 03:07:07','2024-09-04 03:07:07','2024-09-04 03:07:07',0),(1806677191435460610,'处理器执行的指令被分为两类，其中有一类称为特权指令，它只允许（ ）使用。\nA 操作员\nB 联机用户\nC 目标程序\nD 操作系统',NULL,NULL,NULL,1,'2024-09-04 03:07:07','2024-09-04 03:07:07','2024-09-04 03:07:07',0),(1806678435214368770,'下列操作系统的各个功能组成部分中，（ ）可不需要硬件的支持。\nA 进程调度\nB 时钟管理\nC 地址映射\nD 中断系统',NULL,NULL,NULL,1,'2024-09-04 03:07:07','2024-09-04 03:07:07','2024-09-04 03:07:07',0),(1806679608977760258,'在中断发生后，进入中断处理的程序属于（ ）。\nA 用户程序\nB 可能是用户程序，也可能是OS程序\nC 操作系统程序\nD 单独的程序，即不是用户程序也不是OS程序',NULL,NULL,NULL,1,'2024-09-04 03:07:08','2024-09-04 03:07:08','2024-09-04 03:07:08',0),(1806680740781334529,'计算机区分核心态和用户态指令后，从核心态到用户态的转换是由操作系统程序执行后完成的，而用户态到核心态的转换则是由（ ）完成的。\nA 硬件\nB 核心态程序\nC 用户程序\nD 中断处理程序',NULL,NULL,NULL,1,'2024-09-04 03:07:08','2024-09-04 03:07:08','2024-09-04 03:07:08',0),(1806680993576230913,'在操作系统中，只能在核心态下运行的指令是（ ）。\nA 读时钟指令\nB 置时钟指令\nC 取数指令\nD 寄存器清零',NULL,NULL,NULL,1,'2024-09-04 03:07:08','2024-09-04 03:07:08','2024-09-04 0