.cn/course','[\'Java\', \'后端\', \'前端\', \'项目\']','https://pic.code-nav.cn/mianshiya/question_picture/1772087337535152129/u=3918670210,26098367&fm=253&fmt=auto&app=138&f=JPEG.webp',1,'2024-09-03 15:12:16','2024-09-03 15:12:16','2024-09-03 15:12:16',0),(1773175672114601986,'前端经典面试题合集','前端经典求职八股文合集','[\'前端\']','https://pic.code-nav.cn/mianshiya/question_picture/1772087337535152129/下载.jpeg',1,'2024-09-03 15:12:16','2024-09-03 15:12:16','2024-09-03 15:12:16',0),(1773267946995539969,'OJ 判题项目面试题','编程导航的 OJ 判题项目，基于 Vue 3 + Spring Boot + Spring Cloud 微服务 + Docker 的编程题目在线评测系统。系统学习并实践前后端模板开发 + 多种设计模式 + 单体项目微服务改造 + Linux 虚拟机远程开发 + Docker 代码沙箱 + Java 安全控制。项目教程请见：https://www.code-nav.cn/course','[\'Java\', \'后端\', \'前端\', \'项目\']','https://pic.code-nav.cn/mianshiya/question_picture/1772087337535152129/u=567457580,2545971552&fm=253&fmt=auto&app=138&f=JPEG.webp',1,'2024-09-03 15:12:16','2024-09-03 15:12:16','2024-09-03 15:12:16',0),(1773293162043891714,'手写 RPC 框架项目面试题','编程导航的手写 RPC 项目，基于 Java + Etcd + Vert.x 的高性能 RPC 框架，用新颖的技术栈从 0 到 1 带大家开发轮子。学习并实践基于 Vert.x 的网络服务器、序列化器、基于 Etcd 和 ZooKeeper 的注册中心、反射、动态代理、自定义网络协议、多种设计模式、负载均衡器设计、重试和容错机制、Spring Boot Starter 注解驱动开发等。项目教程请见：https://www.code-nav.cn/course','[\'Java\', \'后端\', \'项目\']','https://pic.code-nav.cn/mianshiya/question_picture/1772087337535152129/u=1129400581,3683256909&fm=253&fmt=auto&app=138&f=JPEG.webp',1,'2024-09-03 15:12:16','2024-09-03 15:12:16','2024-09-03 15:12:16',0),(1776477775448772610,'面试鸭 Java 后端面试题','面试鸭 Java 后端求职八股文','[\'Java\', \'后端\']','https://pic.code-nav.cn/mianshiya/question_picture/1783395206982246401/logo.png',1,'2024-09-03 15:12:16','2024-09-03 15:12:16','2024-09-03 15:12:16',0),(1787463103423897602,'Java 基础面试题','Java 基础求职八股文','[\'Java\']','https://pic.code-nav.cn/mianshiya/question_picture/1772087337535152129/java.png',1,'2024-09-03 15:12:16','2024-09-03 15:12:16','2024-09-03 15:12:16',0),(1788408712975282177,'Java 集合面试题','Java 集合求职八股文','[\'Java\']','https://pic.code-nav.cn/mianshiya/question_picture/17720